arasuperobject.biblemap.put("b19_1_1", new arasuperobject(19,1,1,"‎طوبى للرجل الذي لم يسلك في مشورة الاشرار وفي طريق الخطاة لم يقف وفي مجلس المستهزئين لم يجلس‎"));
arasuperobject.biblemap.put("b19_1_2", new arasuperobject(19,1,2,"‎لكن في ناموس الرب مسرّته وفي ناموسه يلهج نهارا وليلا‎"));
arasuperobject.biblemap.put("b19_1_3", new arasuperobject(19,1,3,"‎فيكون كشجرة مغروسة عند مجاري المياه. التي تعطي ثمرها في اوانه. وورقها لا يذبل. وكل ما يصنعه ينجح"));
arasuperobject.biblemap.put("b19_1_4", new arasuperobject(19,1,4,"ليس كذلك الاشرار لكنهم كالعصافة التي تذريها الريح‎"));
arasuperobject.biblemap.put("b19_1_5", new arasuperobject(19,1,5,"‎لذلك لا تقوم الاشرار في الدين ولا الخطاة في جماعة الابرار‎"));
arasuperobject.biblemap.put("b19_1_6", new arasuperobject(19,1,6,"‎لان الرب يعلم طريق الابرار. اما طريق الاشرار فتهلك"));
arasuperobject.biblemap.put("b19_2_1", new arasuperobject(19,2,1,"لماذا ارتجّت الامم وتفكّر الشعوب في الباطل‎"));
arasuperobject.biblemap.put("b19_2_2", new arasuperobject(19,2,2,"‎قام ملوك الارض وتآمر الرؤساء معا على الرب وعلى مسيحه قائلين"));
arasuperobject.biblemap.put("b19_2_3", new arasuperobject(19,2,3,"لنقطع قيودهما ولنطرح عنا ربطهما"));
arasuperobject.biblemap.put("b19_2_4", new arasuperobject(19,2,4,"الساكن في السموات يضحك. الرب يستهزئ بهم‎"));
arasuperobject.biblemap.put("b19_2_5", new arasuperobject(19,2,5,"‎حينئذ يتكلم عليهم بغضبه ويرجفهم بغيظه‎"));
arasuperobject.biblemap.put("b19_2_6", new arasuperobject(19,2,6,"‎اما انا فقد مسحت ملكي على صهيون جبل قدسي"));
arasuperobject.biblemap.put("b19_2_7", new arasuperobject(19,2,7,"اني اخبر من جهة قضاء الرب. قال لي انت ابني. انا اليوم ولدتك"));
arasuperobject.biblemap.put("b19_2_8", new arasuperobject(19,2,8,"اسألني فاعطيك الامم ميراثا لك واقاصي الارض ملكا لك‎"));
arasuperobject.biblemap.put("b19_2_9", new arasuperobject(19,2,9,"‎تحطمهم بقضيب من حديد. مثل اناء خزّاف تكسّرهم"));
arasuperobject.biblemap.put("b19_2_10", new arasuperobject(19,2,10,"فالآن يا ايها الملوك تعقلوا. تأدبوا يا قضاة الارض‎"));
arasuperobject.biblemap.put("b19_2_11", new arasuperobject(19,2,11,"‎اعبدوا الرب بخوف واهتفوا برعدة‎"));
arasuperobject.biblemap.put("b19_2_12", new arasuperobject(19,2,12,"‎قبّلوا الابن لئلا يغضب فتبيدوا من الطريق لانه عن قليل يتقد غضبه. طوبى لجميع المتكلين عليه"));
arasuperobject.biblemap.put("b19_3_1", new arasuperobject(19,3,1,"مزمور لداود حينما هرب من وجه ابشالوم ابنه‎. ‎يا رب ما اكثر مضايقي. كثيرون قائمون عليّ‎"));
arasuperobject.biblemap.put("b19_3_2", new arasuperobject(19,3,2,"‎كثيرون يقولون لنفسي ليس له خلاص بالهه. سلاه"));
arasuperobject.biblemap.put("b19_3_3", new arasuperobject(19,3,3,"اما انت يا رب فترس لي. مجدي ورافع رأسي‎"));
arasuperobject.biblemap.put("b19_3_4", new arasuperobject(19,3,4,"‎بصوتي الى الرب اصرخ فيجيبني من جبل قدسه. سلاه"));
