arasuperobject.biblemap.put("b19_76_1", new arasuperobject(19,76,1,"لامام المغنين على ذوات الاوتار. مزمور لآساف. تسبيحة‎. ‎الله معروف في يهوذا اسمه عظيم في اسرائيل‎"));
