arasuperobject.biblemap.put("b19_76_3", new arasuperobject(19,76,3,"‎هناك سحق القسي البارقة. المجن والسيف والقتال. سلاه"));
arasuperobject.biblemap.put("b19_76_4", new arasuperobject(19,76,4,"ابهى انت امجد من جبال السلب‎"));
arasuperobject.biblemap.put("b19_76_5", new arasuperobject(19,76,5,"‎سلب اشداء القلب. ناموا سنتهم. كل رجال البأس لم يجدوا ايديهم"));
arasuperobject.biblemap.put("b19_76_6", new arasuperobject(19,76,6,"من انتهارك يا اله يعقوب يسبخ فارس وخيل‎"));
arasuperobject.biblemap.put("b19_76_7", new arasuperobject(19,76,7,"‎انت مهوب انت. فمن يقف قدامك حال غضبك‎"));
arasuperobject.biblemap.put("b19_76_8", new arasuperobject(19,76,8,"‎من السماء اسمعت حكما. الارض فزعت وسكتت"));
arasuperobject.biblemap.put("b19_76_9", new arasuperobject(19,76,9,"عند قيام الله للقضاء لتخليص كل ودعاء الارض. سلاه‎"));
arasuperobject.biblemap.put("b19_76_10", new arasuperobject(19,76,10,"‎لان غضب الانسان يحمدك. بقية الغضب تتمنطق بها"));
arasuperobject.biblemap.put("b19_76_11", new arasuperobject(19,76,11,"انذروا واوفوا للرب الهكم يا جميع الذين حوله. ليقدموا هدية للمهوب‎"));
arasuperobject.biblemap.put("b19_76_12", new arasuperobject(19,76,12,"‎يقطف روح الرؤساء. هو مهوب لملوك الارض"));
arasuperobject.biblemap.put("b19_77_1", new arasuperobject(19,77,1,"لامام المغنين على يدوثون. لآساف مزمور‎. ‎صوتي الى الله فاصرخ. صوتي الى الله فاصغى اليّ‎"));
arasuperobject.biblemap.put("b19_77_2", new arasuperobject(19,77,2,"‎في يوم ضيقي التمست الرب. يدي في الليل انبسطت ولم تخدر. ابت نفسي التعزية‎"));
arasuperobject.biblemap.put("b19_77_3", new arasuperobject(19,77,3,"‎اذكر الله فأئنّ. اناجي نفسي فيغشى على روحي. سلاه"));
arasuperobject.biblemap.put("b19_77_4", new arasuperobject(19,77,4,"امسكت اجفان عيني. انزعجت فلم اتكلم‎"));
arasuperobject.biblemap.put("b19_77_5", new arasuperobject(19,77,5,"‎تفكرت في ايام القدم السنين الدهرية‎"));
arasuperobject.biblemap.put("b19_77_6", new arasuperobject(19,77,6,"‎اذكر ترنمي في الليل. مع قلبي اناجي وروحي تبحث‎"));
arasuperobject.biblemap.put("b19_77_7", new arasuperobject(19,77,7,"‎هل الى الدهور يرفض الرب ولا يعود للرضا بعد‎"));
arasuperobject.biblemap.put("b19_77_8", new arasuperobject(19,77,8,"‎هل انتهت الى الابد رحمته انقطعت كلمته الى دور فدور‎"));
arasuperobject.biblemap.put("b19_77_9", new arasuperobject(19,77,9,"‎هل نسي الله رأفة او قفص برجزه مراحمه. سلاه"));
arasuperobject.biblemap.put("b19_77_10", new arasuperobject(19,77,10,"فقلت هذا ما يعلّني تغيّر يمين العلي‎"));
arasuperobject.biblemap.put("b19_77_11", new arasuperobject(19,77,11,"‎اذكر اعمال الرب اذ اتذكر عجائبك منذ القدم"));
arasuperobject.biblemap.put("b19_77_12", new arasuperobject(19,77,12,"والهج بجميع افعالك وبصنائعك اناجي"));
arasuperobject.biblemap.put("b19_77_13", new arasuperobject(19,77,13,"اللهم في القدس طريقك. اي اله عظيم مثل الله‎"));
arasuperobject.biblemap.put("b19_77_14", new arasuperobject(19,77,14,"‎انت الاله الصانع العجائب. عرفت بين الشعوب قوتك‎"));
arasuperobject.biblemap.put("b19_77_15", new arasuperobject(19,77,15,"‎فككت بذراعك شعبك بني يعقوب ويوسف. سلاه‎"));
arasuperobject.biblemap.put("b19_77_16", new arasuperobject(19,77,16,"‎ابصرتك المياه يا الله ابصرتك المياه ففزعت ارتعدت ايضا اللجج"));
arasuperobject.biblemap.put("b19_77_17", new arasuperobject(19,77,17,"سكبت الغيوم مياها اعطت السحب صوتا. ايضا سهامك طارت‎"));
arasuperobject.biblemap.put("b19_77_18", new arasuperobject(19,77,18,"‎صوت رعدك في الزوبعة البروق اضاءت المسكونة. ارتعدت ورجفت الارض‎"));
arasuperobject.biblemap.put("b19_77_19", new arasuperobject(19,77,19,"‎في البحر طريقك وسبلك في المياه الكثيرة وآثارك لم تعرف‎"));
arasuperobject.biblemap.put("b19_77_20", new arasuperobject(19,77,20,"‎هديت شعبك كالغنم بيد موسى وهرون"));
arasuperobject.biblemap.put("b19_78_1", new arasuperobject(19,78,1,"قصيدة لآساف‎. ‎اصغ يا شعبي الى شريعتي. اميلوا آذانكم الى كلام فمي‎"));
arasuperobject.biblemap.put("b19_78_2", new arasuperobject(19,78,2,"‎افتح بمثل فمي. اذيع الغازا منذ القدم‎"));
arasuperobject.biblemap.put("b19_78_3", new arasuperobject(19,78,3,"‎التي سمعناها وعرفناها وآباؤنا اخبرونا‎"));
arasuperobject.biblemap.put("b19_78_4", new arasuperobject(19,78,4,"‎لا نخفي عن بنيهم الى الجيل الآخر مخبرين بتسابيح الرب وقوته وعجائبه التي صنع‎"));
arasuperobject.biblemap.put("b19_78_5", new arasuperobject(19,78,5,"‎اقام شهادة في يعقوب ووضع شريعة في اسرائيل التي اوصى آباءنا ان يعرّفوا بها ابناءهم"));
arasuperobject.biblemap.put("b19_78_6", new arasuperobject(19,78,6,"لكي يعلم الجيل الآخر. بنون يولدون فيقومون ويخبرون ابناءهم"));
arasuperobject.biblemap.put("b19_78_7", new arasuperobject(19,78,7,"فيجعلون على الله اعتمادهم ولا ينسون اعمال الله بل يحفظون وصاياه"));
arasuperobject.biblemap.put("b19_78_8", new arasuperobject(19,78,8,"ولا يكونون مثل آبائهم جيلا زائغا وماردا جيلا لم يثبت قلبه ولم تكن روحه امينة لله"));
arasuperobject.biblemap.put("b19_78_9", new arasuperobject(19,78,9,"بنو افرايم النازعون في القوس الرامون انقلبوا في يوم الحرب‎"));
arasuperobject.biblemap.put("b19_78_10", new arasuperobject(19,78,10,"‎لم يحفظوا عهد الله وابوا السلوك في شريعته"));
arasuperobject.biblemap.put("b19_78_11", new arasuperobject(19,78,11,"ونسوا افعاله وعجائبه التي اراهم‎"));
arasuperobject.biblemap.put("b19_78_12", new arasuperobject(19,78,12,"‎قدام آبائهم صنع اعجوبة في ارض مصر بلاد صوعن‎"));
arasuperobject.biblemap.put("b19_78_13", new arasuperobject(19,78,13,"‎شق البحر فعبّرهم ونصب المياه كندّ‎"));
arasuperobject.biblemap.put("b19_78_14", new arasuperobject(19,78,14,"‎وهداهم بالسحاب نهارا والليل كله بنور نار‎"));
arasuperobject.biblemap.put("b19_78_15", new arasuperobject(19,78,15,"‎شق صخورا في البرية وسقاهم كانه من لجج عظيمة‎"));
arasuperobject.biblemap.put("b19_78_16", new arasuperobject(19,78,16,"‎اخرج مجاري من صخرة واجرى مياها كالانهار‎"));
arasuperobject.biblemap.put("b19_78_17", new arasuperobject(19,78,17,"‎ثم عادوا ايضا ليخطئوا اليه لعصيان العلي في الارض الناشفة‎"));
arasuperobject.biblemap.put("b19_78_18", new arasuperobject(19,78,18,"‎وجربوا الله في قلوبهم بسؤالهم طعاما لشهوتهم‎"));
arasuperobject.biblemap.put("b19_78_19", new arasuperobject(19,78,19,"‎فوقعوا في الله. قالوا هل يقدر الله ان يرتب مائدة في البرية‎"));
arasuperobject.biblemap.put("b19_78_20", new arasuperobject(19,78,20,"‎هوذا ضرب الصخرة فجرت المياه وفاضت الاودية. هل يقدر ايضا ان يعطي خبزا ويهيئ لحما لشعبه‎"));
arasuperobject.biblemap.put("b19_78_21", new arasuperobject(19,78,21,"‎لذلك سمع الرب فغضب واشتعلت نار في يعقوب وسخط ايضا صعد على اسرائيل‎"));
arasuperobject.biblemap.put("b19_78_22", new arasuperobject(19,78,22,"‎لانهم لم يؤمنوا بالله ولم يتكلوا على خلاصه‎"));
arasuperobject.biblemap.put("b19_78_23", new arasuperobject(19,78,23,"‎فامر السحاب من فوق وفتح مصاريع السموات"));
arasuperobject.biblemap.put("b19_78_24", new arasuperobject(19,78,24,"وامطر عليهم منّا للأكل وبر السماء اعطاهم‎"));
arasuperobject.biblemap.put("b19_78_25", new arasuperobject(19,78,25,"‎اكل الانسان خبز الملائكة. ارسل عليهم زادا للشبع‎"));
arasuperobject.biblemap.put("b19_78_26", new arasuperobject(19,78,26,"‎اهاج شرقية في السماء وساق بقوته جنوبية"));
arasuperobject.biblemap.put("b19_78_27", new arasuperobject(19,78,27,"وامطر عليهم لحما مثل التراب وكرمل البحر طيورا ذوات اجنحة‎"));
arasuperobject.biblemap.put("b19_78_28", new arasuperobject(19,78,28,"‎واسقطها في وسط محلتهم حوالي مساكنهم‎"));
arasuperobject.biblemap.put("b19_78_29", new arasuperobject(19,78,29,"‎فأكلوا وشبعوا جدا واتاهم بشهوتهم‎"));
arasuperobject.biblemap.put("b19_78_30", new arasuperobject(19,78,30,"‎لم يزوغوا عن شهوتهم طعامهم بعد في افواههم"));
arasuperobject.biblemap.put("b19_78_31", new arasuperobject(19,78,31,"فصعد عليهم غضب الله وقتل من اسمنهم. وصرع مختاري اسرائيل‎"));
arasuperobject.biblemap.put("b19_78_32", new arasuperobject(19,78,32,"‎في هذا كله اخطأوا بعد ولم يؤمنوا بعجائبه"));
arasuperobject.biblemap.put("b19_78_33", new arasuperobject(19,78,33,"فافنى ايامهم بالباطل وسنيهم بالرعب‎"));
arasuperobject.biblemap.put("b19_78_34", new arasuperobject(19,78,34,"‎اذ قتلهم طلبوه ورجعوا وبكروا الى الله"));
arasuperobject.biblemap.put("b19_78_35", new arasuperobject(19,78,35,"وذكروا ان الله صخرتهم والله العلي وليّهم‎"));
arasuperobject.biblemap.put("b19_78_36", new arasuperobject(19,78,36,"‎فخادعوه بافواههم وكذبوا عليه بالسنتهم‎"));
arasuperobject.biblemap.put("b19_78_37", new arasuperobject(19,78,37,"‎اما قلوبهم فلم تثبت معه ولم يكونوا امناء في عهده"));
arasuperobject.biblemap.put("b19_78_38", new arasuperobject(19,78,38,"اما هو فرؤوف يغفر الاثم ولا يهلك وكثيرا ما رد غضبه ولم يشعل كل سخطه‎"));
arasuperobject.biblemap.put("b19_78_39", new arasuperobject(19,78,39,"‎ذكر انهم بشر ريح تذهب ولا تعود‎"));
arasuperobject.biblemap.put("b19_78_40", new arasuperobject(19,78,40,"‎كم عصوه في البرية واحزنوه في القفر‎"));
arasuperobject.biblemap.put("b19_78_41", new arasuperobject(19,78,41,"‎رجعوا وجربوا الله وعنّوا قدوس اسرائيل‎"));
arasuperobject.biblemap.put("b19_78_42", new arasuperobject(19,78,42,"‎لم يذكروا يده يوم فداهم من العدو"));
arasuperobject.biblemap.put("b19_78_43", new arasuperobject(19,78,43,"حيث جعل في مصر آياته وعجائبه في بلاد صوعن"));
arasuperobject.biblemap.put("b19_78_44", new arasuperobject(19,78,44,"اذ حول خلجانهم الى دم ومجاريهم لكي لا يشربوا‎"));
arasuperobject.biblemap.put("b19_78_45", new arasuperobject(19,78,45,"‎ارسل عليهم بعوضا فاكلهم وضفادع فافسدتهم‎"));
arasuperobject.biblemap.put("b19_78_46", new arasuperobject(19,78,46,"‎اسلم للجردم غلتهم وتعبهم للجراد‎"));
arasuperobject.biblemap.put("b19_78_47", new arasuperobject(19,78,47,"‎اهلك بالبرد كرومهم وجميزهم بالصقيع‎"));
arasuperobject.biblemap.put("b19_78_48", new arasuperobject(19,78,48,"‎ودفع الى البرد بهائمهم ومواشيهم للبروق‎"));
arasuperobject.biblemap.put("b19_78_49", new arasuperobject(19,78,49,"‎ارسل عليهم حمو غضبه سخطا ورجزا وضيقا جيش ملائكة اشرار‏‎"));
arasuperobject.biblemap.put("b19_78_50", new arasuperobject(19,78,50,"‎مهد سبيلا لغضبه. لم يمنع من الموت انفسهم بل دفع حياتهم للوبإ"));
arasuperobject.biblemap.put("b19_78_51", new arasuperobject(19,78,51,"وضرب كل بكر في مصر. اوائل القدرة في خيام حام‎"));
arasuperobject.biblemap.put("b19_78_52", new arasuperobject(19,78,52,"‎وساق مثل الغنم شعبه وقادهم مثل قطيع في البرية‎"));
arasuperobject.biblemap.put("b19_78_53", new arasuperobject(19,78,53,"‎وهداهم آمنين فلم يجزعوا. اما اعداؤهم فغمرهم البحر‎"));
arasuperobject.biblemap.put("b19_78_54", new arasuperobject(19,78,54,"‎وادخلهم في تخوم قدسه هذا الجبل الذي اقتنته يمينه‎"));
arasuperobject.biblemap.put("b19_78_55", new arasuperobject(19,78,55,"‎وطرد الامم من قدامهم وقسمهم بالحبل ميراثا واسكن في خيامهم اسباط اسرائيل"));
arasuperobject.biblemap.put("b19_78_56", new arasuperobject(19,78,56,"فجربوا وعصوا الله العلي وشهاداته لم يحفظوا"));
arasuperobject.biblemap.put("b19_78_57", new arasuperobject(19,78,57,"بل ارتدّوا وغدروا مثل آبائهم. انحرفوا كقوس مخطئة‎"));
arasuperobject.biblemap.put("b19_78_58", new arasuperobject(19,78,58,"‎اغاظوه بمرتفعاتهم واغاروه بتماثيلهم‎"));
arasuperobject.biblemap.put("b19_78_59", new arasuperobject(19,78,59,"‎سمع الله فغضب ورذل اسرائيل جدا"));
arasuperobject.biblemap.put("b19_78_60", new arasuperobject(19,78,60,"ورفض مسكن شيلو الخيمة التي نصبها بين الناس‎"));
arasuperobject.biblemap.put("b19_78_61", new arasuperobject(19,78,61,"‎وسلم للسبي عزه وجلاله ليد العدو‎"));
arasuperobject.biblemap.put("b19_78_62", new arasuperobject(19,78,62,"‎ودفع الى السيف شعبه وغضب على ميراثه‎"));
arasuperobject.biblemap.put("b19_78_63", new arasuperobject(19,78,63,"‎مختاروه اكلتهم النار وعذاراه لم يحمدن‎"));
arasuperobject.biblemap.put("b19_78_64", new arasuperobject(19,78,64,"‎كهنته سقطوا بالسيف وارامله لم يبكين"));
arasuperobject.biblemap.put("b19_78_65", new arasuperobject(19,78,65,"فاستيقظ الرب كنائم كجبار معّيط من الخمر‎"));
arasuperobject.biblemap.put("b19_78_66", new arasuperobject(19,78,66,"‎فضرب اعداءه الى الوراء. جعلهم عارا ابديا‎"));
arasuperobject.biblemap.put("b19_78_67", new arasuperobject(19,78,67,"‎ورفض خيمة يوسف ولم يختر سبط افرايم‎"));
arasuperobject.biblemap.put("b19_78_68", new arasuperobject(19,78,68,"‎بل اختار سبط يهوذا جبل صهيون الذي احبه‎"));
arasuperobject.biblemap.put("b19_78_69", new arasuperobject(19,78,69,"‎وبنى مثل مرتفعات مقدسه كالارض التي اسسها الى الابد‎"));
arasuperobject.biblemap.put("b19_78_70", new arasuperobject(19,78,70,"‎واختار داود عبده واخذه من حظائر الغنم‎"));
arasuperobject.biblemap.put("b19_78_71", new arasuperobject(19,78,71,"‎من خلف المرضعات أتى به ليرعى يعقوب شعبه واسرائيل ميراثه‎"));
arasuperobject.biblemap.put("b19_78_72", new arasuperobject(19,78,72,"‎فرعاهم حسب كمال قلبه وبمهارة يديه هداهم"));
arasuperobject.biblemap.put("b19_79_1", new arasuperobject(19,79,1,"مزمور. لآساف‎. ‎اللهم ان الامم قد دخلوا ميراثك. نجسوا هيكل قدسك. جعلوا اورشليم اكواما‎"));
arasuperobject.biblemap.put("b19_79_2", new arasuperobject(19,79,2,"‎دفعوا جثث عبيدك طعاما لطيور السماء. لحم اتقيائك لوحوش الارض"));
arasuperobject.biblemap.put("b19_79_3", new arasuperobject(19,79,3,"سفكوا دمهم كالماء حول اورشليم وليس من يدفن‎"));
arasuperobject.biblemap.put("b19_79_4", new arasuperobject(19,79,4,"‎صرنا عارا عند جيراننا هزءا وسخرة للذين حولنا‎"));
arasuperobject.biblemap.put("b19_79_5", new arasuperobject(19,79,5,"‎الى متى يا رب تغضب كل الغضب وتتقد كالنار غيرتك‎"));
arasuperobject.biblemap.put("b19_79_6", new arasuperobject(19,79,6,"‎افض رجزك على الامم الذين لا يعرفونك وعلى الممالك التي لم تدع باسمك‎"));
arasuperobject.biblemap.put("b19_79_7", new arasuperobject(19,79,7,"‎لانهم قد اكلوا يعقوب واخربوا مسكنه"));
arasuperobject.biblemap.put("b19_79_8", new arasuperobject(19,79,8,"لا تذكر علينا ذنوب الاولين. لتتقدمنا مراحمك سريعا لاننا قد تذللنا جدا‎"));
arasuperobject.biblemap.put("b19_79_9", new arasuperobject(19,79,9,"‎أعنّا يا اله خلاصنا من اجل مجد اسمك ونجنا واغفر خطايانا من اجل اسمك‎"));
arasuperobject.biblemap.put("b19_79_10", new arasuperobject(19,79,10,"‎لماذا يقول الامم اين هو الههم. لتعرف عند الامم قدام اعيننا نقمة دم عبيدك المهراق‎"));
arasuperobject.biblemap.put("b19_79_11", new arasuperobject(19,79,11,"‎ليدخل قدامك انين الاسير. كعظمة ذراعك استبق بني الموت‎"));
arasuperobject.biblemap.put("b19_79_12", new arasuperobject(19,79,12,"‎ورد على جيراننا سبعة اضعاف في احضانهم العار الذي عيروك به يا رب‎"));
arasuperobject.biblemap.put("b19_79_13", new arasuperobject(19,79,13,"‎اما نحن شعبك وغنم رعايتك نحمدك الى الدهر. الى دور فدور نحدث بتسبيحك"));
arasuperobject.biblemap.put("b19_80_1", new arasuperobject(19,80,1,"لامام المغنين. على السوسن. شهادة. لآساف. مزمور‎. ‎يا راعي اسرائيل اصغ يا قائد يوسف كالضأن يا جالسا على الكروبيم اشرق"));
arasuperobject.biblemap.put("b19_80_2", new arasuperobject(19,80,2,"قدام افرايم وبنيامين ومنسّى ايقظ جبروتك وهلم لخلاصنا‎"));
arasuperobject.biblemap.put("b19_80_3", new arasuperobject(19,80,3,"‎يا الله ارجعنا وانر بوجهك فنخلص"));
arasuperobject.biblemap.put("b19_80_4", new arasuperobject(19,80,4,"يا رب اله الجنود الى متى تدخن على صلاة شعبك‎"));
arasuperobject.biblemap.put("b19_80_5", new arasuperobject(19,80,5,"‎قد اطعمتهم خبز الدموع وسقيتهم الدموع بالكيل‎"));
arasuperobject.biblemap.put("b19_80_6", new arasuperobject(19,80,6,"‎جعلتنا نزاعا عند جيراننا واعداؤنا يستهزئون بين انفسهم‎"));
arasuperobject.biblemap.put("b19_80_7", new arasuperobject(19,80,7,"‎يا اله الجنود ارجعنا وانر بوجهك فنخلص"));
arasuperobject.biblemap.put("b19_80_8", new arasuperobject(19,80,8,"كرمة من مصر نقلت. طردت امما وغرستها‎"));
arasuperobject.biblemap.put("b19_80_9", new arasuperobject(19,80,9,"‎هيأت قدامها فأصلت اصولها فملأت الارض‎"));
arasuperobject.biblemap.put("b19_80_10", new arasuperobject(19,80,10,"‎غطى الجبال ظلها واغصانها ارز الله‎"));
arasuperobject.biblemap.put("b19_80_11", new arasuperobject(19,80,11,"‎مدت قضبانها الى البحر والى النهر فروعها‎"));
arasuperobject.biblemap.put("b19_80_12", new arasuperobject(19,80,12,"‎فلماذا هدمت جدرانها فيقطفها كل عابري الطريق‎"));
arasuperobject.biblemap.put("b19_80_13", new arasuperobject(19,80,13,"‎يفسدها الخنزير من الوعر ويرعاها وحش البرية"));
arasuperobject.biblemap.put("b19_80_14", new arasuperobject(19,80,14,"يا اله الجنود ارجعنّ اطّلع من السماء وانظر وتعهد هذه الكرمة"));
arasuperobject.biblemap.put("b19_80_15", new arasuperobject(19,80,15,"والغرس الذي غرسته يمينك والابن الذي اخترته لنفسك‎"));
arasuperobject.biblemap.put("b19_80_16", new arasuperobject(19,80,16,"‎هي محروقة بنار مقطوعة. من انتهار وجهك يبيدون‎"));
arasuperobject.biblemap.put("b19_80_17", new arasuperobject(19,80,17,"‎لتكن يدك على رجل يمينك وعلى ابن آدم الذي اخترته لنفسك‎"));
arasuperobject.biblemap.put("b19_80_18", new arasuperobject(19,80,18,"‎فلا نرتد عنك. أحينا فندعو باسمك‎"));
arasuperobject.biblemap.put("b19_80_19", new arasuperobject(19,80,19,"‎يا رب اله الجنود ارجعنا. أنر بوجهك فنخلص"));
arasuperobject.biblemap.put("b19_81_1", new arasuperobject(19,81,1,"لامام المغنين على الجتية. لآساف‎. ‎رنموا لله قوتنا اهتفوا لاله يعقوب‎"));
arasuperobject.biblemap.put("b19_81_2", new arasuperobject(19,81,2,"‎ارفعوا نغمة وهاتوا دفا عودا حلوا مع رباب‎"));
arasuperobject.biblemap.put("b19_81_3", new arasuperobject(19,81,3,"‎انفخوا في راس الشهر بالبوق عند الهلال ليوم عيدنا‎"));
arasuperobject.biblemap.put("b19_81_4", new arasuperobject(19,81,4,"‎لان هذا فريضة لاسرائيل حكم لاله يعقوب‎"));
arasuperobject.biblemap.put("b19_81_5", new arasuperobject(19,81,5,"‎جعله شهادة في يوسف عند خروجه على ارض مصر. سمعت لسانا لم اعرفه"));
arasuperobject.biblemap.put("b19_81_6", new arasuperobject(19,81,6,"ابعدت من الحمل كتفه. يداه تحولتا عن السل‎"));
arasuperobject.biblemap.put("b19_81_7", new arasuperobject(19,81,7,"‎في الضيق دعوت فنجيتك. استجبتك في ستر الرعد. جربتك على ماء مريبة. سلاه"));
arasuperobject.biblemap.put("b19_81_8", new arasuperobject(19,81,8,"اسمع يا شعبي فاحذرك. يا اسرائيل ان سمعت لي"));
arasuperobject.biblemap.put("b19_81_9", new arasuperobject(19,81,9,"لا يكن فيك اله غريب ولا تسجد لاله اجنبي‎"));
arasuperobject.biblemap.put("b19_81_10", new arasuperobject(19,81,10,"‎انا الرب الهك الذي اصعدك من ارض مصر. افغر فاك فاملأه‎"));
arasuperobject.biblemap.put("b19_81_11", new arasuperobject(19,81,11,"‎فلم يسمع شعبي لصوتي واسرائيل لم يرض بي‎"));
arasuperobject.biblemap.put("b19_81_12", new arasuperobject(19,81,12,"‎فسلمتهم الى قساوة قلوبهم. ليسلكوا في مؤامرات انفسهم‎"));
arasuperobject.biblemap.put("b19_81_13", new arasuperobject(19,81,13,"‎لو سمع لي شعبي وسلك اسرائيل في طرقي"));
arasuperobject.biblemap.put("b19_81_14", new arasuperobject(19,81,14,"سريعا كنت اخضع اعداءهم وعلى مضايقيهم كنت ارد يدي‎"));
arasuperobject.biblemap.put("b19_81_15", new arasuperobject(19,81,15,"‎مبغضو الرب يتذللون له. ويكون وقتهم الى الدهر‎"));
arasuperobject.biblemap.put("b19_81_16", new arasuperobject(19,81,16,"‎وكان اطعمه من شحم الحنطة. ومن الصخرة كنت اشبعك عسلا"));
arasuperobject.biblemap.put("b19_82_1", new arasuperobject(19,82,1,"مزمور لآساف‎. ‎الله قائم في مجمع الله. في وسط الآلهة يقضي‎"));
arasuperobject.biblemap.put("b19_82_2", new arasuperobject(19,82,2,"‎حتى متى تقضون جورا وترفعون وجوه الاشرار. سلاه‎"));
arasuperobject.biblemap.put("b19_82_3", new arasuperobject(19,82,3,"‎اقضوا للذليل ولليتيم. انصفوا المسكين والبائس‎"));
arasuperobject.biblemap.put("b19_82_4", new arasuperobject(19,82,4,"‎نجوا المسكين والفقير. من يد الاشرار انقذوا"));
arasuperobject.biblemap.put("b19_82_5", new arasuperobject(19,82,5,"لا يعلمون ولا يفهمون. في الظلمة يتمشون. تتزعزع كل أسس الارض"));
arasuperobject.biblemap.put("b19_82_6", new arasuperobject(19,82,6,"انا قلت انكم آلهة وبنو العلي كلكم‎"));
arasuperobject.biblemap.put("b19_82_7", new arasuperobject(19,82,7,"‎لكن مثل الناس تموتون وكاحد الرؤساء تسقطون‎"));
arasuperobject.biblemap.put("b19_82_8", new arasuperobject(19,82,8,"‎قم يا الله. دن الارض. لانك انت تمتلك كل الامم"));
arasuperobject.biblemap.put("b19_83_1", new arasuperobject(19,83,1,"تسبيحة. مزمور لآساف‎. ‎اللهم لا تصمت لا تسكت ولا تهدأ يا الله‎"));
arasuperobject.biblemap.put("b19_83_2", new arasuperobject(19,83,2,"‎فهوذا اعداؤك يعجون ومبغضوك قد رفعوا الراس‎"));
arasuperobject.biblemap.put("b19_83_3", new arasuperobject(19,83,3,"‎على شعبك مكروا مؤامرة وتشاوروا على أحميائك‎"));
arasuperobject.biblemap.put("b19_83_4", new arasuperobject(19,83,4,"‎قالوا هلم نبدهم من بين الشعوب ولا يذكر اسم اسرائيل بعد"));
arasuperobject.biblemap.put("b19_83_5", new arasuperobject(19,83,5,"لانهم تآمروا بالقلب معا. عليك تعاهدوا عهدا‎"));
arasuperobject.biblemap.put("b19_83_6", new arasuperobject(19,83,6,"‎خيام ادوم والاسمعيليين . موآب والهاجريون‎"));
arasuperobject.biblemap.put("b19_83_7", new arasuperobject(19,83,7,"‎جبال وعمون وعماليق. فلسطين مع سكان صور‎"));
arasuperobject.biblemap.put("b19_83_8", new arasuperobject(19,83,8,"‎اشور ايضا اتفق معهم. صاروا ذراعا لبني لوط. سلاه‎"));
arasuperobject.biblemap.put("b19_83_9", new arasuperobject(19,83,9,"‎افعل بهم كما بمديان كما بسيسرا كما بيابين في وادي قيشون‎"));
arasuperobject.biblemap.put("b19_83_10", new arasuperobject(19,83,10,"‎بادوا في عين دور. صاروا دمنا للارض‎"));
arasuperobject.biblemap.put("b19_83_11", new arasuperobject(19,83,11,"‎اجعلهم شرفاءهم مثل غراب ومثل ذئب. ومثل زبح ومثل صلمناع كل امرائهم‎"));
arasuperobject.biblemap.put("b19_83_12", new arasuperobject(19,83,12,"‎الذين قالوا لنمتلك لانفسنا مساكن الله"));
arasuperobject.biblemap.put("b19_83_13", new arasuperobject(19,83,13,"يا الهي اجعلهم مثل الجل مثل القش امام الريح‎"));
arasuperobject.biblemap.put("b19_83_14", new arasuperobject(19,83,14,"‎كنار تحرق الوعر كلهيب يشعل الجبال"));
arasuperobject.biblemap.put("b19_83_15", new arasuperobject(19,83,15,"هكذا اطردهم بعاصفتك وبزوبعتك روعهم‎"));
arasuperobject.biblemap.put("b19_83_16", new arasuperobject(19,83,16,"‎املأ وجوههم خزيا فيطلبوا اسمك يا رب‎"));
arasuperobject.biblemap.put("b19_83_17", new arasuperobject(19,83,17,"‎ليخزوا ويرتاعوا الى الابد وليخجلوا ويبيدوا"));
arasuperobject.biblemap.put("b19_83_18", new arasuperobject(19,83,18,"ويعلموا انك اسمك يهوه وحدك العلي على كل الارض"));
arasuperobject.biblemap.put("b19_84_1", new arasuperobject(19,84,1,"لامام المغنين على الجتية. لبني قورح. مزمور‎. ‎ما احلى مساكنك يا رب الجنود‎"));
arasuperobject.biblemap.put("b19_84_2", new arasuperobject(19,84,2,"‎تشتاق بل تتوق نفسي الى ديار الرب. قلبي ولحمي يهتفان بالاله الحي‎"));
arasuperobject.biblemap.put("b19_84_3", new arasuperobject(19,84,3,"‎العصفور ايضا وجد بيتا والسنونة عشّا لنفسها حيث تضع افراخها مذابحك يا رب الجنود ملكي والهي‎"));
arasuperobject.biblemap.put("b19_84_4", new arasuperobject(19,84,4,"‎طوبى للساكنين في بيتك ابدا يسبحونك. سلاه"));
arasuperobject.biblemap.put("b19_84_5", new arasuperobject(19,84,5,"طوبى لاناس عزهم بك. طرق بيتك في قلوبهم‎"));
arasuperobject.biblemap.put("b19_84_6", new arasuperobject(19,84,6,"‎عابرين في وادي البكاء يصيرونه ينبوعا. ايضا ببركات يغطون مورة"));
arasuperobject.biblemap.put("b19_84_7", new arasuperobject(19,84,7,"يذهبون من قوة الى قوة. يرون قدام الله في صهيون"));
arasuperobject.biblemap.put("b19_84_8", new arasuperobject(19,84,8,"يا رب اله الجنود اسمع صلاتي واصغ يا اله يعقوب. سلاه‎"));
arasuperobject.biblemap.put("b19_84_9", new arasuperobject(19,84,9,"‎يا مجننا انظر يا الله والتفت الى وجه مسيحك‎"));
arasuperobject.biblemap.put("b19_84_10", new arasuperobject(19,84,10,"‎لان يوما واحدا في ديارك خير من الف. اخترت الوقوف على العتبة في بيت الهي على السكن في خيام الاشرار‎"));
arasuperobject.biblemap.put("b19_84_11", new arasuperobject(19,84,11,"‎لان الرب الله شمس ومجن. الرب يعطي رحمة ومجدا. لا يمنع خيرا عن السالكين بالكمال‎"));
arasuperobject.biblemap.put("b19_84_12", new arasuperobject(19,84,12,"‎يا رب الجنود طوبى للانسان المتكل عليك"));
arasuperobject.biblemap.put("b19_85_1", new arasuperobject(19,85,1,"لامام المغنين. لبني قورح. مزمور‎. ‎رضيت يا رب على ارضك. ارجعت سبي يعقوب‎"));
arasuperobject.biblemap.put("b19_85_2", new arasuperobject(19,85,2,"‎غفرت اثم شعبك. سترت كل خطيتهم. سلاه‎"));
arasuperobject.biblemap.put("b19_85_3", new arasuperobject(19,85,3,"‎حجزت كل رجزك. رجعت عن حمو غضبك‎"));
arasuperobject.biblemap.put("b19_85_4", new arasuperobject(19,85,4,"‎ارجعنا يا اله خلاصنا وانف غضبك عنا‎"));
arasuperobject.biblemap.put("b19_85_5", new arasuperobject(19,85,5,"‎هل الى الدهر تسخط علينا. هل تطيل غضبك الى دور فدور‎"));
arasuperobject.biblemap.put("b19_85_6", new arasuperobject(19,85,6,"‎ألا تعود انت فتحيينا فيفرح بك شعبك‎"));
arasuperobject.biblemap.put("b19_85_7", new arasuperobject(19,85,7,"‎أرنا يا رب رحمتك واعطنا خلاصك"));
arasuperobject.biblemap.put("b19_85_8", new arasuperobject(19,85,8,"اني اسمع ما يتكلم به الله الرب. لانه يتكلم بالسلام لشعبه ولاتقيائه فلا يرجعن الى الحماقة‎"));
arasuperobject.biblemap.put("b19_85_9", new arasuperobject(19,85,9,"‎لان خلاصه قريب من خائفيه ليسكن المجد في ارضنا‎"));
arasuperobject.biblemap.put("b19_85_10", new arasuperobject(19,85,10,"‎الرحمة والحق التقيا. البر والسلام تلاثما‎"));
arasuperobject.biblemap.put("b19_85_11", new arasuperobject(19,85,11,"‎الحق من الارض ينبت والبر من السماء يطلع‎"));
arasuperobject.biblemap.put("b19_85_12", new arasuperobject(19,85,12,"‎ايضا الرب يعطي الخير وارضنا تعطي غلتها‎"));
arasuperobject.biblemap.put("b19_85_13", new arasuperobject(19,85,13,"‎البر قدامه يسلك ويطأ في طريق خطواته"));
arasuperobject.biblemap.put("b19_86_1", new arasuperobject(19,86,1,"صلاة لداود‎. ‎امل يا رب اذنك. استجب لي. لاني مسكين وبائس انا‎"));
arasuperobject.biblemap.put("b19_86_2", new arasuperobject(19,86,2,"‎احفظ نفسي لاني تقي. يا الهي خلص انت عبدك المتكل عليك‏‎"));
arasuperobject.biblemap.put("b19_86_3", new arasuperobject(19,86,3,"‎ارحمني يا رب لانني اليك اصرخ اليوم كله‎"));
arasuperobject.biblemap.put("b19_86_4", new arasuperobject(19,86,4,"‎فرح نفس عبدك لانني اليك يا رب ارفع نفسي‎"));
arasuperobject.biblemap.put("b19_86_5", new arasuperobject(19,86,5,"‎لانك انت يا رب صالح وغفور وكثير الرحمة لكل الداعين اليك"));
arasuperobject.biblemap.put("b19_86_6", new arasuperobject(19,86,6,"اصغ يا رب الى صلاتي وانصت الى صوت تضرعاتي‎"));
arasuperobject.biblemap.put("b19_86_7", new arasuperobject(19,86,7,"‎في يوم ضيقي ادعوك لانك تستجيب لي‎"));
arasuperobject.biblemap.put("b19_86_8", new arasuperobject(19,86,8,"‎لا مثل لك بين الآلهة يا رب ولا مثل اعمالك‎"));
arasuperobject.biblemap.put("b19_86_9", new arasuperobject(19,86,9,"‎كل الامم الذين صنعتهم ياتون ويسجدون امامك يا رب ويمجدون اسمك"));
arasuperobject.biblemap.put("b19_86_10", new arasuperobject(19,86,10,"لانك عظيم انت وصانع عجائب. انت الله وحدك"));
arasuperobject.biblemap.put("b19_86_11", new arasuperobject(19,86,11,"علمني يا رب طريقك اسلك في حقك. وحد قلبي لخوف اسمك‎"));
arasuperobject.biblemap.put("b19_86_12", new arasuperobject(19,86,12,"‎احمدك يا رب الهي من كل قلبي وامجد اسمك الى الدهر‏‎"));
arasuperobject.biblemap.put("b19_86_13", new arasuperobject(19,86,13,"‎لان رحمتك عظيمة نحوي وقد نجيت نفسي من الهاوية السفلى"));
arasuperobject.biblemap.put("b19_86_14", new arasuperobject(19,86,14,"اللهم المتكبرون قد قاموا عليّ وجماعة العتاة طلبوا نفسي ولم يجعلوك امامهم‎"));
arasuperobject.biblemap.put("b19_86_15", new arasuperobject(19,86,15,"‎اما انت يا رب فاله رحيم ورؤوف طويل الروح وكثير الرحمة والحق"));
arasuperobject.biblemap.put("b19_86_16", new arasuperobject(19,86,16,"التفت اليّ وارحمني. اعط عبدك قوتك وخلص ابن امتك‎"));
arasuperobject.biblemap.put("b19_86_17", new arasuperobject(19,86,17,"‎اصنع معي آية للخير فيرى ذلك مبغضيّ فيخزوا لانك انت يا رب اعنتني وعزيتني"));
arasuperobject.biblemap.put("b19_87_1", new arasuperobject(19,87,1,"لبني قورح. مزمور تسبيحة‎. ‎اساسه في الجبال المقدسة‎"));
arasuperobject.biblemap.put("b19_87_2", new arasuperobject(19,87,2,"‎الرب احب ابواب صهيون اكثر من جميع مساكن يعقوب‎"));
arasuperobject.biblemap.put("b19_87_3", new arasuperobject(19,87,3,"‎قد قيل بك امجاد يا مدينة الله. سلاه"));
arasuperobject.biblemap.put("b19_87_4", new arasuperobject(19,87,4,"اذكر رهب وبابل عارفتيّ. هوذا فلسطين وصور مع كوش. هذا ولد هناك‎"));
arasuperobject.biblemap.put("b19_87_5", new arasuperobject(19,87,5,"‎ولصهيون يقال هذا الانسان وهذا الانسان ولد فيها وهي العلي يثبتها‎"));
arasuperobject.biblemap.put("b19_87_6", new arasuperobject(19,87,6,"‎الرب يعد في كتابة الشعوب ان هذا ولد هناك. سلاه‎"));
arasuperobject.biblemap.put("b19_87_7", new arasuperobject(19,87,7,"‎ومغنون كعازفين كل السكان فيك"));
arasuperobject.biblemap.put("b19_88_1", new arasuperobject(19,88,1,"تسبيحة مزمور لبني قورح. لامام المغنين على العود للغناء‎. ‎قصيدة لهيمان الازراحي‎. ‎يا رب اله خلاصي بالنهار والليل صرخت امامك‎"));
arasuperobject.biblemap.put("b19_88_2", new arasuperobject(19,88,2,"‎فلتأت قدامك صلاتي. امل اذنك الى صراخي‎"));
arasuperobject.biblemap.put("b19_88_3", new arasuperobject(19,88,3,"‎لانه قد شبعت من المصائب نفسي وحياتي الى الهاوية دنت‎"));
arasuperobject.biblemap.put("b19_88_4", new arasuperobject(19,88,4,"‎حسبت مثل المنحدرين الى الجب. صرت كرجل لا قوة له‎"));
arasuperobject.biblemap.put("b19_88_5", new arasuperobject(19,88,5,"‎بين الاموات فراشي مثل القتلى المضطجعين في القبر الذين لا تذكرهم بعد وهم من يدك انقطعوا‎"));
arasuperobject.biblemap.put("b19_88_6", new arasuperobject(19,88,6,"‎وضعتني في الجب الاسفل في ظلمات في اعماق‎"));
arasuperobject.biblemap.put("b19_88_7", new arasuperobject(19,88,7,"‎عليّ استقر غضبك وبكل تياراتك ذللتني. سلاه‎"));
arasuperobject.biblemap.put("b19_88_8", new arasuperobject(19,88,8,"‎ابعدت عني معارفي. جعلتني رجسا لهم. اغلق عليّ فما اخرج‎"));
arasuperobject.biblemap.put("b19_88_9", new arasuperobject(19,88,9,"‎عيني ذابت من الذل. دعوتك يا رب كل يومً. بسطت اليك يدي"));
arasuperobject.biblemap.put("b19_88_10", new arasuperobject(19,88,10,"أفلعلك للاموات تصنع عجائب أم الاخيلة تقوم تمجدك. سلاه‎"));
arasuperobject.biblemap.put("b19_88_11", new arasuperobject(19,88,11,"‎هل يحدث في القبر برحمتك او بحقك في الهلاك‎"));
arasuperobject.biblemap.put("b19_88_12", new arasuperobject(19,88,12,"‎هل تعرف في الظلمة عجائبك وبرك في ارض النسيان"));
arasuperobject.biblemap.put("b19_88_13", new arasuperobject(19,88,13,"اما انا فاليك يا رب صرخت وفي الغداة صلاتي تتقدمك‎"));
arasuperobject.biblemap.put("b19_88_14", new arasuperobject(19,88,14,"‎لماذا يا رب ترفض نفسي. لماذا تحجب وجهك عني‎"));
arasuperobject.biblemap.put("b19_88_15", new arasuperobject(19,88,15,"‎انا مسكين ومسلم الروح منذ صباي. احتملت اهوالك. تحيرت‎"));
arasuperobject.biblemap.put("b19_88_16", new arasuperobject(19,88,16,"‎عليّ عبر سخطك. اهوالك اهلكتني‎"));
arasuperobject.biblemap.put("b19_88_17", new arasuperobject(19,88,17,"‎احاطت بي كالمياه اليوم كله. اكتنفتني معا‎"));
arasuperobject.biblemap.put("b19_88_18", new arasuperobject(19,88,18,"‎ابعدت عني محبا وصاحبا. معارفي في الظلمة"));
arasuperobject.biblemap.put("b19_89_1", new arasuperobject(19,89,1,"قصيدة لايثان الازراحي‎. ‎بمراحم الرب اغني الى الدهر. لدور فدور اخبر عن حقك بفمي‎"));
arasuperobject.biblemap.put("b19_89_2", new arasuperobject(19,89,2,"‎لاني قلت ان الرحمة الى الدهر تبنى. السموات تثبت فيها حقك‎"));
arasuperobject.biblemap.put("b19_89_3", new arasuperobject(19,89,3,"‎قطعت عهدا مع مختاري. حلفت لداود عبدي"));
arasuperobject.biblemap.put("b19_89_4", new arasuperobject(19,89,4,"الى الدهر اثبت نسلك وابني الى دور فدور كرسيك. سلاه‎"));
arasuperobject.biblemap.put("b19_89_5", new arasuperobject(19,89,5,"‎والسموات تحمد عجائبك يا رب وحقك ايضا في جماعة القديسين‎"));
arasuperobject.biblemap.put("b19_89_6", new arasuperobject(19,89,6,"‎لانه من في السماء يعادل الرب. من يشبه الرب بين ابناء الله‎"));
arasuperobject.biblemap.put("b19_89_7", new arasuperobject(19,89,7,"‎اله مهوب جدا في مؤامرة القديسين ومخوف عند جميع الذين حوله"));
arasuperobject.biblemap.put("b19_89_8", new arasuperobject(19,89,8,"يا رب اله الجنود من مثلك قوي رب وحقك من حولك‎"));
arasuperobject.biblemap.put("b19_89_9", new arasuperobject(19,89,9,"‎انت متسلط على كبرياء البحر. عند ارتفاع لججه انت تسكنها‎"));
arasuperobject.biblemap.put("b19_89_10", new arasuperobject(19,89,10,"‎انت سحقت رهب مثل القتيل. بذراع قوتك بددت اعداءك‎"));
arasuperobject.biblemap.put("b19_89_11", new arasuperobject(19,89,11,"‎لك السموات. لك ايضا الارض . المسكونة وملؤها انت اسّستهما‏‎"));
arasuperobject.biblemap.put("b19_89_12", new arasuperobject(19,89,12,"‎الشمال والجنوب انت خلقتهما. تابور وحرمون باسمك يهتفان‎"));
arasuperobject.biblemap.put("b19_89_13", new arasuperobject(19,89,13,"‎لك ذراع القدرة. قوية يدك. مرتفعة يمينك‎"));
arasuperobject.biblemap.put("b19_89_14", new arasuperobject(19,89,14,"‎العدل والحق قاعدة كرسيك. الرحمة والامانة تتقدمان امام وجهك"));
arasuperobject.biblemap.put("b19_89_15", new arasuperobject(19,89,15,"طوبى للشعب العارفين الهتاف. يا رب بنور وجهك يسلكون‎"));
arasuperobject.biblemap.put("b19_89_16", new arasuperobject(19,89,16,"‎باسمك يبتهجون اليوم كله وبعدلك يرتفعون‎"));
arasuperobject.biblemap.put("b19_89_17", new arasuperobject(19,89,17,"‎لانك انت فخر قوتهم وبرضاك ينتصب قرننا‎"));
arasuperobject.biblemap.put("b19_89_18", new arasuperobject(19,89,18,"‎لان الرب مجننا وقدوس اسرائيل ملكنا"));
arasuperobject.biblemap.put("b19_89_19", new arasuperobject(19,89,19,"حينئذ كلمت برؤيا تقيك وقلت جعلت عونا على قوي. رفعت مختارا من بين الشعب‎"));
arasuperobject.biblemap.put("b19_89_20", new arasuperobject(19,89,20,"‎وجدت داود عبدي. بدهن قدسي مسحته‎"));
arasuperobject.biblemap.put("b19_89_21", new arasuperobject(19,89,21,"‎الذي تثبت يدي معه. ايضا ذراعي تشدده‎"));
arasuperobject.biblemap.put("b19_89_22", new arasuperobject(19,89,22,"‎لا يرغمه عدو وابن الاثم لا يذلله‎"));
arasuperobject.biblemap.put("b19_89_23", new arasuperobject(19,89,23,"‎واسحق اعداءه امام وجهه واضرب مبغضيه‎"));
arasuperobject.biblemap.put("b19_89_24", new arasuperobject(19,89,24,"‎اما امانتي ورحمتي فمعه وباسمي ينتصب قرنه‎"));
arasuperobject.biblemap.put("b19_89_25", new arasuperobject(19,89,25,"‎واجعل على البحر يده وعلى الانهار يمينه‎"));
arasuperobject.biblemap.put("b19_89_26", new arasuperobject(19,89,26,"‎هو يدعوني ابي انت. الهي وصخرة خلاصي‎"));
arasuperobject.biblemap.put("b19_89_27", new arasuperobject(19,89,27,"‎انا ايضا اجعله بكرا اعلى من ملوك الارض‎"));
arasuperobject.biblemap.put("b19_89_28", new arasuperobject(19,89,28,"‎الى الدهر احفظ له رحمتي. وعهدي يثبت له‎"));
arasuperobject.biblemap.put("b19_89_29", new arasuperobject(19,89,29,"‎واجعل الى الابد نسله وكرسيه مثل ايام السموات‎"));
arasuperobject.biblemap.put("b19_89_30", new arasuperobject(19,89,30,"‎ان ترك بنوه شريعتي ولم يسلكوا باحكامي"));
arasuperobject.biblemap.put("b19_89_31", new arasuperobject(19,89,31,"ان نقضوا فرائضي ولم يحفظوا وصاياي"));
arasuperobject.biblemap.put("b19_89_32", new arasuperobject(19,89,32,"افتقد بعصا معصيتهم وبضربات اثمهم‎"));
arasuperobject.biblemap.put("b19_89_33", new arasuperobject(19,89,33,"‎اما رحمتي فلا انزعها عنه ولا اكذب من جهة امانتي‎"));
arasuperobject.biblemap.put("b19_89_34", new arasuperobject(19,89,34,"‎لا انقض عهدي ولا اغيّر ما خرج من شفتيّ‎"));
arasuperobject.biblemap.put("b19_89_35", new arasuperobject(19,89,35,"‎مرة حلفت بقدسي اني لا اكذب لداود‎"));
arasuperobject.biblemap.put("b19_89_36", new arasuperobject(19,89,36,"‎نسله الى الدهر يكون وكرسيه كالشمس امامي‎"));
arasuperobject.biblemap.put("b19_89_37", new arasuperobject(19,89,37,"‎مثل القمر يثبت الى الدهر. والشاهد في السماء امين. سلاه"));
arasuperobject.biblemap.put("b19_89_38", new arasuperobject(19,89,38,"لكنك رفضت ورذلت. غضبت على مسيحك‎"));
arasuperobject.biblemap.put("b19_89_39", new arasuperobject(19,89,39,"‎نقضت عهد عبدك. نجست تاجه في التراب‎"));
arasuperobject.biblemap.put("b19_89_40", new arasuperobject(19,89,40,"‎هدمت كل جدرانه. جعلت حصونه خرابا‎"));
arasuperobject.biblemap.put("b19_89_41", new arasuperobject(19,89,41,"‎افسده كل عابري الطريق. صار عارا عند جيرانه‎"));
arasuperobject.biblemap.put("b19_89_42", new arasuperobject(19,89,42,"‎رفعت يمين مضايقيه. فرحت جميع اعدائه‎"));
arasuperobject.biblemap.put("b19_89_43", new arasuperobject(19,89,43,"‎ايضا رددت حد سيفه ولم تنصره في القتال‎"));
arasuperobject.biblemap.put("b19_89_44", new arasuperobject(19,89,44,"‎ابطلت بهاءه والقيت كرسيه الى الارض‎"));
arasuperobject.biblemap.put("b19_89_45", new arasuperobject(19,89,45,"‎قصرت ايام شبابه غطيته بالخزي. سلاه"));
arasuperobject.biblemap.put("b19_89_46", new arasuperobject(19,89,46,"حتى متى يا رب تختبئ كل الاختباء. حتى متى يتقد كالنار غضبك"));
arasuperobject.biblemap.put("b19_89_47", new arasuperobject(19,89,47,"اذكر كيف انا زائل. الى اي باطل خلقت جميع بني آدم‎"));
arasuperobject.biblemap.put("b19_89_48", new arasuperobject(19,89,48,"‎اي انسان يحيا ولا يرى الموت اي ينجي نفسه من يد الهاوية. سلاه‎"));
arasuperobject.biblemap.put("b19_89_49", new arasuperobject(19,89,49,"‎اين مراحمك الأول يا رب التي حلفت بها لداود بامانتك‎"));
arasuperobject.biblemap.put("b19_89_50", new arasuperobject(19,89,50,"‎اذكر يا رب عار عبيدك. الذي احتمله في حضني من كثرة الامم كلها"));
arasuperobject.biblemap.put("b19_89_51", new arasuperobject(19,89,51,"الذي به عير اعداؤك يا رب الذين عيّروا آثار مسيحك‎"));
arasuperobject.biblemap.put("b19_89_52", new arasuperobject(19,89,52,"‎مبارك الرب الى الدهر. آمين فآمين"));
arasuperobject.biblemap.put("b19_90_1", new arasuperobject(19,90,1,"صلاة لموسى رجل الله‎. ‎يا رب ملجأ كنت لنا في دور فدور‎"));
arasuperobject.biblemap.put("b19_90_2", new arasuperobject(19,90,2,"‎من قبل ان تولد الجبال او أبدأت الارض والمسكونة منذ الازل الى الابد انت الله‎"));
arasuperobject.biblemap.put("b19_90_3", new arasuperobject(19,90,3,"‎ترجع الانسان الى الغبار وتقول ارجعوا يا بني آدم‎"));
arasuperobject.biblemap.put("b19_90_4", new arasuperobject(19,90,4,"‎لان الف سنة في عينيك مثل يوم امس بعدما عبر وكهزيع من الليل‎"));
arasuperobject.biblemap.put("b19_90_5", new arasuperobject(19,90,5,"‎جرفتهم. كسنة يكونون. بالغداة كعشب يزول‎"));
arasuperobject.biblemap.put("b19_90_6", new arasuperobject(19,90,6,"‎بالغداة يزهر فيزول. عند المساء يجزّ فييبس"));
arasuperobject.biblemap.put("b19_90_7", new arasuperobject(19,90,7,"لاننا قد فنينا بسخطك وبغضبك ارتعبنا‎"));
arasuperobject.biblemap.put("b19_90_8", new arasuperobject(19,90,8,"‎قد جعلت آثامنا امامك خفياتنا في ضوء وجهك‏‎"));
arasuperobject.biblemap.put("b19_90_9", new arasuperobject(19,90,9,"‎لان كل ايامنا قد انقضت برجزك. افنينا سنينا كقصة‎"));
arasuperobject.biblemap.put("b19_90_10", new arasuperobject(19,90,10,"‎ايام سنينا هي سبعون سنة. وان كانت مع القوة فثمانون سنة وافخرها تعب وبلية. لانها تقرض سريعا فنطير‎"));
arasuperobject.biblemap.put("b19_90_11", new arasuperobject(19,90,11,"‎من يعرف قوة غضبك. وكخوفك سخطك‎"));
arasuperobject.biblemap.put("b19_90_12", new arasuperobject(19,90,12,"‎احصاء ايامنا هكذا علمنا فنؤتى قلب حكمة"));
arasuperobject.biblemap.put("b19_90_13", new arasuperobject(19,90,13,"ارجع يا رب. حتى متى. وترأف على عبيدك‎"));
arasuperobject.biblemap.put("b19_90_14", new arasuperobject(19,90,14,"‎اشبعنا بالغداة من رحمتك فنبتهج ونفرح كل ايامنا‎"));
arasuperobject.biblemap.put("b19_90_15", new arasuperobject(19,90,15,"‎فرحنا كالايام التي فيها اذللتنا كالسنين التي رأينا فيها شرا"));
arasuperobject.biblemap.put("b19_90_16", new arasuperobject(19,90,16,"ليظهر فعلك لعبيدك وجلالك لبنيهم‎"));
arasuperobject.biblemap.put("b19_90_17", new arasuperobject(19,90,17,"‎ولتكن نعمة الرب الهنا علينا وعمل ايدينا ثبت علينا وعمل ايدينا ثبته"));
arasuperobject.biblemap.put("b19_91_1", new arasuperobject(19,91,1,"الساكن في ستر العلي في ظل القدير يبيت"));
arasuperobject.biblemap.put("b19_91_2", new arasuperobject(19,91,2,"اقول للرب ملجإي وحصني الهي فاتكل عليه‎"));
arasuperobject.biblemap.put("b19_91_3", new arasuperobject(19,91,3,"‎لانه ينجيك من فخ الصياد ومن الوبإ الخطر‎"));
arasuperobject.biblemap.put("b19_91_4", new arasuperobject(19,91,4,"‎بخوافيه يظللك وتحت اجنحته تحتمي. ترس ومجن حقه‎"));
arasuperobject.biblemap.put("b19_91_5", new arasuperobject(19,91,5,"‎لا تخشى من خوف الليل ولا من سهم يطير في النهار‎"));
arasuperobject.biblemap.put("b19_91_6", new arasuperobject(19,91,6,"‎ولا من وبإ يسلك في الدجى ولا من هلاك يفسد في الظهيرة‎"));
arasuperobject.biblemap.put("b19_91_7", new arasuperobject(19,91,7,"‎يسقط عن جانبك الف وربوات عن يمينك. اليك لا يقرب‎"));
arasuperobject.biblemap.put("b19_91_8", new arasuperobject(19,91,8,"‎انما بعينيك تنظر وترى مجازاة الاشرار"));
arasuperobject.biblemap.put("b19_91_9", new arasuperobject(19,91,9,"لانك قلت انت يا رب ملجإي. جعلت العلي مسكنك‎"));
arasuperobject.biblemap.put("b19_91_10", new arasuperobject(19,91,10,"‎لا يلاقيك شر ولا تدنو ضربة من خيمتك‎"));
arasuperobject.biblemap.put("b19_91_11", new arasuperobject(19,91,11,"‎لانه يوصي ملائكته بك لكي يحفظوك في كل طرقك‎"));
arasuperobject.biblemap.put("b19_91_12", new arasuperobject(19,91,12,"‎على الايدي يحملونك لئلا تصدم بحجر رجلك‎"));
arasuperobject.biblemap.put("b19_91_13", new arasuperobject(19,91,13,"‎على الاسد والصل تطأ. الشبل والثعبان تدوس‎"));
arasuperobject.biblemap.put("b19_91_14", new arasuperobject(19,91,14,"‎لانه تعلق بي انجيه. ارفعه لانه عرف اسمي‎"));
arasuperobject.biblemap.put("b19_91_15", new arasuperobject(19,91,15,"‎يدعوني فاستجيب له. معه انا في الضيق. انقذه وامجده‎"));
arasuperobject.biblemap.put("b19_91_16", new arasuperobject(19,91,16,"‎من طول الايام اشبعه واريه خلاصي"));
arasuperobject.biblemap.put("b19_92_1", new arasuperobject(19,92,1,"مزمور تسبيحة. ليوم السبت‎. ‎حسن هو الحمد للرب والترنم لاسمك ايها العلي‎"));
arasuperobject.biblemap.put("b19_92_2", new arasuperobject(19,92,2,"‎ان يخبر برحمتك في الغداة وامانتك كل ليلة"));
arasuperobject.biblemap.put("b19_92_3", new arasuperobject(19,92,3,"على ذات عشرة اوتار وعلى الرباب على عزف العود‎"));
arasuperobject.biblemap.put("b19_92_4", new arasuperobject(19,92,4,"‎لانك فرحتني يا رب بصنائعك. باعمال يديك ابتهج‎"));
arasuperobject.biblemap.put("b19_92_5", new arasuperobject(19,92,5,"‎ما اعظم اعمالك يا رب واعمق جدا افكارك‎"));
arasuperobject.biblemap.put("b19_92_6", new arasuperobject(19,92,6,"‎الرجل البليد لا يعرف والجاهل لا يفهم هذا‎"));
arasuperobject.biblemap.put("b19_92_7", new arasuperobject(19,92,7,"‎اذا زها الاشرار كالعشب وازهر كل فاعلي الاثم فلكي يبادوا الى الدهر‎"));
arasuperobject.biblemap.put("b19_92_8", new arasuperobject(19,92,8,"‎اما انت يا رب فمتعال الى الابد‎"));
arasuperobject.biblemap.put("b19_92_9", new arasuperobject(19,92,9,"‎لانه هوذا اعداؤك يا رب لانه هوذا اعداؤك يبيدون. يتبدد كل فاعلي الاثم‎"));
arasuperobject.biblemap.put("b19_92_10", new arasuperobject(19,92,10,"‎وتنصب مثل البقر الوحشي قرني. تدهنت بزيت طري‎"));
arasuperobject.biblemap.put("b19_92_11", new arasuperobject(19,92,11,"‎وتبصر عيني بمراقبيّ. وبالقائمين عليّ بالشر تسمع اذناي"));
arasuperobject.biblemap.put("b19_92_12", new arasuperobject(19,92,12,"الصدّيق كالنخلة يزهو كالارز في لبنان ينمو‎"));
arasuperobject.biblemap.put("b19_92_13", new arasuperobject(19,92,13,"‎مغروسين في بيت الرب في ديار الهنا يزهرون‎"));
arasuperobject.biblemap.put("b19_92_14", new arasuperobject(19,92,14,"‎ايضا يثمرون في الشيبة. يكونون دساما وخضرا"));
arasuperobject.biblemap.put("b19_92_15", new arasuperobject(19,92,15,"ليخبروا بان الرب مستقيم. صخرتي هو ولا ظلم فيه"));
arasuperobject.biblemap.put("b19_93_1", new arasuperobject(19,93,1,"الرب قد ملك. لبس الجلال. لبس الرب القدرة. ائتزر بها. ايضا تثبتت المسكونة. لا تتزعزع‎"));
arasuperobject.biblemap.put("b19_93_2", new arasuperobject(19,93,2,"‎كرسيك مثبتة منذ القدم. منذ الازل انت‎"));
arasuperobject.biblemap.put("b19_93_3", new arasuperobject(19,93,3,"‎رفعت الانهار يا رب رفعت الانهار صوتها. ترفع الانهار عجيجها‎"));
arasuperobject.biblemap.put("b19_93_4", new arasuperobject(19,93,4,"‎من اصوات مياه كثيرة من غمار امواج البحر الرب في العلى اقدر‎"));
arasuperobject.biblemap.put("b19_93_5", new arasuperobject(19,93,5,"‎شهاداتك ثابتة جدا. ببيتك تليق القداسة يا رب الى طول الايام"));
arasuperobject.biblemap.put("b19_94_1", new arasuperobject(19,94,1,"يا اله النقمات يا رب يا اله النقمات اشرق‎"));
arasuperobject.biblemap.put("b19_94_2", new arasuperobject(19,94,2,"‎ارتفع يا ديان الارض. جاز صنيع المستكبرين‎"));
arasuperobject.biblemap.put("b19_94_3", new arasuperobject(19,94,3,"‎حتى متى الخطاة يا رب حتى متى الخطاة يشمتون‎"));
arasuperobject.biblemap.put("b19_94_4", new arasuperobject(19,94,4,"‎يبقون يتكلمون بوقاحة. كل فاعلي الاثم يفتخرون‎"));
arasuperobject.biblemap.put("b19_94_5", new arasuperobject(19,94,5,"‎يسحقون شعبك يا رب ويذلون ميراثك‎"));
arasuperobject.biblemap.put("b19_94_6", new arasuperobject(19,94,6,"‎يقتلون الارملة والغريب ويميتون اليتيم‎"));
arasuperobject.biblemap.put("b19_94_7", new arasuperobject(19,94,7,"‎ويقولون الرب لا يبصر واله يعقوب لا يلاحظ"));
arasuperobject.biblemap.put("b19_94_8", new arasuperobject(19,94,8,"افهموا ايها البلداء في الشعب ويا جهلاء متى تعقلون‎"));
arasuperobject.biblemap.put("b19_94_9", new arasuperobject(19,94,9,"‎الغارس الاذن ألا يسمع. الصانع العين ألا يبصر‎"));
arasuperobject.biblemap.put("b19_94_10", new arasuperobject(19,94,10,"‎المؤدب الامم ألا يبكت. المعلم الانسان معرفة‎"));
arasuperobject.biblemap.put("b19_94_11", new arasuperobject(19,94,11,"‎الرب يعرف افكار الانسان انها باطلة‎"));
arasuperobject.biblemap.put("b19_94_12", new arasuperobject(19,94,12,"‎طوبى للرجل الذي تؤدبه يا رب وتعلمه من شريعتك"));
arasuperobject.biblemap.put("b19_94_13", new arasuperobject(19,94,13,"لتريحه من ايام الشر حتى تحفر للشرير حفرة‎"));
arasuperobject.biblemap.put("b19_94_14", new arasuperobject(19,94,14,"‎لان الرب لا يرفض شعبه ولا يترك ميراثه‎"));
arasuperobject.biblemap.put("b19_94_15", new arasuperobject(19,94,15,"‎لانه الى العدل يرجع القضاء وعلى اثره كل مستقيمي القلوب"));
arasuperobject.biblemap.put("b19_94_16", new arasuperobject(19,94,16,"من يقوم لي على المسيئين. من يقف لي ضد فعلة الاثم‎"));
arasuperobject.biblemap.put("b19_94_17", new arasuperobject(19,94,17,"‎لولا ان الرب معيني لسكنت نفسي سريعا ارض السكوت‎"));
arasuperobject.biblemap.put("b19_94_18", new arasuperobject(19,94,18,"‎اذ قلت قد زلت قدمي فرحمتك يا رب تعضدني‎"));
arasuperobject.biblemap.put("b19_94_19", new arasuperobject(19,94,19,"‎عند كثرة همومي في داخلي تعزياتك تلذذ نفسي‎"));
arasuperobject.biblemap.put("b19_94_20", new arasuperobject(19,94,20,"‎هل يعاهدك كرسي المفاسد المختلق اثما على فريضة‎"));
arasuperobject.biblemap.put("b19_94_21", new arasuperobject(19,94,21,"‎يزدحمون على نفس الصدّيق ويحكمون على دم زكي‎"));
arasuperobject.biblemap.put("b19_94_22", new arasuperobject(19,94,22,"‎فكان الرب لي صرحا والهي صخرة ملجإي"));
arasuperobject.biblemap.put("b19_94_23", new arasuperobject(19,94,23,"ويرد عليهم اثمهم وبشرهم يفنيهم. يفنيهم الرب الهنا"));
arasuperobject.biblemap.put("b19_95_1", new arasuperobject(19,95,1,"هلم نرنم للرب نهتف لصخرة خلاصنا‎"));
arasuperobject.biblemap.put("b19_95_2", new arasuperobject(19,95,2,"‎نتقدم امامه بحمد وبترنيمات نهتف له‎"));
arasuperobject.biblemap.put("b19_95_3", new arasuperobject(19,95,3,"‎لان الرب اله عظيم ملك كبير على كل الآلهة‎"));
arasuperobject.biblemap.put("b19_95_4", new arasuperobject(19,95,4,"‎الذي بيده مقاصير الارض وخزائن الجبال له‎"));
arasuperobject.biblemap.put("b19_95_5", new arasuperobject(19,95,5,"‎الذي له البحر وهو صنعه ويداه سبكتا اليابسة"));
arasuperobject.biblemap.put("b19_95_6", new arasuperobject(19,95,6,"هلم نسجد ونركع ونجثو امام الرب خالقنا‎"));
arasuperobject.biblemap.put("b19_95_7", new arasuperobject(19,95,7,"‎لانه هو الهنا ونحن شعب مرعاه وغنم يده. اليوم ان سمعتم صوته"));
arasuperobject.biblemap.put("b19_95_8", new arasuperobject(19,95,8,"فلا تقسّوا قلوبكم كما في مريبة مثل يوم مسة في البرية"));
arasuperobject.biblemap.put("b19_95_9", new arasuperobject(19,95,9,"حيث جربني آباؤكم. اختبروني. ابصروا ايضا فعلي"));
arasuperobject.biblemap.put("b19_95_10", new arasuperobject(19,95,10,"اربعين سنة مقت ذلك الجيل وقلت هم شعب ضال قلبهم وهم لم يعرفوا سبلي‎"));
arasuperobject.biblemap.put("b19_95_11", new arasuperobject(19,95,11,"‎فاقسمت في غضبي لا يدخلون راحتي"));
arasuperobject.biblemap.put("b19_96_1", new arasuperobject(19,96,1,"رنموا للرب ترنيمة جديدة رنمي للرب يا كل الارض‎"));
arasuperobject.biblemap.put("b19_96_2", new arasuperobject(19,96,2,"‎رنموا للرب باركوا اسمه بشروا من يوم الى يوم بخلاصه‎"));
arasuperobject.biblemap.put("b19_96_3", new arasuperobject(19,96,3,"‎حدثوا بين الامم بمجده بين جميع الشعوب بعجائبه‎"));
arasuperobject.biblemap.put("b19_96_4", new arasuperobject(19,96,4,"‎لان الرب عظيم وحميد جدا مهوب هو على كل الآلهة‎"));
arasuperobject.biblemap.put("b19_96_5", new arasuperobject(19,96,5,"‎لان كل آلهة الشعوب اصنام اما الرب فقد صنع السموات‎"));
arasuperobject.biblemap.put("b19_96_6", new arasuperobject(19,96,6,"‎مجد وجلال قدامه. العزّ والجمال في مقدسه"));
arasuperobject.biblemap.put("b19_96_7", new arasuperobject(19,96,7,"قدموا للرب يا قبائل الشعوب قدموا للرب مجدا وقوة‎"));
arasuperobject.biblemap.put("b19_96_8", new arasuperobject(19,96,8,"‎قدموا للرب مجد اسمه. هاتوا تقدمة وادخلوا دياره‎"));
arasuperobject.biblemap.put("b19_96_9", new arasuperobject(19,96,9,"‎اسجدوا للرب في زينة مقدسة. ارتعدي قدامه يا كل الارض‎"));
arasuperobject.biblemap.put("b19_96_10", new arasuperobject(19,96,10,"‎قولوا بين الامم الرب قد ملك. ايضا تثبتت المسكونة فلا تتزعزع. يدين الشعوب بالاستقامة‎"));
arasuperobject.biblemap.put("b19_96_11", new arasuperobject(19,96,11,"‎لتفرح السموات ولتبتهج الارض ليعج البحر وملؤه"));
arasuperobject.biblemap.put("b19_96_12", new arasuperobject(19,96,12,"ليجذل الحقل وكل ما فيه لتترنم حينئذ كل اشجار الوعر"));
arasuperobject.biblemap.put("b19_96_13", new arasuperobject(19,96,13,"امام الرب لانه جاء. جاء ليدين الارض. يدين المسكونة بالعدل والشعوب بامانته"));
arasuperobject.biblemap.put("b19_97_1", new arasuperobject(19,97,1,"الرب قد ملك فلتبتهج الارض ولتفرح الجزائر الكثيرة‎"));
arasuperobject.biblemap.put("b19_97_2", new arasuperobject(19,97,2,"‎السحاب والضباب حوله. العدل والحق قاعدة كرسيه‎"));
arasuperobject.biblemap.put("b19_97_3", new arasuperobject(19,97,3,"‎قدامه تذهب نار وتحرق اعداءه حوله‎"));
arasuperobject.biblemap.put("b19_97_4", new arasuperobject(19,97,4,"‎اضاءت بروقه المسكونة. رأت الارض وارتعدت‎"));
arasuperobject.biblemap.put("b19_97_5", new arasuperobject(19,97,5,"‎ذابت الجبال مثل الشمع قدام الرب قدام سيد الارض كلها‎"));
arasuperobject.biblemap.put("b19_97_6", new arasuperobject(19,97,6,"‎اخبرت السموات بعدله ورأى جميع الشعوب مجده"));
arasuperobject.biblemap.put("b19_97_7", new arasuperobject(19,97,7,"يخزى كل عابدي تمثال منحوت المفتخرين بالاصنام. اسجدوا له يا جميع الآلهة‎"));
arasuperobject.biblemap.put("b19_97_8", new arasuperobject(19,97,8,"‎سمعت صهيون ففرحت وابتهجت بنات يهوذا من اجل احكامك يا رب‎"));
arasuperobject.biblemap.put("b19_97_9", new arasuperobject(19,97,9,"‎لانك انت يا رب علي على كل الارض. علوت جدا على كل الآلهة"));
arasuperobject.biblemap.put("b19_97_10", new arasuperobject(19,97,10,"يا محبي الرب ابغضوا الشر. هو حافظ نفوس اتقيائه. من يد الاشرار ينقذهم‎"));
arasuperobject.biblemap.put("b19_97_11", new arasuperobject(19,97,11,"‎نور قد زرع للصديق وفرح للمستقيمي القلب‎"));
arasuperobject.biblemap.put("b19_97_12", new arasuperobject(19,97,12,"‎افرحوا ايها الصديقون بالرب واحمدوا ذكر قدسه"));
arasuperobject.biblemap.put("b19_98_1", new arasuperobject(19,98,1,"مزمور‎. ‎رنموا للرب ترنيمة جديدة لانه صنع عجائب. خلصته يمينه وذراع قدسه‎"));
arasuperobject.biblemap.put("b19_98_2", new arasuperobject(19,98,2,"‎اعلن الرب خلاصه. لعيون الامم كشف بره‎"));
arasuperobject.biblemap.put("b19_98_3", new arasuperobject(19,98,3,"‎ذكر رحمته وامانته لبيت اسرائيل. رأت كل اقاصي الارض خلاص الهنا"));
arasuperobject.biblemap.put("b19_98_4", new arasuperobject(19,98,4,"اهتفي للرب يا كل الارض اهتفوا ورنموا وغنوا‎"));
arasuperobject.biblemap.put("b19_98_5", new arasuperobject(19,98,5,"‎رنموا للرب بعود. بعود وصوت نشيد"));
arasuperobject.biblemap.put("b19_98_6", new arasuperobject(19,98,6,"بالابواق وصوت الصور اهتفوا قدام الملك الرب‎"));
arasuperobject.biblemap.put("b19_98_7", new arasuperobject(19,98,7,"‎ليعج البحر وملؤه المسكونة والساكنون فيها‎"));
arasuperobject.biblemap.put("b19_98_8", new arasuperobject(19,98,8,"‎الانهار لتصفق بالايادي الجبال لترنم معا"));
arasuperobject.biblemap.put("b19_98_9", new arasuperobject(19,98,9,"امام الرب لانه جاء ليدين الارض. يدين المسكونة بالعدل والشعوب بالاستقامة"));
arasuperobject.biblemap.put("b19_99_1", new arasuperobject(19,99,1,"الرب قد ملك. ترتعد الشعوب. هو جالس على الكروبيم. تتزلزل الارض‎"));
arasuperobject.biblemap.put("b19_99_2", new arasuperobject(19,99,2,"‎الرب عظيم في صهيون وعال هو على كل الشعوب‎"));
arasuperobject.biblemap.put("b19_99_3", new arasuperobject(19,99,3,"‎يحمدون اسمك العظيم والمهوب. قدوس هو‎"));
arasuperobject.biblemap.put("b19_99_4", new arasuperobject(19,99,4,"‎وعز الملك ان يحب الحق. انت ثبت الاستقامة انت اجريت حقا وعدلا في يعقوب"));
arasuperobject.biblemap.put("b19_99_5", new arasuperobject(19,99,5,"علّوا الرب الهنا واسجدوا عند موطئ قدميه. قدوس هو‎"));
arasuperobject.biblemap.put("b19_99_6", new arasuperobject(19,99,6,"‎موسى وهرون بين كهنته وصموئيل بين الذين يدعون باسمه. دعوا الرب‏ وهو استجاب لهم‎"));
arasuperobject.biblemap.put("b19_99_7", new arasuperobject(19,99,7,"‎بعمود السحاب كلمهم. حفظوا شهاداته والفريضة التي اعطاهم‎"));
arasuperobject.biblemap.put("b19_99_8", new arasuperobject(19,99,8,"‎ايها الرب الهنا انت استجبت لهم. الها غفورا كنت لهم ومنتقما على افعالهم‎"));
arasuperobject.biblemap.put("b19_99_9", new arasuperobject(19,99,9,"‎علّوا الرب الهنا. واسجدوا في جبل قدسه لان الرب الهنا قدوس"));
arasuperobject.biblemap.put("b19_100_1", new arasuperobject(19,100,1,"مزمور حمد‎. ‎اهتفي للرب يا كل الارض‎"));
arasuperobject.biblemap.put("b19_100_2", new arasuperobject(19,100,2,"‎اعبدوا الرب بفرح. ادخلوا الى حضرته بترنم‎"));
arasuperobject.biblemap.put("b19_100_3", new arasuperobject(19,100,3,"‎اعلموا ان الرب هو الله. هو صنعنا وله نحن شعبه وغنم مرعاه‎"));
arasuperobject.biblemap.put("b19_100_4", new arasuperobject(19,100,4,"‎ادخلوا ابوابه بحمد دياره بالتسبيح احمدوه باركوا اسمه‎"));
arasuperobject.biblemap.put("b19_100_5", new arasuperobject(19,100,5,"‎لان الرب صالح. الى الابد رحمته والى دور فدور امانته"));
arasuperobject.biblemap.put("b19_101_1", new arasuperobject(19,101,1,"لداود. مزمور‎. ‎رحمة وحكما اغني. لك يا رب ارنم‎"));
arasuperobject.biblemap.put("b19_101_2", new arasuperobject(19,101,2,"‎اتعقل في طريق كامل. متى تاتي اليّ. اسلك في كمال قلبي في وسط بيتي‎"));
arasuperobject.biblemap.put("b19_101_3", new arasuperobject(19,101,3,"‎لا اضع قدام عينيّ امرا رديئا عمل الزيغان ابغضت. لا يلصق بي"));
arasuperobject.biblemap.put("b19_101_4", new arasuperobject(19,101,4,"قلب معوج يبعد عني. الشرير لا اعرفه‎"));
arasuperobject.biblemap.put("b19_101_5", new arasuperobject(19,101,5,"‎الذي يغتاب صاحبه سرا هذا اقطعه. مستكبر العين ومنتفخ القلب لا احتمله‎"));
arasuperobject.biblemap.put("b19_101_6", new arasuperobject(19,101,6,"‎عيناي على امناء الارض لكي اجلسهم معي. السالك طريقا كاملا هو يخدمني‎"));
arasuperobject.biblemap.put("b19_101_7", new arasuperobject(19,101,7,"‎لا يسكن وسط بيتي عامل غش. المتكلم بالكذب لا يثبت امام عينيّ"));
arasuperobject.biblemap.put("b19_101_8", new arasuperobject(19,101,8,"باكرا ابيد جميع اشرار الارض لاقطع من مدينة الرب كل فاعلي الاثم"));
arasuperobject.biblemap.put("b19_102_1", new arasuperobject(19,102,1,"صلاة لمسكين اذا اعيا وسكب شكواه قدام الله‎. ‎يا رب استمع صلاتي وليدخل اليك صراخي‎"));
arasuperobject.biblemap.put("b19_102_2", new arasuperobject(19,102,2,"‎لا تحجب وجهك عني في يوم ضيقي. امل اليّ اذنك في يوم ادعوك‎. ‎استجب لي سريعا‎"));
arasuperobject.biblemap.put("b19_102_3", new arasuperobject(19,102,3,"‎لان ايامي قد فنيت في دخان وعظامي مثل وقيد قد يبست‎"));
arasuperobject.biblemap.put("b19_102_4", new arasuperobject(19,102,4,"‎ملفوح كالعشب ويابس قلبي حتى سهوت عن اكل خبزي‎"));
arasuperobject.biblemap.put("b19_102_5", new arasuperobject(19,102,5,"‎من صوت تنهدي لصق عظمي بلحمي‎"));
arasuperobject.biblemap.put("b19_102_6", new arasuperobject(19,102,6,"‎اشبهت قوق البرية. صرت مثل بومة الخرب‎"));
arasuperobject.biblemap.put("b19_102_7", new arasuperobject(19,102,7,"‎سهدت وصرت كعصفور منفرد على السطح‎"));
arasuperobject.biblemap.put("b19_102_8", new arasuperobject(19,102,8,"‎اليوم كله عيّرني اعدائي. الحنقون عليّ حلفوا عليّ‎"));
arasuperobject.biblemap.put("b19_102_9", new arasuperobject(19,102,9,"‎اني قد اكلت الرماد مثل الخبز ومزجت شرابي بدموع"));
arasuperobject.biblemap.put("b19_102_10", new arasuperobject(19,102,10,"بسبب غضبك وسخطك لانك حملتني وطرحتني‎"));
arasuperobject.biblemap.put("b19_102_11", new arasuperobject(19,102,11,"‎ايامي كظل مائل وانا مثل العشب يبست"));
arasuperobject.biblemap.put("b19_102_12", new arasuperobject(19,102,12,"اما انت يا رب فالى الدهر جالس وذكرك الى دور فدور‎"));
arasuperobject.biblemap.put("b19_102_13", new arasuperobject(19,102,13,"‎انت تقوم وترحم صهيون لانه وقت الرأفة لانه جاء الميعاد‎"));
arasuperobject.biblemap.put("b19_102_14", new arasuperobject(19,102,14,"‎لان عبيدك قد سرّوا بحجارتها وحنّوا الى ترابها‎"));
arasuperobject.biblemap.put("b19_102_15", new arasuperobject(19,102,15,"‎فتخشى الامم اسم الرب وكل ملوك الارض مجدك‎"));
arasuperobject.biblemap.put("b19_102_16", new arasuperobject(19,102,16,"‎اذا بنى الرب صهيون يرى بمجده‎"));
arasuperobject.biblemap.put("b19_102_17", new arasuperobject(19,102,17,"‎التفت الى صلاة المضطر ولم يرذل دعاءهم‎"));
arasuperobject.biblemap.put("b19_102_18", new arasuperobject(19,102,18,"‎يكتب هذا للدور الآخر وشعب سوف يخلق يسبح الرب‎"));
arasuperobject.biblemap.put("b19_102_19", new arasuperobject(19,102,19,"‎لانه اشرف من علو قدسه الرب من السماء الى الارض نظر"));
arasuperobject.biblemap.put("b19_102_20", new arasuperobject(19,102,20,"ليسمع انين الاسير ليطلق بني الموت"));
arasuperobject.biblemap.put("b19_102_21", new arasuperobject(19,102,21,"لكي يحدث في صهيون باسم الرب وبتسبيحه في اورشليم"));
arasuperobject.biblemap.put("b19_102_22", new arasuperobject(19,102,22,"عند اجتماع الشعوب معا والممالك لعبادة الرب"));
arasuperobject.biblemap.put("b19_102_23", new arasuperobject(19,102,23,"ضعّف في الطريق قوتي قصر ايامي‎"));
arasuperobject.biblemap.put("b19_102_24", new arasuperobject(19,102,24,"‎اقول يا الهي لا تقبضني في نصف ايامي. الى دهر الدهور سنوك‎"));
arasuperobject.biblemap.put("b19_102_25", new arasuperobject(19,102,25,"‎من قدم اسست الارض والسموات هي عمل يديك‎"));
arasuperobject.biblemap.put("b19_102_26", new arasuperobject(19,102,26,"‎هي تبيد وانت تبقى وكلها كثوب تبلى كرداء تغيّرهنّ فتتغيّر‎"));
arasuperobject.biblemap.put("b19_102_27", new arasuperobject(19,102,27,"‎وانت هو وسنوك لن تنتهي‎"));
arasuperobject.biblemap.put("b19_102_28", new arasuperobject(19,102,28,"‎ابناء عبيدك يسكنون وذريتهم تثبت امامك"));
arasuperobject.biblemap.put("b19_103_1", new arasuperobject(19,103,1,"لداود‎. ‎باركي يا نفسي الرب وكل ما في باطني ليبارك اسمه القدوس‎"));
arasuperobject.biblemap.put("b19_103_2", new arasuperobject(19,103,2,"‎باركي يا نفسي الرب ولا تنسي كل حسناته‎"));
arasuperobject.biblemap.put("b19_103_3", new arasuperobject(19,103,3,"‎الذي يغفر جميع ذنوبك الذي يشفي كل امراضك"));
arasuperobject.biblemap.put("b19_103_4", new arasuperobject(19,103,4,"الذي يفدي من الحفرة حياتك الذي يكللك بالرحمة والرأفة"));
arasuperobject.biblemap.put("b19_103_5", new arasuperobject(19,103,5,"الذي يشبع بالخير عمرك فيتجدد مثل النسر شبابك"));
arasuperobject.biblemap.put("b19_103_6", new arasuperobject(19,103,6,"الرب مجري العدل والقضاء لجميع المظلومين‎"));
arasuperobject.biblemap.put("b19_103_7", new arasuperobject(19,103,7,"‎عرف موسى طرقه وبني اسرائيل افعاله‎"));
arasuperobject.biblemap.put("b19_103_8", new arasuperobject(19,103,8,"‎الرب رحيم ورؤوف طويل الروح وكثير الرحمة‎"));
arasuperobject.biblemap.put("b19_103_9", new arasuperobject(19,103,9,"‎لا يحاكم الى الابد ولا يحقد الى الدهر‏‎"));
arasuperobject.biblemap.put("b19_103_10", new arasuperobject(19,103,10,"‎لم يصنع معنا حسب خطايانا ولم يجازنا حسب آثامنا‎"));
arasuperobject.biblemap.put("b19_103_11", new arasuperobject(19,103,11,"‎لانه مثل ارتفاع السموات فوق الارض قويت رحمته على خائفيه‎"));
arasuperobject.biblemap.put("b19_103_12", new arasuperobject(19,103,12,"‎كبعد المشرق من المغرب ابعد عنا معاصينا"));
arasuperobject.biblemap.put("b19_103_13", new arasuperobject(19,103,13,"كما يترأف الاب على البنين يترأف الرب على خائفيه‎"));
arasuperobject.biblemap.put("b19_103_14", new arasuperobject(19,103,14,"‎لانه يعرف جبلتنا. يذكر اننا تراب نحن‎"));
arasuperobject.biblemap.put("b19_103_15", new arasuperobject(19,103,15,"‎الانسان مثل العشب ايامه. كزهر الحقل كذلك يزهر‎"));
arasuperobject.biblemap.put("b19_103_16", new arasuperobject(19,103,16,"‎لان ريحا تعبر عليه فلا يكون ولا يعرفه موضعه بعد‎"));
arasuperobject.biblemap.put("b19_103_17", new arasuperobject(19,103,17,"‎اما رحمة الرب فالى الدهر والابد على خائفيه وعدله على بني البنين"));
arasuperobject.biblemap.put("b19_103_18", new arasuperobject(19,103,18,"لحافظي عهده وذاكري وصاياه ليعملوها"));
arasuperobject.biblemap.put("b19_103_19", new arasuperobject(19,103,19,"الرب في السموات ثبت كرسيه ومملكته على الكل تسود‎"));
arasuperobject.biblemap.put("b19_103_20", new arasuperobject(19,103,20,"‎باركوا الرب يا ملائكته المقتدرين قوة الفاعلين امره عند سماع صوت كلامه‎"));
arasuperobject.biblemap.put("b19_103_21", new arasuperobject(19,103,21,"‎باركوا الرب يا جميع جنوده خدامه العاملين مرضاته‎"));
arasuperobject.biblemap.put("b19_103_22", new arasuperobject(19,103,22,"‎باركوا الرب يا جميع اعماله في كل مواضع سلطانه باركي يا نفسي الرب"));
arasuperobject.biblemap.put("b19_104_1", new arasuperobject(19,104,1,"باركي يا نفسي الرب. يا رب الهي قد عظمت جدا مجدا وجلالا لبست"));
arasuperobject.biblemap.put("b19_104_2", new arasuperobject(19,104,2,"اللابس النور كثوب الباسط السموات كشقّة‎"));
arasuperobject.biblemap.put("b19_104_3", new arasuperobject(19,104,3,"‎المسقف علاليه بالمياه الجاعل السحاب مركبته الماشي على اجنحة الريح"));
arasuperobject.biblemap.put("b19_104_4", new arasuperobject(19,104,4,"الصانع ملائكته رياحا وخدامه نارا ملتهبة"));
arasuperobject.biblemap.put("b19_104_5", new arasuperobject(19,104,5,"المؤسس الارض على قواعدها فلا تتزعزع الى الدهر والابد‎"));
arasuperobject.biblemap.put("b19_104_6", new arasuperobject(19,104,6,"‎كسوتها الغمر كثوب. فوق الجبال تقف المياه‎"));
arasuperobject.biblemap.put("b19_104_7", new arasuperobject(19,104,7,"‎من انتهارك تهرب من صوت رعدك تفر‎"));
arasuperobject.biblemap.put("b19_104_8", new arasuperobject(19,104,8,"‎تصعد الى الجبال. تنزل الى البقاع الى الموضع الذي اسسته لها"));
arasuperobject.biblemap.put("b19_104_9", new arasuperobject(19,104,9,"وضعت لها تخما لا تتعداه. لا ترجع لتغطي الارض"));
arasuperobject.biblemap.put("b19_104_10", new arasuperobject(19,104,10,"المفجر عيونا في الاودية. بين الجبال تجري‎"));
arasuperobject.biblemap.put("b19_104_11", new arasuperobject(19,104,11,"‎تسقي كل حيوان البر. تكسر الفراء ظمأها‎"));
arasuperobject.biblemap.put("b19_104_12", new arasuperobject(19,104,12,"‎فوقها طيور السماء تسكن. من بين الاغصان تسمع صوتا‎"));
arasuperobject.biblemap.put("b19_104_13", new arasuperobject(19,104,13,"‎الساقي الجبال من علاليه. من ثمر اعمالك تشبع الارض‎"));
arasuperobject.biblemap.put("b19_104_14", new arasuperobject(19,104,14,"‎المنبت عشبا للبهائم وخضرة لخدمة الانسان لاخراج خبز من الارض"));
arasuperobject.biblemap.put("b19_104_15", new arasuperobject(19,104,15,"وخمر تفرح قلب الانسان لإلماع وجهه اكثر من الزيت وخبز يسند قلب الانسان‎"));
arasuperobject.biblemap.put("b19_104_16", new arasuperobject(19,104,16,"‎تشبع اشجار الرب ارز لبنان الذي نصبه‎"));
arasuperobject.biblemap.put("b19_104_17", new arasuperobject(19,104,17,"‎حيث تعشش هناك العصافير اما اللقلق فالسرو بيته‎"));
arasuperobject.biblemap.put("b19_104_18", new arasuperobject(19,104,18,"‎الجبال العالية للوعول الصخور ملجأ للوبار"));
arasuperobject.biblemap.put("b19_104_19", new arasuperobject(19,104,19,"صنع القمر للمواقيت الشمس تعرف مغربها‎"));
arasuperobject.biblemap.put("b19_104_20", new arasuperobject(19,104,20,"‎تجعل ظلمة فيصير ليل. فيه يدبّ كل حيوان الوعر‎"));
arasuperobject.biblemap.put("b19_104_21", new arasuperobject(19,104,21,"‎الاشبال تزمجر لتخطف ولتلتمس من الله طعامها‎"));
arasuperobject.biblemap.put("b19_104_22", new arasuperobject(19,104,22,"‎تشرق الشمس فتجتمع وفي مآويها تربض‎"));
arasuperobject.biblemap.put("b19_104_23", new arasuperobject(19,104,23,"‎الانسان يخرج الى عمله والى شغله الى المساء‏"));
arasuperobject.biblemap.put("b19_104_24", new arasuperobject(19,104,24,"ما اعظم اعمالك يا رب. كلها بحكمة صنعت. ملآنة الارض من غناك"));
arasuperobject.biblemap.put("b19_104_25", new arasuperobject(19,104,25,"هذا البحر الكبير الواسع الاطراف. هناك دبابات بلا عدد. صغار حيوان مع كبار‎"));
arasuperobject.biblemap.put("b19_104_26", new arasuperobject(19,104,26,"‎هناك تجري السفن. لوياثان هذا خلقته ليلعب فيه‎"));
arasuperobject.biblemap.put("b19_104_27", new arasuperobject(19,104,27,"‎كلها اياك تترجى لترزقها قوتها في حينه‎"));
arasuperobject.biblemap.put("b19_104_28", new arasuperobject(19,104,28,"‎تعطيها فتلتقط. تفتح يدك فتشبع خيرا‎"));
arasuperobject.biblemap.put("b19_104_29", new arasuperobject(19,104,29,"‎تحجب وجهك فترتاع. تنزع ارواحها فتموت والى ترابها تعود‎"));
arasuperobject.biblemap.put("b19_104_30", new arasuperobject(19,104,30,"‎ترسل روحك فتخلق. وتجدد وجه الارض"));
arasuperobject.biblemap.put("b19_104_31", new arasuperobject(19,104,31,"يكون مجد الرب الى الدهر. يفرح الرب باعماله‎"));
arasuperobject.biblemap.put("b19_104_32", new arasuperobject(19,104,32,"‎الناظر الى الارض فترتعد. يمسّ الجبال فتدخن‎"));
arasuperobject.biblemap.put("b19_104_33", new arasuperobject(19,104,33,"‎اغني للرب في حياتي. ارنم لالهي ما دمت موجودا‎"));
arasuperobject.biblemap.put("b19_104_34", new arasuperobject(19,104,34,"‎فيلذ له نشيدي وانا افرح بالرب‎"));
arasuperobject.biblemap.put("b19_104_35", new arasuperobject(19,104,35,"‎لتبد الخطاة من الارض والاشرار لا يكونوا بعد. باركي يا نفسي الرب. هللويا"));
arasuperobject.biblemap.put("b19_105_1", new arasuperobject(19,105,1,"احمدوا الرب ادعوا باسمه. عرفوا بين الامم باعماله‎"));
arasuperobject.biblemap.put("b19_105_2", new arasuperobject(19,105,2,"‎غنوا له رنموا له. انشدوا بكل عجائبه‎"));
arasuperobject.biblemap.put("b19_105_3", new arasuperobject(19,105,3,"‎افتخروا باسمه القدوس. لتفرح قلوب الذين يلتمسون الرب"));
arasuperobject.biblemap.put("b19_105_4", new arasuperobject(19,105,4,"اطلبوا الرب وقدرته. التمسوا وجهه دائما‎"));
arasuperobject.biblemap.put("b19_105_5", new arasuperobject(19,105,5,"‎اذكروا عجائبه التي صنع. آياته واحكام فيه"));
arasuperobject.biblemap.put("b19_105_6", new arasuperobject(19,105,6,"يا ذرية ابراهيم عبده يا بني يعقوب مختاريه‎"));
arasuperobject.biblemap.put("b19_105_7", new arasuperobject(19,105,7,"‎هو الرب الهنا في كل الارض احكامه‎"));
arasuperobject.biblemap.put("b19_105_8", new arasuperobject(19,105,8,"‎ذكر الى الدهر عهده كلاما اوصى به الى الف دور"));
arasuperobject.biblemap.put("b19_105_9", new arasuperobject(19,105,9,"الذي عاهد به ابراهيم وقسمه لاسحق"));
arasuperobject.biblemap.put("b19_105_10", new arasuperobject(19,105,10,"فثبته ليعقوب فريضة ولاسرائيل عهدا ابديا"));
arasuperobject.biblemap.put("b19_105_11", new arasuperobject(19,105,11,"قائلا لك اعطي ارض كنعان حبل ميراثكم‎"));
arasuperobject.biblemap.put("b19_105_12", new arasuperobject(19,105,12,"‎اذ كانوا عددا يحصى قليلين وغرباء فيها‎"));
arasuperobject.biblemap.put("b19_105_13", new arasuperobject(19,105,13,"‎ذهبوا من امة الى امة من مملكة الى شعب آخر‎"));
arasuperobject.biblemap.put("b19_105_14", new arasuperobject(19,105,14,"‎فلم يدع انسانا يظلمهم. بل وبخ ملوكا من اجلهم‎"));
arasuperobject.biblemap.put("b19_105_15", new arasuperobject(19,105,15,"‎قائلا لا تمسوا مسحائي ولا تسيئوا الى انبيائي‎"));
arasuperobject.biblemap.put("b19_105_16", new arasuperobject(19,105,16,"‎دعا بالجوع على الارض كسر قوام الخبز كله‎"));
arasuperobject.biblemap.put("b19_105_17", new arasuperobject(19,105,17,"‎ارسل امامهم رجلا. بيع يوسف عبدا‎"));
arasuperobject.biblemap.put("b19_105_18", new arasuperobject(19,105,18,"‎آذوا بالقيد رجليه. في الحديد دخلت نفسه"));
arasuperobject.biblemap.put("b19_105_19", new arasuperobject(19,105,19,"الى وقت مجيء كلمته. قول الرب امتحنه‎"));
arasuperobject.biblemap.put("b19_105_20", new arasuperobject(19,105,20,"‎ارسل الملك فحله. ارسل سلطان الشعب فاطلقه‎"));
arasuperobject.biblemap.put("b19_105_21", new arasuperobject(19,105,21,"‎اقامه سيدا على بيته ومسلطا على كل ملكه"));
arasuperobject.biblemap.put("b19_105_22", new arasuperobject(19,105,22,"ليأسر رؤساءه حسب ارادته ويعلم مشايخه حكمة‎"));
arasuperobject.biblemap.put("b19_105_23", new arasuperobject(19,105,23,"‎فجاء اسرائيل الى مصر ويعقوب تغرب في ارض حام"));
arasuperobject.biblemap.put("b19_105_24", new arasuperobject(19,105,24,"جعل شعبه مثمرا جدا واعزه على اعدائه"));
arasuperobject.biblemap.put("b19_105_25", new arasuperobject(19,105,25,"حول قلوبهم ليبغضوا شعبه ليحتالوا على عبيده‎"));
arasuperobject.biblemap.put("b19_105_26", new arasuperobject(19,105,26,"‎ارسل موسى عبده وهرون الذي اختاره‎"));
arasuperobject.biblemap.put("b19_105_27", new arasuperobject(19,105,27,"‎اقاما بينهم كلام آياته وعجائب في ارض حام‎"));
arasuperobject.biblemap.put("b19_105_28", new arasuperobject(19,105,28,"‎ارسل ظلمة فاظلمت ولم يعصوا كلامه‎"));
arasuperobject.biblemap.put("b19_105_29", new arasuperobject(19,105,29,"‎حول مياههم الى دم وقتل اسماكهم‎"));
arasuperobject.biblemap.put("b19_105_30", new arasuperobject(19,105,30,"‎افاضت ارضهم ضفادع. حتى في مخادع ملوكهم‎"));
arasuperobject.biblemap.put("b19_105_31", new arasuperobject(19,105,31,"‎أمر فجاء الذبان والبعوض في كل تخومهم‎"));
arasuperobject.biblemap.put("b19_105_32", new arasuperobject(19,105,32,"‎جعل امطارهم بردا ونارا ملتهبة في ارضهم‎"));
arasuperobject.biblemap.put("b19_105_33", new arasuperobject(19,105,33,"‎ضرب كرومهم وتينهم وكسر كل اشجار تخومهم‎"));
arasuperobject.biblemap.put("b19_105_34", new arasuperobject(19,105,34,"‎امر فجاء الجراد وغوغاء بلا عدد"));
arasuperobject.biblemap.put("b19_105_35", new arasuperobject(19,105,35,"فأكل كل عشب في بلادهم. وأكل اثمار ارضهم‎"));
arasuperobject.biblemap.put("b19_105_36", new arasuperobject(19,105,36,"‎قتل كل بكر في ارضهم. اوائل كل قوتهم‎"));
arasuperobject.biblemap.put("b19_105_37", new arasuperobject(19,105,37,"‎فاخرجهم بفضة وذهب ولم يكن في اسباطهم عاثر‎"));
arasuperobject.biblemap.put("b19_105_38", new arasuperobject(19,105,38,"‎فرحت مصر بخروجهم لان رعبهم سقط عليهم"));
arasuperobject.biblemap.put("b19_105_39", new arasuperobject(19,105,39,"بسط سحابا سجفا ونارا لتضيء الليل‎"));
arasuperobject.biblemap.put("b19_105_40", new arasuperobject(19,105,40,"‎سألوا فاتاهم بالسلوى وخبز السماء اشبعهم‎"));
arasuperobject.biblemap.put("b19_105_41", new arasuperobject(19,105,41,"‎شق الصخرة فانفجرت المياه. جرت في اليابسة نهرا‎"));
arasuperobject.biblemap.put("b19_105_42", new arasuperobject(19,105,42,"‎لانه ذكر كلمة قدسه مع ابراهيم عبده"));
arasuperobject.biblemap.put("b19_105_43", new arasuperobject(19,105,43,"فاخرج شعبه بابتهاج ومختاريه بترنم‎"));
arasuperobject.biblemap.put("b19_105_44", new arasuperobject(19,105,44,"‎واعطاهم اراضي الامم. وتعب الشعوب ورثوه‎"));
arasuperobject.biblemap.put("b19_105_45", new arasuperobject(19,105,45,"‎لكي يحفظوا فرائضه ويطيعوا شرائعه. هللويا"));
arasuperobject.biblemap.put("b19_106_1", new arasuperobject(19,106,1,"هللويا. احمدوا الرب لانه صالح لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_106_2", new arasuperobject(19,106,2,"‎من يتكلم بجبروت الرب من يخبر بكل تسابيحه‎"));
arasuperobject.biblemap.put("b19_106_3", new arasuperobject(19,106,3,"‎طوبى للحافظين الحق وللصانع البر في كل حين‎"));
arasuperobject.biblemap.put("b19_106_4", new arasuperobject(19,106,4,"‎اذكرني يا رب برضا شعبك. تعهدني بخلاصك‎"));
arasuperobject.biblemap.put("b19_106_5", new arasuperobject(19,106,5,"‎لأرى خير مختاريك. لأفرح بفرح أمتك. لأفتخر مع ميراثك"));
arasuperobject.biblemap.put("b19_106_6", new arasuperobject(19,106,6,"اخطأنا مع آبائنا اسأنا واذنبنا‎"));
arasuperobject.biblemap.put("b19_106_7", new arasuperobject(19,106,7,"‎آباؤنا في مصر لم يفهموا عجائبك لم يذكروا كثرة مراحمك فتمردوا عند البحر عند بحر سوف‎"));
arasuperobject.biblemap.put("b19_106_8", new arasuperobject(19,106,8,"‎فخلصهم من اجل اسمه ليعرف بجبروته"));
arasuperobject.biblemap.put("b19_106_9", new arasuperobject(19,106,9,"وانتهر بحر سوف فيبس وسيرهم في اللجج كالبرية‎"));
arasuperobject.biblemap.put("b19_106_10", new arasuperobject(19,106,10,"‎وخلّصهم من يد المبغض وفداهم من يد العدو‎"));
arasuperobject.biblemap.put("b19_106_11", new arasuperobject(19,106,11,"‎وغطت المياه مضايقيهم واحد منهم لم يبق"));
arasuperobject.biblemap.put("b19_106_12", new arasuperobject(19,106,12,"فآمنوا بكلامه. غنوا بتسبيحه‎"));
arasuperobject.biblemap.put("b19_106_13", new arasuperobject(19,106,13,"‎اسرعوا فنسوا اعماله. لم ينتظروا مشورته‎"));
arasuperobject.biblemap.put("b19_106_14", new arasuperobject(19,106,14,"‎بل اشتهوا شهوة في البرية وجربوا الله في القفر‎"));
arasuperobject.biblemap.put("b19_106_15", new arasuperobject(19,106,15,"‎فاعطاهم سؤلهم وارسل هزالا في انفسهم‎"));
arasuperobject.biblemap.put("b19_106_16", new arasuperobject(19,106,16,"‎وحسدوا موسى في المحلّة وهرون قدوس الرب‎"));
arasuperobject.biblemap.put("b19_106_17", new arasuperobject(19,106,17,"‎فتحت الارض وابتلعت داثان وطبقت على جماعة ابيرام‎"));
arasuperobject.biblemap.put("b19_106_18", new arasuperobject(19,106,18,"‎واشتعلت نار في جماعتهم. اللهيب احرق الاشرار"));
arasuperobject.biblemap.put("b19_106_19", new arasuperobject(19,106,19,"صنعوا عجلا في حوريب وسجدوا لتمثال مسبوك‎"));
arasuperobject.biblemap.put("b19_106_20", new arasuperobject(19,106,20,"‎وابدلوا مجدهم بمثال ثور آكل عشب‎"));
arasuperobject.biblemap.put("b19_106_21", new arasuperobject(19,106,21,"‎نسوا الله مخلصهم الصانع عظائم في مصر"));
arasuperobject.biblemap.put("b19_106_22", new arasuperobject(19,106,22,"وعجائب في ارض حام ومخاوف على بحر سوف‎"));
arasuperobject.biblemap.put("b19_106_23", new arasuperobject(19,106,23,"‎فقال باهلاكهم لولا موسى مختاره وقف في الثغر قدامه ليصرف غضبه عن اتلافهم‎"));
arasuperobject.biblemap.put("b19_106_24", new arasuperobject(19,106,24,"‎ورذلوا الارض الشهية. لم يؤمنوا بكلمته‎"));
arasuperobject.biblemap.put("b19_106_25", new arasuperobject(19,106,25,"‎بل تمرمروا في خيامهم. لم يسمعوا لصوت الرب‎"));
arasuperobject.biblemap.put("b19_106_26", new arasuperobject(19,106,26,"‎فرفع يده عليهم ليسقطهم في البرية"));
arasuperobject.biblemap.put("b19_106_27", new arasuperobject(19,106,27,"وليسقط نسلهم بين الامم وليبددهم في الاراضي‎"));
arasuperobject.biblemap.put("b19_106_28", new arasuperobject(19,106,28,"‎وتعلقوا ببعل فغور واكلوا ذبائح الموتى‎"));
arasuperobject.biblemap.put("b19_106_29", new arasuperobject(19,106,29,"‎واغاظوه باعمالهم فاقتحمهم الوبأ‎"));
arasuperobject.biblemap.put("b19_106_30", new arasuperobject(19,106,30,"‎فوقف فينحاس ودان فامتنع الوبأ‎"));
arasuperobject.biblemap.put("b19_106_31", new arasuperobject(19,106,31,"‎فحسب له ذلك برا الى دور فدور الى الابد"));
arasuperobject.biblemap.put("b19_106_32", new arasuperobject(19,106,32,"واسخطوه على ماء مريبة حتى تأذى موسى بسببهم‎"));
arasuperobject.biblemap.put("b19_106_33", new arasuperobject(19,106,33,"‎لانهم امرّوا روحه حتى فرط بشفتيه‎"));
arasuperobject.biblemap.put("b19_106_34", new arasuperobject(19,106,34,"‎لم يستأصلوا الامم الذين قال لهم الرب عنهم"));
arasuperobject.biblemap.put("b19_106_35", new arasuperobject(19,106,35,"بل اختلطوا بالامم وتعلموا اعمالهم"));
arasuperobject.biblemap.put("b19_106_36", new arasuperobject(19,106,36,"وعبدوا اصنامهم فصارت لهم شركا‎"));
arasuperobject.biblemap.put("b19_106_37", new arasuperobject(19,106,37,"‎وذبحوا بنيهم وبناتهم للاوثان"));
arasuperobject.biblemap.put("b19_106_38", new arasuperobject(19,106,38,"واهرقوا دما زكيا دم بنيهم وبناتهم الذين ذبحوهم لاصنام كنعان وتدنست الارض بالدماء"));
arasuperobject.biblemap.put("b19_106_39", new arasuperobject(19,106,39,"وتنجسوا باعمالهم وزنوا بافعالهم‎"));
arasuperobject.biblemap.put("b19_106_40", new arasuperobject(19,106,40,"‎فحمي غضب الرب على شعبه وكره ميراثه‎"));
arasuperobject.biblemap.put("b19_106_41", new arasuperobject(19,106,41,"‎واسلمهم ليد الامم وتسلط عليهم مبغضوهم‎"));
arasuperobject.biblemap.put("b19_106_42", new arasuperobject(19,106,42,"‎وضغطهم اعداؤهم فذلوا تحت يدهم"));
arasuperobject.biblemap.put("b19_106_43", new arasuperobject(19,106,43,"مرات كثيرة انقذهم. اما هم فعصوه بمشورتهم وانحطوا باثمهم"));
arasuperobject.biblemap.put("b19_106_44", new arasuperobject(19,106,44,"فنظر الى ضيقهم اذ سمع صراخهم‏"));
arasuperobject.biblemap.put("b19_106_45", new arasuperobject(19,106,45,"وذكر لهم عهده وندم حسب كثرة رحمته‎"));
arasuperobject.biblemap.put("b19_106_46", new arasuperobject(19,106,46,"‎واعطاهم نعمة قدام كل الذين سبوهم‎"));
arasuperobject.biblemap.put("b19_106_47", new arasuperobject(19,106,47,"‎خلّصنا ايها الرب الهنا واجمعنا من بين الامم لنحمد اسم قدسك ونتفاخر بتسبيحك‎"));
arasuperobject.biblemap.put("b19_106_48", new arasuperobject(19,106,48,"‎مبارك الرب اله اسرائيل من الازل والى الابد. ويقول كل الشعب آمين. هللويا"));
arasuperobject.biblemap.put("b19_107_1", new arasuperobject(19,107,1,"احمدوا الرب لانه صالح لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_107_2", new arasuperobject(19,107,2,"‎ليقل مفديو الرب الذين فداهم من يد العدو"));
arasuperobject.biblemap.put("b19_107_3", new arasuperobject(19,107,3,"ومن البلدان جمعهم من المشرق ومن المغرب من الشمال ومن البحر‎"));
arasuperobject.biblemap.put("b19_107_4", new arasuperobject(19,107,4,"‎تاهوا في البرية في قفر بلا طريق. لم يجدوا مدينة سكن‎"));
arasuperobject.biblemap.put("b19_107_5", new arasuperobject(19,107,5,"‎جياع عطاش ايضا اعيت انفسهم فيهم‏‎"));
arasuperobject.biblemap.put("b19_107_6", new arasuperobject(19,107,6,"‎فصرخوا الى الرب في ضيقهم فانقذهم من شدائدهم‎"));
arasuperobject.biblemap.put("b19_107_7", new arasuperobject(19,107,7,"‎وهداهم طريقا مستقيما ليذهبوا الى مدينة سكن‎"));
arasuperobject.biblemap.put("b19_107_8", new arasuperobject(19,107,8,"‎فليحمدوا الرب على رحمته وعجائبه لبني آدم"));
arasuperobject.biblemap.put("b19_107_9", new arasuperobject(19,107,9,"لانه اشبع نفسا مشتهية وملأ نفسا جائعة خبزا"));
arasuperobject.biblemap.put("b19_107_10", new arasuperobject(19,107,10,"الجلوس في الظلمة وظلال الموت موثقين بالذل والحديد‎"));
arasuperobject.biblemap.put("b19_107_11", new arasuperobject(19,107,11,"‎لانهم عصوا كلام الله واهانوا مشورة العلي"));
arasuperobject.biblemap.put("b19_107_12", new arasuperobject(19,107,12,"فاذل قلوبهم بتعب. عثروا ولا معين‎"));
arasuperobject.biblemap.put("b19_107_13", new arasuperobject(19,107,13,"‎ثم صرخوا الى الرب في ضيقهم فخلصهم من شدائدهم‎"));
arasuperobject.biblemap.put("b19_107_14", new arasuperobject(19,107,14,"‎اخرجهم من الظلمة وظلال الموت وقطع قيودهم‎"));
arasuperobject.biblemap.put("b19_107_15", new arasuperobject(19,107,15,"‎فليحمدوا الرب على رحمته وعجائبه لبني آدم‎"));
arasuperobject.biblemap.put("b19_107_16", new arasuperobject(19,107,16,"‎لانه كسر مصاريع نحاس وقطع عوارض حديد"));
arasuperobject.biblemap.put("b19_107_17", new arasuperobject(19,107,17,"والجهال من طريق معصيتهم ومن آثامهم يذلون‎"));
arasuperobject.biblemap.put("b19_107_18", new arasuperobject(19,107,18,"‎كرهت انفسهم كل طعام واقتربوا الى ابواب الموت‎"));
arasuperobject.biblemap.put("b19_107_19", new arasuperobject(19,107,19,"‎فصرخوا الى الرب في ضيقهم فخلّصهم من شدائدهم‎"));
arasuperobject.biblemap.put("b19_107_20", new arasuperobject(19,107,20,"‎ارسل كلمته فشفاهم ونجاهم من تهلكاتهم‎"));
arasuperobject.biblemap.put("b19_107_21", new arasuperobject(19,107,21,"‎فليحمدوا الرب على رحمته وعجائبه لبني آدم"));
arasuperobject.biblemap.put("b19_107_22", new arasuperobject(19,107,22,"وليذبحوا له ذبائح الحمد وليعدوا اعماله بترنم"));
arasuperobject.biblemap.put("b19_107_23", new arasuperobject(19,107,23,"النازلون الى البحر في السفن العاملون عملا في المياه الكثيرة"));
arasuperobject.biblemap.put("b19_107_24", new arasuperobject(19,107,24,"هم رأوا اعمال الرب وعجائبه في العمق‎"));
arasuperobject.biblemap.put("b19_107_25", new arasuperobject(19,107,25,"‎امر فاهاج ريحا عاصفة فرفعت امواجه‎"));
arasuperobject.biblemap.put("b19_107_26", new arasuperobject(19,107,26,"‎يصعدون الى السموات يهبطون الى الاعماق. ذابت انفسهم بالشقاء"));
arasuperobject.biblemap.put("b19_107_27", new arasuperobject(19,107,27,"يتمايلون ويترنحون مثل السكران وكل حكمتهم ابتلعت‎"));
arasuperobject.biblemap.put("b19_107_28", new arasuperobject(19,107,28,"‎فيصرخون الى الرب في ضيقهم ومن شدائدهم يخلصهم‎"));
arasuperobject.biblemap.put("b19_107_29", new arasuperobject(19,107,29,"‎يهدئ العاصفة فتسكن وتسكت امواجها‎"));
arasuperobject.biblemap.put("b19_107_30", new arasuperobject(19,107,30,"‎فيفرحون لانهم هدأوا فيهديهم الى المرفإ الذي يريدونه‎"));
arasuperobject.biblemap.put("b19_107_31", new arasuperobject(19,107,31,"‎فليحمدوا الرب على رحمته وعجائبه لبني آدم‎"));
arasuperobject.biblemap.put("b19_107_32", new arasuperobject(19,107,32,"‎وليرفعوه في مجمع الشعب وليسبحوه في مجلس المشايخ"));
arasuperobject.biblemap.put("b19_107_33", new arasuperobject(19,107,33,"يجعل الانهار قفارا ومجاري المياه معطشة"));
arasuperobject.biblemap.put("b19_107_34", new arasuperobject(19,107,34,"والارض المثمرة سبخة من شر الساكنين فيها‎"));
arasuperobject.biblemap.put("b19_107_35", new arasuperobject(19,107,35,"‎يجعل القفر غدير مياه وارضا يبسا ينابيع مياه‎"));
arasuperobject.biblemap.put("b19_107_36", new arasuperobject(19,107,36,"‎ويسكن هناك الجياع فيهيئون مدينة سكن‎"));
arasuperobject.biblemap.put("b19_107_37", new arasuperobject(19,107,37,"‎ويزرعون حقولا ويغرسون كروما فتصنع ثمر غلة‎"));
arasuperobject.biblemap.put("b19_107_38", new arasuperobject(19,107,38,"‎ويباركهم فيكثرون جدا ولا يقلل بهائمهم‎"));
arasuperobject.biblemap.put("b19_107_39", new arasuperobject(19,107,39,"‎ثم يقلون وينحنون من ضغط الشر والحزن‎"));
arasuperobject.biblemap.put("b19_107_40", new arasuperobject(19,107,40,"‎يسكب هوانا على رؤساء ويضلهم في تيه بلا طريق‎"));
arasuperobject.biblemap.put("b19_107_41", new arasuperobject(19,107,41,"‎ويعلي المسكين من الذل ويجعل القبائل مثل قطعان الغنم‎"));
arasuperobject.biblemap.put("b19_107_42", new arasuperobject(19,107,42,"‎يرى ذلك المستقيمون فيفرحون وكل اثم يسد فاه‎"));
arasuperobject.biblemap.put("b19_107_43", new arasuperobject(19,107,43,"‎من كان حكيما يحفظ هذا ويتعقل مراحم الرب"));
arasuperobject.biblemap.put("b19_108_1", new arasuperobject(19,108,1,"تسبيحة. مزمور لداود‎. ‎ثابت قلبي يا الله اغني وارنم. كذلك مجدي‏‎"));
arasuperobject.biblemap.put("b19_108_2", new arasuperobject(19,108,2,"‎استيقظي ايتها الرباب والعود انا استيقظ سحرا‎"));
arasuperobject.biblemap.put("b19_108_3", new arasuperobject(19,108,3,"‎احمدك بين الشعوب يا رب وارنم لك بين الامم‎"));
arasuperobject.biblemap.put("b19_108_4", new arasuperobject(19,108,4,"‎لان رحمتك قد عظمت فوق السموات والى الغمام حقك‎"));
arasuperobject.biblemap.put("b19_108_5", new arasuperobject(19,108,5,"‎ارتفع اللهم على السموات وليرتفع على كل الارض مجدك‎"));
arasuperobject.biblemap.put("b19_108_6", new arasuperobject(19,108,6,"‎لكي ينجو احباؤك. خلص بيمينك واستجب لي"));
arasuperobject.biblemap.put("b19_108_7", new arasuperobject(19,108,7,"الله قد تكلم بقدسه. ابتهج اقسم شكيم واقيس وادي سكوت‎"));
arasuperobject.biblemap.put("b19_108_8", new arasuperobject(19,108,8,"‎لي جلعاد لي منسّى. افرايم خوذة راسي. يهوذا صولجاني‎"));
arasuperobject.biblemap.put("b19_108_9", new arasuperobject(19,108,9,"‎موآب مرحضتي. على ادوم اطرح نعلي. يا فلسطين اهتفي عليّ"));
arasuperobject.biblemap.put("b19_108_10", new arasuperobject(19,108,10,"من يقودني الى المدينة المحصّنة. من يهديني الى ادوم‎"));
arasuperobject.biblemap.put("b19_108_11", new arasuperobject(19,108,11,"‎أليس انت يا الله الذي رفضتنا ولا تخرج يا الله مع جيوشنا‎"));
arasuperobject.biblemap.put("b19_108_12", new arasuperobject(19,108,12,"‎اعطنا عونا في الضيق فباطل هو خلاص الانسان‎"));
arasuperobject.biblemap.put("b19_108_13", new arasuperobject(19,108,13,"‎بالله نصنع بباس وهو يدوس اعداءنا"));
arasuperobject.biblemap.put("b19_109_1", new arasuperobject(19,109,1,"لامام المغنين. لداود. مزمور‎. ‎يا اله تسبيحي لا تسكت‎"));
arasuperobject.biblemap.put("b19_109_2", new arasuperobject(19,109,2,"‎لانه قد انفتح عليّ فم الشرير وفم الغش. تكلموا معي بلسان كذب"));
arasuperobject.biblemap.put("b19_109_3", new arasuperobject(19,109,3,"بكلام بغض احاطوا بي وقاتلوني بلا سبب‎"));
arasuperobject.biblemap.put("b19_109_4", new arasuperobject(19,109,4,"‎بدل محبتي يخاصمونني. اما انا فصلاة‎"));
arasuperobject.biblemap.put("b19_109_5", new arasuperobject(19,109,5,"‎وضعوا علي شرا بدل خير وبغضا بدل حبي"));
arasuperobject.biblemap.put("b19_109_6", new arasuperobject(19,109,6,"فاقم انت عليه شريرا وليقف شيطان عن يمينه‏‎"));
arasuperobject.biblemap.put("b19_109_7", new arasuperobject(19,109,7,"‎اذا حوكم فليخرج مذنبا وصلاته فلتكن خطية‎"));
arasuperobject.biblemap.put("b19_109_8", new arasuperobject(19,109,8,"‎لتكن ايامه قليلة ووظيفته ليأخذها آخر‎"));
arasuperobject.biblemap.put("b19_109_9", new arasuperobject(19,109,9,"‎ليكن بنوه ايتاما وامرأته ارملة‎"));
arasuperobject.biblemap.put("b19_109_10", new arasuperobject(19,109,10,"‎ليته بنوه تيهانا ويستعطوا. ويلتمسوا خبزا من خربهم‎"));
arasuperobject.biblemap.put("b19_109_11", new arasuperobject(19,109,11,"‎ليصطد المرابي كل ما له ولينهب الغرباء تعبه‎"));
arasuperobject.biblemap.put("b19_109_12", new arasuperobject(19,109,12,"‎لا يكن له باسط رحمة ولا يكن مترأف على يتاماه‎"));
arasuperobject.biblemap.put("b19_109_13", new arasuperobject(19,109,13,"‎لتنقرض ذريته. في الجيل القادم ليمح اسمهم‎"));
arasuperobject.biblemap.put("b19_109_14", new arasuperobject(19,109,14,"‎ليذكر اثم آبائه لدى الرب ولا تمح خطية امه‎"));
arasuperobject.biblemap.put("b19_109_15", new arasuperobject(19,109,15,"‎لتكن امام الرب دائما وليقرض من الارض ذكرهم‎"));
arasuperobject.biblemap.put("b19_109_16", new arasuperobject(19,109,16,"‎من اجل انه لم يذكر ان يصنع رحمة بل طرد انسانا مسكينا وفقيرا‏ والمنسحق القلب ليميته‎"));
arasuperobject.biblemap.put("b19_109_17", new arasuperobject(19,109,17,"‎واحب اللعنة فأتته ولم يسر بالبركة فتباعدت عنه‎"));
arasuperobject.biblemap.put("b19_109_18", new arasuperobject(19,109,18,"‎ولبس اللعنة مثل ثوبه فدخلت كمياه في حشاه وكزيت في عظامه‎"));
arasuperobject.biblemap.put("b19_109_19", new arasuperobject(19,109,19,"‎لتكن له كثوب يتعطف به وكمنطقة يتنطق بها دائما‎"));
arasuperobject.biblemap.put("b19_109_20", new arasuperobject(19,109,20,"‎هذه اجرة مبغضيّ من عند الرب واجرة المتكلمين شرا على نفسي"));
arasuperobject.biblemap.put("b19_109_21", new arasuperobject(19,109,21,"اما انت يا رب السيد فاصنع معي من اجل اسمك. لان رحمتك طيبة نجني‎"));
arasuperobject.biblemap.put("b19_109_22", new arasuperobject(19,109,22,"‎فاني فقير ومسكين انا وقلبي مجروح في داخلي‎"));
arasuperobject.biblemap.put("b19_109_23", new arasuperobject(19,109,23,"‎كظل عند ميله ذهبت. انتفضت كجرادة‎"));
arasuperobject.biblemap.put("b19_109_24", new arasuperobject(19,109,24,"‎ركبتاي ارتعشتا من الصوم ولحمي هزل عن سمن‎"));
arasuperobject.biblemap.put("b19_109_25", new arasuperobject(19,109,25,"‎وانا صرت عارا عندهم. ينظرون اليّ وينغضون رؤوسهم"));
arasuperobject.biblemap.put("b19_109_26", new arasuperobject(19,109,26,"أعنّي يا رب الهي. خلّصني حسب رحمتك‎"));
arasuperobject.biblemap.put("b19_109_27", new arasuperobject(19,109,27,"‎وليعلموا ان هذه هي يدك. انت يا رب فعلت هذا‎"));
arasuperobject.biblemap.put("b19_109_28", new arasuperobject(19,109,28,"‎اما هم فيلعنون. واما انت فتبارك. قاموا وخزوا. اما عبدك فيفرح‎"));
arasuperobject.biblemap.put("b19_109_29", new arasuperobject(19,109,29,"‎ليلبس خصمائي خجلا وليتعطفوا بخزيهم كالرداء‎"));
arasuperobject.biblemap.put("b19_109_30", new arasuperobject(19,109,30,"‎احمد الرب جدا بفمي وفي وسط كثيرين اسبحه‎"));
arasuperobject.biblemap.put("b19_109_31", new arasuperobject(19,109,31,"‎لانه يقوم عن يمين المسكين ليخلّصه من القاضين على نفسه"));
arasuperobject.biblemap.put("b19_110_1", new arasuperobject(19,110,1,"لداود. مزمور‎. ‎قال الرب لربي اجلس عن يميني حتى اضع اعداءك موطئا لقدميك‎"));
arasuperobject.biblemap.put("b19_110_2", new arasuperobject(19,110,2,"‎يرسل الرب قضيب عزك من صهيون. تسلط في وسط اعدائك‎"));
arasuperobject.biblemap.put("b19_110_3", new arasuperobject(19,110,3,"‎شعبك منتدب في يوم قوتك في زينة مقدسة من رحم الفجر لك طل حداثتك"));
arasuperobject.biblemap.put("b19_110_4", new arasuperobject(19,110,4,"اقسم الرب ولن يندم. انت كاهن الى الابد على رتبة ملكي صادق‎"));
arasuperobject.biblemap.put("b19_110_5", new arasuperobject(19,110,5,"‎الرب عن يمينك يحطم في يوم رجزه ملوكا‎"));
arasuperobject.biblemap.put("b19_110_6", new arasuperobject(19,110,6,"‎يدين بين الامم. ملأ جثثا ارضا واسعة سحق رؤوسها‎"));
arasuperobject.biblemap.put("b19_110_7", new arasuperobject(19,110,7,"‎من النهر يشرب في الطريق لذلك يرفع الراس"));
arasuperobject.biblemap.put("b19_111_1", new arasuperobject(19,111,1,"هللويا. احمد الرب بكل قلبي في مجلس المستقيمين وجماعتهم‎"));
arasuperobject.biblemap.put("b19_111_2", new arasuperobject(19,111,2,"‎عظيمة هي اعمال الرب مطلوبة لكل المسرورين بها‎"));
arasuperobject.biblemap.put("b19_111_3", new arasuperobject(19,111,3,"‎جلال وبهاء عمله وعدله قائم الى الابد‎"));
arasuperobject.biblemap.put("b19_111_4", new arasuperobject(19,111,4,"‎صنع ذكرا لعجائبه. حنّان ورحيم هو الرب‏‎"));
arasuperobject.biblemap.put("b19_111_5", new arasuperobject(19,111,5,"‎اعطى خائفيه طعاما‎ . ‎ ‎يذكر الى الابد عهده‎"));
arasuperobject.biblemap.put("b19_111_6", new arasuperobject(19,111,6,"‎اخبر شعبه بقوة اعماله ليعطيهم ميراث الامم‎"));
arasuperobject.biblemap.put("b19_111_7", new arasuperobject(19,111,7,"‎اعمال يديه امانة وحق. كل وصاياه امينة"));
arasuperobject.biblemap.put("b19_111_8", new arasuperobject(19,111,8,"ثابتة مدى الدهر والابد مصنوعة بالحق والاستقامة‎"));
arasuperobject.biblemap.put("b19_111_9", new arasuperobject(19,111,9,"‎ارسل فداء لشعبه. اقام الى الابد عهده. قدوس ومهوب اسمه‎"));
arasuperobject.biblemap.put("b19_111_10", new arasuperobject(19,111,10,"‎راس الحكمة مخافة الرب. فطنة جيدة لكل عامليها. تسبيحه قائم الى الابد"));
arasuperobject.biblemap.put("b19_112_1", new arasuperobject(19,112,1,"هللويا. طوبى للرجل المتقي الرب المسرور جدا بوصاياه‎"));
arasuperobject.biblemap.put("b19_112_2", new arasuperobject(19,112,2,"‎نسله يكون قويا في الارض. جيل المستقيمين يبارك‎"));
arasuperobject.biblemap.put("b19_112_3", new arasuperobject(19,112,3,"‎رغد وغنى في بيته وبره قائم الى الابد‏‎"));
arasuperobject.biblemap.put("b19_112_4", new arasuperobject(19,112,4,"‎نور اشرق في الظلمة للمستقيمين. هو حنّان ورحيم وصديق"));
arasuperobject.biblemap.put("b19_112_5", new arasuperobject(19,112,5,"سعيد هو الرجل الذي يترأف ويقرض. يدبر اموره بالحق‎"));
arasuperobject.biblemap.put("b19_112_6", new arasuperobject(19,112,6,"‎لانه لا يتزعزع الى الدهر. الصدّيق يكون لذكر ابدي‎"));
arasuperobject.biblemap.put("b19_112_7", new arasuperobject(19,112,7,"‎لا يخشى من خبر سوء. قلبه ثابت متكلا على الرب‎"));
arasuperobject.biblemap.put("b19_112_8", new arasuperobject(19,112,8,"‎قلبه ممكن فلا يخاف حتى يرى بمضايقيه‎"));
arasuperobject.biblemap.put("b19_112_9", new arasuperobject(19,112,9,"‎فرّق اعطى المساكين بره قائم الى الابد. قرنه ينتصب بالمجد‎"));
arasuperobject.biblemap.put("b19_112_10", new arasuperobject(19,112,10,"‎الشرير يرى فيغضب. يحرق اسنانه ويذوب. شهوة الشرير تبيد"));
arasuperobject.biblemap.put("b19_113_1", new arasuperobject(19,113,1,"هللويا. سبحوا يا عبيد الرب. سبحوا اسم الرب‎"));
arasuperobject.biblemap.put("b19_113_2", new arasuperobject(19,113,2,"‎ليكن اسم الرب مباركا من الآن والى الابد‎"));
arasuperobject.biblemap.put("b19_113_3", new arasuperobject(19,113,3,"‎من مشرق الشمس الى مغربها اسم الرب مسبح‎"));
arasuperobject.biblemap.put("b19_113_4", new arasuperobject(19,113,4,"‎الرب عال فوق كل الامم. فوق السموات مجده‎"));
arasuperobject.biblemap.put("b19_113_5", new arasuperobject(19,113,5,"‎من مثل الرب الهنا الساكن في الاعالي"));
arasuperobject.biblemap.put("b19_113_6", new arasuperobject(19,113,6,"الناظر الاسافل في السموات وفي الارض"));
arasuperobject.biblemap.put("b19_113_7", new arasuperobject(19,113,7,"المقيم المسكين من التراب. الرافع البائس من المزبلة"));
arasuperobject.biblemap.put("b19_113_8", new arasuperobject(19,113,8,"ليجلسه مع اشراف مع اشراف شعبه‎"));
arasuperobject.biblemap.put("b19_113_9", new arasuperobject(19,113,9,"‎المسكن العاقر في بيت ام اولاد فرحانة. هللويا"));
arasuperobject.biblemap.put("b19_114_1", new arasuperobject(19,114,1,"عند خروج اسرائيل من مصر وبيت يعقوب من شعب أعجم"));
arasuperobject.biblemap.put("b19_114_2", new arasuperobject(19,114,2,"كان يهوذا مقدسه. واسرائيل محل سلطانه‎"));
arasuperobject.biblemap.put("b19_114_3", new arasuperobject(19,114,3,"‎البحر رآه فهرب. الاردن رجع الى خلف‎"));
arasuperobject.biblemap.put("b19_114_4", new arasuperobject(19,114,4,"‎الجبال قفزت مثل الكباش والآكام مثل حملان الغنم‎"));
arasuperobject.biblemap.put("b19_114_5", new arasuperobject(19,114,5,"‎ما لك ايها البحر قد هربت وما لك ايها الاردن قد رجعت الى خلف"));
arasuperobject.biblemap.put("b19_114_6", new arasuperobject(19,114,6,"وما لكن ايتها الجبال قد قفزتنّ مثل الكباش وايتها التلال مثل حملان الغنم‎"));
arasuperobject.biblemap.put("b19_114_7", new arasuperobject(19,114,7,"‎ايتها الارض تزلزلي من قدام الرب من قدام اله يعقوب"));
arasuperobject.biblemap.put("b19_114_8", new arasuperobject(19,114,8,"المحول الصخرة الى غدران مياه الصوان الى ينابيع مياه"));
arasuperobject.biblemap.put("b19_115_1", new arasuperobject(19,115,1,"ليس لنا يا رب ليس لنا لكن لاسمك اعط مجدا من اجل رحمتك من اجل امانتك‎"));
arasuperobject.biblemap.put("b19_115_2", new arasuperobject(19,115,2,"‎لماذا يقول الامم اين هو الههم‎"));
arasuperobject.biblemap.put("b19_115_3", new arasuperobject(19,115,3,"‎ان الهنا في السماء. كلما شاء صنع‎"));
arasuperobject.biblemap.put("b19_115_4", new arasuperobject(19,115,4,"‎اصنامهم فضة وذهب عمل ايدي الناس‎"));
arasuperobject.biblemap.put("b19_115_5", new arasuperobject(19,115,5,"‎لها افواه ولا تتكلم. لها اعين ولا تبصر‎"));
arasuperobject.biblemap.put("b19_115_6", new arasuperobject(19,115,6,"‎لها آذان ولا تسمع. لها مناخر ولا تشم‎"));
arasuperobject.biblemap.put("b19_115_7", new arasuperobject(19,115,7,"‎لها ايد ولا تلمس. لها ارجل ولا تمشي ولا تنطق بحناجرها‎"));
arasuperobject.biblemap.put("b19_115_8", new arasuperobject(19,115,8,"‎مثلها يكون صانعوها بل كل من يتكل عليها"));
arasuperobject.biblemap.put("b19_115_9", new arasuperobject(19,115,9,"يا اسرائيل اتكل على الرب. هو معينهم ومجنهم‎"));
arasuperobject.biblemap.put("b19_115_10", new arasuperobject(19,115,10,"‎يا بيت هرون اتكلوا على الرب. هو معينهم ومجنهم‎"));
arasuperobject.biblemap.put("b19_115_11", new arasuperobject(19,115,11,"‎يا متقي الرب اتكلوا على الرب. هو معينهم ومجنهم‎"));
arasuperobject.biblemap.put("b19_115_12", new arasuperobject(19,115,12,"‎الرب قد ذكرنا فيبارك. يبارك بيت اسرائيل يبارك بيت هرون‎"));
arasuperobject.biblemap.put("b19_115_13", new arasuperobject(19,115,13,"‎يبارك متقي الرب الصغار مع الكبار‎"));
arasuperobject.biblemap.put("b19_115_14", new arasuperobject(19,115,14,"‎ليزد الرب عليكم. عليكم وعلى ابنائكم‎"));
arasuperobject.biblemap.put("b19_115_15", new arasuperobject(19,115,15,"‎انتم مباركون للرب الصانع السموات والارض‎"));
arasuperobject.biblemap.put("b19_115_16", new arasuperobject(19,115,16,"‎السموات سموات للرب. اما الارض فاعطاها لبني آدم‎"));
arasuperobject.biblemap.put("b19_115_17", new arasuperobject(19,115,17,"‎ليس الاموات يسبحون الرب ولا من ينحدر الى ارض السكوت‎"));
arasuperobject.biblemap.put("b19_115_18", new arasuperobject(19,115,18,"‎اما نحن فنبارك الرب من الآن والى الدهر. هللويا"));
arasuperobject.biblemap.put("b19_116_1", new arasuperobject(19,116,1,"احببت لان الرب يسمع صوتي تضرعاتي‎"));
arasuperobject.biblemap.put("b19_116_2", new arasuperobject(19,116,2,"‎لانه امال اذنه اليّ. فادعوه مدة حياتي‎"));
arasuperobject.biblemap.put("b19_116_3", new arasuperobject(19,116,3,"‎اكتنفتني حبال الموت اصابتني شدائد الهاوية. كابدت ضيقا وحزنا"));
arasuperobject.biblemap.put("b19_116_4", new arasuperobject(19,116,4,"وباسم الرب دعوت آه يا رب نج نفسي‎"));
arasuperobject.biblemap.put("b19_116_5", new arasuperobject(19,116,5,"‎الرب حنّان وصديق والهنا رحيم‎"));
arasuperobject.biblemap.put("b19_116_6", new arasuperobject(19,116,6,"‎الرب حافظ البسطاء. تذللت فخلصني‎"));
arasuperobject.biblemap.put("b19_116_7", new arasuperobject(19,116,7,"‎ارجعي يا نفسي الى راحتك لان الرب قد احسن اليك‎"));
arasuperobject.biblemap.put("b19_116_8", new arasuperobject(19,116,8,"‎لانك انقذت نفسي من الموت وعيني من الدمعة ورجلي من الزلق‎"));
arasuperobject.biblemap.put("b19_116_9", new arasuperobject(19,116,9,"‎اسلك قدام الرب في ارض الاحياء"));
arasuperobject.biblemap.put("b19_116_10", new arasuperobject(19,116,10,"آمنت لذلك تكلمت. انا تذللت جدا‎"));
arasuperobject.biblemap.put("b19_116_11", new arasuperobject(19,116,11,"‎انا قلت في حيرتي كل انسان كاذب‎"));
arasuperobject.biblemap.put("b19_116_12", new arasuperobject(19,116,12,"‎ماذا ارد للرب من اجل كل حسناته لي‎"));
arasuperobject.biblemap.put("b19_116_13", new arasuperobject(19,116,13,"‎كاس الخلاص اتناول وباسم الرب ادعو‎"));
arasuperobject.biblemap.put("b19_116_14", new arasuperobject(19,116,14,"‎اوفي نذوري للرب مقابل كل شعبه"));
arasuperobject.biblemap.put("b19_116_15", new arasuperobject(19,116,15,"عزيز في عيني الرب موت اتقيائه‎"));
arasuperobject.biblemap.put("b19_116_16", new arasuperobject(19,116,16,"‎آه يا رب. لاني عبدك. انا عبدك ابن امتك. حللت قيودي‎"));
arasuperobject.biblemap.put("b19_116_17", new arasuperobject(19,116,17,"‎فلك اذبح ذبيحة حمد وباسم الرب ادعو‏‎"));
arasuperobject.biblemap.put("b19_116_18", new arasuperobject(19,116,18,"‎اوفي نذوري للرب مقابل شعبه"));
arasuperobject.biblemap.put("b19_116_19", new arasuperobject(19,116,19,"في ديار بيت الرب في وسطك يا اورشليم. هللويا"));
arasuperobject.biblemap.put("b19_117_1", new arasuperobject(19,117,1,"سبحوا الرب يا كل الامم حمدوه يا كل الشعوب‎"));
arasuperobject.biblemap.put("b19_117_2", new arasuperobject(19,117,2,"‎لان رحمته قد قويت علينا وامانة الرب الى الدهر. هللويا"));
arasuperobject.biblemap.put("b19_118_1", new arasuperobject(19,118,1,"احمدوا الرب لانه صالح لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_118_2", new arasuperobject(19,118,2,"‎ليقل اسرائيل ان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_118_3", new arasuperobject(19,118,3,"‎ليقل بيت هرون ان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_118_4", new arasuperobject(19,118,4,"‎ليقل متقو الرب ان الى الابد رحمته"));
arasuperobject.biblemap.put("b19_118_5", new arasuperobject(19,118,5,"من الضيق دعوت الرب فاجابني من الرحب‎"));
arasuperobject.biblemap.put("b19_118_6", new arasuperobject(19,118,6,"‎الرب لي فلا اخاف. ماذا يصنع بي الانسان‎"));
arasuperobject.biblemap.put("b19_118_7", new arasuperobject(19,118,7,"‎الرب لي بين معينيّ وانا سأرى باعدائي‎"));
arasuperobject.biblemap.put("b19_118_8", new arasuperobject(19,118,8,"‎الاحتماء بالرب خير من التوكل على انسان"));
arasuperobject.biblemap.put("b19_118_9", new arasuperobject(19,118,9,"الاحتماء بالرب خير من التوكل على الرؤساء‎"));
arasuperobject.biblemap.put("b19_118_10", new arasuperobject(19,118,10,"‎كل الامم احاطوا بي. باسم الرب ابيدهم‎"));
arasuperobject.biblemap.put("b19_118_11", new arasuperobject(19,118,11,"‎احاطوا بي واكتنفوني. باسم الرب ابيدهم‎"));
arasuperobject.biblemap.put("b19_118_12", new arasuperobject(19,118,12,"‎احاطوا بي مثل النحل. انطفأوا كنار الشوك. باسم الرب ابيدهم"));
arasuperobject.biblemap.put("b19_118_13", new arasuperobject(19,118,13,"دحرتني دحورا لاسقط. اما الرب فعضدني‎"));
arasuperobject.biblemap.put("b19_118_14", new arasuperobject(19,118,14,"‎قوتي وترنمي الرب وقد صار لي خلاصا‎"));
arasuperobject.biblemap.put("b19_118_15", new arasuperobject(19,118,15,"‎صوت ترنم وخلاص في خيام الصديقين. يمين الرب صانعة ببأس"));
arasuperobject.biblemap.put("b19_118_16", new arasuperobject(19,118,16,"يمين الرب مرتفعة. يمين الرب صانعة ببأس‎"));
arasuperobject.biblemap.put("b19_118_17", new arasuperobject(19,118,17,"‎لا اموت بل احيا واحدث باعمال الرب‎"));
arasuperobject.biblemap.put("b19_118_18", new arasuperobject(19,118,18,"‎تأديبا ادبني الرب والى الموت لم يسلمني"));
arasuperobject.biblemap.put("b19_118_19", new arasuperobject(19,118,19,"افتحوا لي ابواب البر. ادخل فيها واحمد الرب‎"));
arasuperobject.biblemap.put("b19_118_20", new arasuperobject(19,118,20,"‎هذا الباب للرب. الصديقون يدخلون فيه‎"));
arasuperobject.biblemap.put("b19_118_21", new arasuperobject(19,118,21,"‎احمدك لانك استجبت لي وصرت لي خلاصا‎"));
arasuperobject.biblemap.put("b19_118_22", new arasuperobject(19,118,22,"‎الحجر الذي رفضه البناؤون قد صار راس الزاوية‎"));
arasuperobject.biblemap.put("b19_118_23", new arasuperobject(19,118,23,"‎من قبل الرب كان هذا وهو عجيب في اعيننا"));
arasuperobject.biblemap.put("b19_118_24", new arasuperobject(19,118,24,"هذا هو اليوم الذي صنعه الرب. نبتهج ونفرح فيه‎"));
arasuperobject.biblemap.put("b19_118_25", new arasuperobject(19,118,25,"‎آه يا رب خلّص. آه يا رب انقذ‎"));
arasuperobject.biblemap.put("b19_118_26", new arasuperobject(19,118,26,"‎مبارك الآتي باسم الرب. باركناكم من بيت الرب‎"));
arasuperobject.biblemap.put("b19_118_27", new arasuperobject(19,118,27,"‎الرب هو الله وقد انار لنا. اوثقوا الذبيحة بربط الى قرون المذبح‎"));
arasuperobject.biblemap.put("b19_118_28", new arasuperobject(19,118,28,"‎الهي انت فاحمدك الهي فارفعك‎"));
arasuperobject.biblemap.put("b19_118_29", new arasuperobject(19,118,29,"‎احمدوا الرب لانه صالح لان الى الابد رحمته"));
arasuperobject.biblemap.put("b19_119_1", new arasuperobject(19,119,1,"ا ـ طوبى للكاملين طريقا السالكين في شريعة الرب‎"));
arasuperobject.biblemap.put("b19_119_2", new arasuperobject(19,119,2,"‎طوبى لحافظي شهاداته. من كل قلوبهم يطلبونه‎"));
arasuperobject.biblemap.put("b19_119_3", new arasuperobject(19,119,3,"‎ايضا لا يرتكبون اثما. في طرقه يسلكون‎"));
arasuperobject.biblemap.put("b19_119_4", new arasuperobject(19,119,4,"‎انت اوصيت بوصاياك ان تحفظ تماما"));
arasuperobject.biblemap.put("b19_119_5", new arasuperobject(19,119,5,"ليت طرقي تثبت في حفظ فرائضك‎"));
arasuperobject.biblemap.put("b19_119_6", new arasuperobject(19,119,6,"‎حينئذ لا اخزى اذا نظرت الى كل وصاياك‎"));
arasuperobject.biblemap.put("b19_119_7", new arasuperobject(19,119,7,"‎احمدك باستقامة قلب عند تعلمي احكام عدلك‎"));
arasuperobject.biblemap.put("b19_119_8", new arasuperobject(19,119,8,"‎وصاياك احفظ. لا تتركني الى الغاية"));
arasuperobject.biblemap.put("b19_119_9", new arasuperobject(19,119,9,"ب ـ بم يزكي الشاب طريقه. بحفظه اياه حسب كلامك‎"));
arasuperobject.biblemap.put("b19_119_10", new arasuperobject(19,119,10,"‎بكل قلبي طلبتك. لا تضلني عن وصاياك‎"));
arasuperobject.biblemap.put("b19_119_11", new arasuperobject(19,119,11,"‎خبأت كلامك في قلبي لكيلا اخطئ اليك‎"));
arasuperobject.biblemap.put("b19_119_12", new arasuperobject(19,119,12,"‎مبارك انت يا رب. علمني فرائضك‎"));
arasuperobject.biblemap.put("b19_119_13", new arasuperobject(19,119,13,"‎بشفتيّ حسبت كل احكام فمك‎"));
arasuperobject.biblemap.put("b19_119_14", new arasuperobject(19,119,14,"‎بطريق شهاداتك فرحت كما على كل الغنى‎"));
arasuperobject.biblemap.put("b19_119_15", new arasuperobject(19,119,15,"‎بوصاياك الهج والاحظ سبلك‎"));
arasuperobject.biblemap.put("b19_119_16", new arasuperobject(19,119,16,"‎بفرائضك اتلذذ. لا انسى كلامك"));
arasuperobject.biblemap.put("b19_119_17", new arasuperobject(19,119,17,"ج ـ احسن الى عبدك فاحيا واحفظ امرك‎"));
arasuperobject.biblemap.put("b19_119_18", new arasuperobject(19,119,18,"‎اكشف عن عينيّ فارى عجائب من شريعتك‎"));
arasuperobject.biblemap.put("b19_119_19", new arasuperobject(19,119,19,"‎غريب انا في الارض. لا تخف عني وصاياك‎"));
arasuperobject.biblemap.put("b19_119_20", new arasuperobject(19,119,20,"‎انسحقت نفسي شوقا الى احكامك في كل حين‎"));
arasuperobject.biblemap.put("b19_119_21", new arasuperobject(19,119,21,"‎انتهرت المتكبرين الملاعين الضالين عن وصاياك‎"));
arasuperobject.biblemap.put("b19_119_22", new arasuperobject(19,119,22,"‎دحرج عني العار والاهانة لاني حفظت شهاداتك‎"));
arasuperobject.biblemap.put("b19_119_23", new arasuperobject(19,119,23,"‎جلس ايضا رؤساء تقاولوا عليّ. اما عبدك فيناجي بفرائضك‎"));
arasuperobject.biblemap.put("b19_119_24", new arasuperobject(19,119,24,"‎ايضا شهاداتك هي لذّتي اهل مشورتي"));
arasuperobject.biblemap.put("b19_119_25", new arasuperobject(19,119,25,"د ـ لصقت بالتراب نفسي فاحيني حسب كلمتك‎"));
arasuperobject.biblemap.put("b19_119_26", new arasuperobject(19,119,26,"‎قد صرّحت بطرقي فاستجبت لي. علمني فرائضك‎"));
arasuperobject.biblemap.put("b19_119_27", new arasuperobject(19,119,27,"‎طريق وصاياك فهمني فاناجي بعجائبك‎"));
arasuperobject.biblemap.put("b19_119_28", new arasuperobject(19,119,28,"‎قطرت نفسي من الحزن. اقمني حسب كلامك‎"));
arasuperobject.biblemap.put("b19_119_29", new arasuperobject(19,119,29,"‎طريق الكذب ابعد عني وبشريعتك ارحمني‎"));
arasuperobject.biblemap.put("b19_119_30", new arasuperobject(19,119,30,"‎اخترت طريق الحق. جعلت احكامك قدامي‎"));
arasuperobject.biblemap.put("b19_119_31", new arasuperobject(19,119,31,"‎لصقت بشهاداتك. يا رب لا تخزني‎"));
arasuperobject.biblemap.put("b19_119_32", new arasuperobject(19,119,32,"‎في طريق وصاياك اجري لانك ترحب قلبي"));
arasuperobject.biblemap.put("b19_119_33", new arasuperobject(19,119,33,"ه ـ علّمني يا رب طريق فرائضك فاحفظها الى النهاية‎"));
arasuperobject.biblemap.put("b19_119_34", new arasuperobject(19,119,34,"‎فهمني فالاحظ شريعتك واحفظها بكل قلبي‎"));
arasuperobject.biblemap.put("b19_119_35", new arasuperobject(19,119,35,"‎دربني في سبيل وصاياك لاني به سررت‎"));
arasuperobject.biblemap.put("b19_119_36", new arasuperobject(19,119,36,"‎أمل قلبي الى شهاداتك لا الى المكسب‎"));
arasuperobject.biblemap.put("b19_119_37", new arasuperobject(19,119,37,"‎حول عينيّ عن النظر الى الباطل. في طريقك احيني‎"));
arasuperobject.biblemap.put("b19_119_38", new arasuperobject(19,119,38,"‎أقم لعبدك قولك الذي لمتقيك‎"));
arasuperobject.biblemap.put("b19_119_39", new arasuperobject(19,119,39,"‎أزل عاري الذي حذرت منه لان احكامك طيبة‎"));
arasuperobject.biblemap.put("b19_119_40", new arasuperobject(19,119,40,"‎هانذا قد اشتهيت وصاياك. بعدلك احيني"));
arasuperobject.biblemap.put("b19_119_41", new arasuperobject(19,119,41,"و ـ لتأتني رحمتك يا رب خلاصك حسب قولك"));
arasuperobject.biblemap.put("b19_119_42", new arasuperobject(19,119,42,"فأجاوب معيّري كلمة. لاني اتكلت على كلامك‎"));
arasuperobject.biblemap.put("b19_119_43", new arasuperobject(19,119,43,"‎ولا تنزع من فمي كلام الحق كل النزع لاني انتظرت احكامك‎"));
arasuperobject.biblemap.put("b19_119_44", new arasuperobject(19,119,44,"‎فاحفظ شريعتك دائما الى الدهر والابد‎"));
arasuperobject.biblemap.put("b19_119_45", new arasuperobject(19,119,45,"‎واتمشى في رحب لاني طلبت وصاياك‎"));
arasuperobject.biblemap.put("b19_119_46", new arasuperobject(19,119,46,"‎واتكلم بشهاداتك قدام ملوك ولا اخزى"));
arasuperobject.biblemap.put("b19_119_47", new arasuperobject(19,119,47,"واتلذذ بوصاياك التي احببت‎"));
arasuperobject.biblemap.put("b19_119_48", new arasuperobject(19,119,48,"‎وارفع يديّ الى وصاياك التي وددت واناجي بفرائضك"));
arasuperobject.biblemap.put("b19_119_49", new arasuperobject(19,119,49,"ز ـ اذكر لعبدك القول الذي جعلتني انتظره‎"));
arasuperobject.biblemap.put("b19_119_50", new arasuperobject(19,119,50,"‎هذه هي تعزيتي في مذلتي. لان قولك احياني‎"));
arasuperobject.biblemap.put("b19_119_51", new arasuperobject(19,119,51,"‎المتكبرون استهزأوا بي الى الغاية. عن شريعتك لم امل‎"));
arasuperobject.biblemap.put("b19_119_52", new arasuperobject(19,119,52,"‎تذكرت احكامك منذ الدهر يا رب فتعزيت‎"));
arasuperobject.biblemap.put("b19_119_53", new arasuperobject(19,119,53,"‎الحمية اخذتني بسبب الاشرار تاركي شريعتك‎"));
arasuperobject.biblemap.put("b19_119_54", new arasuperobject(19,119,54,"‎ترنيمات صارت لي فرائضك في بيت غربتي‎"));
arasuperobject.biblemap.put("b19_119_55", new arasuperobject(19,119,55,"‎ذكرت في الليل اسمك يا رب وحفظت شريعتك‎"));
arasuperobject.biblemap.put("b19_119_56", new arasuperobject(19,119,56,"‎هذا صار لي لاني حفظت وصاياك"));
arasuperobject.biblemap.put("b19_119_57", new arasuperobject(19,119,57,"ح ـ نصيبي الرب قلت لحفظ كلامك‎"));
arasuperobject.biblemap.put("b19_119_58", new arasuperobject(19,119,58,"‎ترضيت وجهك بكل قلبي. ارحمني حسب قولك‎"));
arasuperobject.biblemap.put("b19_119_59", new arasuperobject(19,119,59,"‎تفكرت في طرقي ورددت قدمي الى شهاداتك‎"));
arasuperobject.biblemap.put("b19_119_60", new arasuperobject(19,119,60,"‎اسرعت ولم اتوان لحفظ وصاياك‎"));
arasuperobject.biblemap.put("b19_119_61", new arasuperobject(19,119,61,"‎حبال الاشرار التفت عليّ. اما شريعتك فلم انسها‎"));
arasuperobject.biblemap.put("b19_119_62", new arasuperobject(19,119,62,"‎في منتصف الليل اقوم لاحمدك على احكام برك‎"));
arasuperobject.biblemap.put("b19_119_63", new arasuperobject(19,119,63,"‎رفيق انا لكل الذين يتقونك ولحافظي وصاياك‎"));
arasuperobject.biblemap.put("b19_119_64", new arasuperobject(19,119,64,"‎رحمتك يا رب قد ملأت الارض. علّمني فرائضك"));
arasuperobject.biblemap.put("b19_119_65", new arasuperobject(19,119,65,"ط ـ خيرا صنعت مع عبدك يا رب حسب كلامك‎"));
arasuperobject.biblemap.put("b19_119_66", new arasuperobject(19,119,66,"‎ذوقا صالحا ومعرفة علمني لاني بوصاياك آمنت‎"));
arasuperobject.biblemap.put("b19_119_67", new arasuperobject(19,119,67,"‎قبل ان أذلل انا ضللت. اما الآن فحفظت قولك‎"));
arasuperobject.biblemap.put("b19_119_68", new arasuperobject(19,119,68,"‎صالح انت ومحسن علمني فرائضك‎"));
arasuperobject.biblemap.put("b19_119_69", new arasuperobject(19,119,69,"‎المتكبرون قد لفقوا عليّ كذبا. اما انا فبكل قلبي احفظ وصاياك"));
arasuperobject.biblemap.put("b19_119_70", new arasuperobject(19,119,70,"سمن مثل الشحم قلبهم. اما انا فبشريعتك اتلذذ‎"));
arasuperobject.biblemap.put("b19_119_71", new arasuperobject(19,119,71,"‎خير لي اني تذللت لكي اتعلم فرائضك‎"));
arasuperobject.biblemap.put("b19_119_72", new arasuperobject(19,119,72,"‎شريعة فمك خير لي من الوف ذهب وفضة"));
arasuperobject.biblemap.put("b19_119_73", new arasuperobject(19,119,73,"ي ـ يداك صنعتاني وانشأتاني. فهمني فاتعلّم وصاياك‎"));
arasuperobject.biblemap.put("b19_119_74", new arasuperobject(19,119,74,"‎متقوك يرونني فيفرحون لاني انتظرت كلامك‎"));
arasuperobject.biblemap.put("b19_119_75", new arasuperobject(19,119,75,"‎قد علمت يا رب ان احكامك عدل وبالحق اذللتني‎"));
arasuperobject.biblemap.put("b19_119_76", new arasuperobject(19,119,76,"‎فلتصر رحمتك لتعزيتي حسب قولك لعبدك‎"));
arasuperobject.biblemap.put("b19_119_77", new arasuperobject(19,119,77,"‎لتأتني مراحمك فاحيا لان شريعتك هي لذّتي‎"));
arasuperobject.biblemap.put("b19_119_78", new arasuperobject(19,119,78,"‎ليخز المتكبرون لانهم زورا افتروا عليّ. اما انا فاناجي بوصاياك‎"));
arasuperobject.biblemap.put("b19_119_79", new arasuperobject(19,119,79,"‎ليرجع اليّ متقوك وعارفو شهاداتك‎"));
arasuperobject.biblemap.put("b19_119_80", new arasuperobject(19,119,80,"‎ليكن قلبي كاملا في فرائضك لكيلا اخزى"));
arasuperobject.biblemap.put("b19_119_81", new arasuperobject(19,119,81,"ك ـ تاقت نفسي الى خلاصك. كلامك انتظرت‎"));
arasuperobject.biblemap.put("b19_119_82", new arasuperobject(19,119,82,"‎كلّت عيناي من النظر الى قولك فاقول متى تعزيني‎"));
arasuperobject.biblemap.put("b19_119_83", new arasuperobject(19,119,83,"‎لاني قد صرت كزق في الدخان. اما فرائضك فلم انسها‎"));
arasuperobject.biblemap.put("b19_119_84", new arasuperobject(19,119,84,"‎كم هي ايام عبدك. متى تجري حكما على مضطهديّ‎"));
arasuperobject.biblemap.put("b19_119_85", new arasuperobject(19,119,85,"‎المتكبرون قد كروا لي حفائر. ذلك ليس حسب شريعتك‎"));
arasuperobject.biblemap.put("b19_119_86", new arasuperobject(19,119,86,"‎كل وصاياك امانة. زورا يضطهدونني. أعنّي‎"));
arasuperobject.biblemap.put("b19_119_87", new arasuperobject(19,119,87,"‎لولا قليل لافنوني من الارض. اما انا فلم اترك وصاياك‎"));
arasuperobject.biblemap.put("b19_119_88", new arasuperobject(19,119,88,"‎حسب رحمتك احيني فاحفظ شهادات فمك"));
arasuperobject.biblemap.put("b19_119_89", new arasuperobject(19,119,89,"ل ـ الى الابد يا رب كلمتك مثبتة في السموات‎"));
arasuperobject.biblemap.put("b19_119_90", new arasuperobject(19,119,90,"‎الى دور فدور امانتك. اسست الارض فثبتت‎"));
arasuperobject.biblemap.put("b19_119_91", new arasuperobject(19,119,91,"‎على احكامك ثبتت اليوم لان الكل عبيدك‎"));
arasuperobject.biblemap.put("b19_119_92", new arasuperobject(19,119,92,"‎لو لم تكن شريعتك لذّتي لهلكت حينئذ في مذلتي‏‎"));
arasuperobject.biblemap.put("b19_119_93", new arasuperobject(19,119,93,"‎الى الدهر لا انسى وصاياك لانك بها احييتني‎"));
arasuperobject.biblemap.put("b19_119_94", new arasuperobject(19,119,94,"‎لك انا فخلّصني لاني طلبت وصاياك‎"));
arasuperobject.biblemap.put("b19_119_95", new arasuperobject(19,119,95,"‎اياي انتظر الاشرار ليهلكوني. بشهاداتك افطن‎"));
arasuperobject.biblemap.put("b19_119_96", new arasuperobject(19,119,96,"‎لكل كمال رأيت حدا. اما وصيتك فواسعة جدا"));
arasuperobject.biblemap.put("b19_119_97", new arasuperobject(19,119,97,"م ـ كم احببت شريعتك. اليوم كله هي لهجي‎"));
arasuperobject.biblemap.put("b19_119_98", new arasuperobject(19,119,98,"‎وصيتك جعلتني احكم من اعدائي لانها الى الدهر هي لي‎"));
arasuperobject.biblemap.put("b19_119_99", new arasuperobject(19,119,99,"‎اكثر من كل معلّميّ تعقلت لان شهاداتك هي لهجي‎"));
arasuperobject.biblemap.put("b19_119_100", new arasuperobject(19,119,100,"‎اكثر من الشيوخ فطنت لاني حفظت وصاياك‎"));
arasuperobject.biblemap.put("b19_119_101", new arasuperobject(19,119,101,"‎من كل طريق شر منعت رجلي لكي احفظ كلامك‎"));
arasuperobject.biblemap.put("b19_119_102", new arasuperobject(19,119,102,"‎عن احكامك لم امل لانك انت علّمتني‎"));
arasuperobject.biblemap.put("b19_119_103", new arasuperobject(19,119,103,"‎ما احلى قولك لحنكي احلى من العسل لفمي‎"));
arasuperobject.biblemap.put("b19_119_104", new arasuperobject(19,119,104,"‎من وصاياك اتفطن. لذلك ابغضت كل طريق كذب"));
arasuperobject.biblemap.put("b19_119_105", new arasuperobject(19,119,105,"ن ـ سراج لرجلي كلامك ونور لسبيلي‎"));
arasuperobject.biblemap.put("b19_119_106", new arasuperobject(19,119,106,"‎حلفت فأبره ان احفظ احكام برك‎"));
arasuperobject.biblemap.put("b19_119_107", new arasuperobject(19,119,107,"‎تذللت الى الغاية. يا رب احيني حسب كلامك‎"));
arasuperobject.biblemap.put("b19_119_108", new arasuperobject(19,119,108,"‎ارتض بمندوبات فمي يا رب واحكامك علمني‎"));
arasuperobject.biblemap.put("b19_119_109", new arasuperobject(19,119,109,"‎نفسي دائما في كفي. اما شريعتك فلم انسها‎"));
arasuperobject.biblemap.put("b19_119_110", new arasuperobject(19,119,110,"‎الاشرار وضعوا لي فخا. اما وصاياك فلم اضل عنها‎"));
arasuperobject.biblemap.put("b19_119_111", new arasuperobject(19,119,111,"‎ورثت شهاداتك الى الدهر لانها هي بهجة قلبي‎"));
arasuperobject.biblemap.put("b19_119_112", new arasuperobject(19,119,112,"‎عطفت قلبي لاصنع فرائضك الى الدهر الى النهاية"));
arasuperobject.biblemap.put("b19_119_113", new arasuperobject(19,119,113,"س ـ المتقلبين ابغضت وشريعتك احببت‎"));
arasuperobject.biblemap.put("b19_119_114", new arasuperobject(19,119,114,"‎ستري ومجني انت. كلامك انتظرت‎"));
arasuperobject.biblemap.put("b19_119_115", new arasuperobject(19,119,115,"‎انصرفوا عني ايها الاشرار فاحفظ وصايا الهي‎"));
arasuperobject.biblemap.put("b19_119_116", new arasuperobject(19,119,116,"‎اعضدني حسب قولك فاحيا ولا تخزني من رجائي‎"));
arasuperobject.biblemap.put("b19_119_117", new arasuperobject(19,119,117,"‎اسندني فاخلص واراعي فرائضك دائما‎"));
arasuperobject.biblemap.put("b19_119_118", new arasuperobject(19,119,118,"‎احتقرت كل الضالين عن فرائضك لان مكرهم باطل‎"));
arasuperobject.biblemap.put("b19_119_119", new arasuperobject(19,119,119,"‎كزغل عزلت كل اشرار الارض. لذلك احببت شهاداتك‎"));
arasuperobject.biblemap.put("b19_119_120", new arasuperobject(19,119,120,"‎قد اقشعر لحمي من رعبك ومن احكامك جزعت"));
arasuperobject.biblemap.put("b19_119_121", new arasuperobject(19,119,121,"ع ـ اجريت حكما وعدلا. لا تسلمني الى ظالميّ‎"));
arasuperobject.biblemap.put("b19_119_122", new arasuperobject(19,119,122,"‎كن ضامن عبدك للخير لكيلا يظلمني المستكبرون‎"));
arasuperobject.biblemap.put("b19_119_123", new arasuperobject(19,119,123,"‎كلت عيناي اشتياقا الى خلاصك والى كلمة برك‎"));
arasuperobject.biblemap.put("b19_119_124", new arasuperobject(19,119,124,"‎اصنع مع عبدك حسب رحمتك وفرائضك علمني‎"));
arasuperobject.biblemap.put("b19_119_125", new arasuperobject(19,119,125,"‎عبدك انا. فهمني فاعرف شهاداتك‎"));
arasuperobject.biblemap.put("b19_119_126", new arasuperobject(19,119,126,"‎انه وقت عمل للرب. قد نقضوا شريعتك‎"));
arasuperobject.biblemap.put("b19_119_127", new arasuperobject(19,119,127,"‎لاجل ذلك احببت وصاياك اكثر من الذهب والابريز‎"));
arasuperobject.biblemap.put("b19_119_128", new arasuperobject(19,119,128,"‎لاجل ذلك حسبت كل وصاياك في كل شيء مستقيمة. كل طريق كذب ابغضت"));
arasuperobject.biblemap.put("b19_119_129", new arasuperobject(19,119,129,"ف ـ عجيبة هي شهاداتك لذلك حفظتها نفسي‎"));
arasuperobject.biblemap.put("b19_119_130", new arasuperobject(19,119,130,"‎فتح كلامك ينير يعقل الجهال‎"));
arasuperobject.biblemap.put("b19_119_131", new arasuperobject(19,119,131,"‎فغرت فمي ولهثت لاني الى وصاياك اشتقت‎"));
arasuperobject.biblemap.put("b19_119_132", new arasuperobject(19,119,132,"‎التفت اليّ وارحمني كحق محبي اسمك‎"));
arasuperobject.biblemap.put("b19_119_133", new arasuperobject(19,119,133,"‎ثبت خطواتي في كلمتك ولا يتسلط عليّ اثم‎"));
arasuperobject.biblemap.put("b19_119_134", new arasuperobject(19,119,134,"‎افدني من ظلم الانسان فاحفظ وصاياك‎"));
arasuperobject.biblemap.put("b19_119_135", new arasuperobject(19,119,135,"‎اضئ بوجهك على عبدك وعلمني فرائضك‎"));
arasuperobject.biblemap.put("b19_119_136", new arasuperobject(19,119,136,"‎جداول مياه جرت من عيني لانهم لم يحفظوا شريعتك"));
arasuperobject.biblemap.put("b19_119_137", new arasuperobject(19,119,137,"ص ـ بار انت يا رب واحكامك مستقيمة‎"));
arasuperobject.biblemap.put("b19_119_138", new arasuperobject(19,119,138,"‎عدلا امرت بشهاداتك وحقا الى الغاية‎"));
arasuperobject.biblemap.put("b19_119_139", new arasuperobject(19,119,139,"‎اهلكتني غيرتي لان اعدائي نسوا كلامك‎"));
arasuperobject.biblemap.put("b19_119_140", new arasuperobject(19,119,140,"‎كلمتك ممحصة جدا وعبدك احبها‎"));
arasuperobject.biblemap.put("b19_119_141", new arasuperobject(19,119,141,"‎صغير انا وحقير. اما وصاياك فلم انسها‎"));
arasuperobject.biblemap.put("b19_119_142", new arasuperobject(19,119,142,"‎عدلك عدل الى الدهر وشريعتك حق‎"));
arasuperobject.biblemap.put("b19_119_143", new arasuperobject(19,119,143,"‎ضيق وشدة اصاباني اما وصاياك فهي لذّاتي‎"));
arasuperobject.biblemap.put("b19_119_144", new arasuperobject(19,119,144,"‎عادلة شهاداتك الى الدهر فهمني فاحيا"));
arasuperobject.biblemap.put("b19_119_145", new arasuperobject(19,119,145,"ق ـ صرخت من كل قلبي. استجب لي يا رب. فرائضك احفظ‎"));
arasuperobject.biblemap.put("b19_119_146", new arasuperobject(19,119,146,"‎دعوتك. خلّصني فاحفظ شهاداتك‎"));
arasuperobject.biblemap.put("b19_119_147", new arasuperobject(19,119,147,"‎تقدمت في الصبح وصرخت. كلامك انتظرت‎"));
arasuperobject.biblemap.put("b19_119_148", new arasuperobject(19,119,148,"‎تقدمت عيناي الهزع لكي الهج باقوالك‎"));
arasuperobject.biblemap.put("b19_119_149", new arasuperobject(19,119,149,"‎صوتي استمع حسب رحمتك. يا رب حسب احكامك احيني‎"));
arasuperobject.biblemap.put("b19_119_150", new arasuperobject(19,119,150,"‎اقترب التابعون الرذيلة. عن شريعتك بعدوا‎"));
arasuperobject.biblemap.put("b19_119_151", new arasuperobject(19,119,151,"‎قريب انت يا رب وكل وصاياك حق‎"));
arasuperobject.biblemap.put("b19_119_152", new arasuperobject(19,119,152,"‎منذ زمان عرفت من شهاداتك انك الى الدهر اسستها"));
arasuperobject.biblemap.put("b19_119_153", new arasuperobject(19,119,153,"ر ـ انظر الى ذلي وانقذني لاني لم انسى شريعتك‎"));
arasuperobject.biblemap.put("b19_119_154", new arasuperobject(19,119,154,"‎احسن دعواي وفكني. حسب كلمتك احيني‎"));
arasuperobject.biblemap.put("b19_119_155", new arasuperobject(19,119,155,"‎الخلاص بعيد عن الاشرار لانهم لم يلتمسوا فرائضك‎"));
arasuperobject.biblemap.put("b19_119_156", new arasuperobject(19,119,156,"‎كثيرة هي مراحمك يا رب. حسب احكامك احيني‎"));
arasuperobject.biblemap.put("b19_119_157", new arasuperobject(19,119,157,"‎كثيرون مضطهديّ ومضايقيّ. اما شهاداتك فلم امل عنها‎"));
arasuperobject.biblemap.put("b19_119_158", new arasuperobject(19,119,158,"‎رأيت الغادرين ومقت لانهم لم يحفظوا كلمتك‎"));
arasuperobject.biblemap.put("b19_119_159", new arasuperobject(19,119,159,"‎انظر اني احببت وصاياك. يا رب حسب رحمتك احيني‎"));
arasuperobject.biblemap.put("b19_119_160", new arasuperobject(19,119,160,"‎راس كلامك حق والى الدهر كل احكام عدلك"));
arasuperobject.biblemap.put("b19_119_161", new arasuperobject(19,119,161,"ش ـ رؤساء اضطهدوني بلا سبب. ومن كلامك جزع قلبي‎"));
arasuperobject.biblemap.put("b19_119_162", new arasuperobject(19,119,162,"‎ابتهج انا بكلامك كمن وجد غنيمة وافرة‎"));
arasuperobject.biblemap.put("b19_119_163", new arasuperobject(19,119,163,"‎ابغضت الكذب وكرهته. اما شريعتك فاحببتها‎"));
arasuperobject.biblemap.put("b19_119_164", new arasuperobject(19,119,164,"‎سبع مرات في النهار سبحتك على احكام عدلك‎"));
arasuperobject.biblemap.put("b19_119_165", new arasuperobject(19,119,165,"‎سلامة جزيلة لمحبي شريعتك وليس لهم معثرة‎"));
arasuperobject.biblemap.put("b19_119_166", new arasuperobject(19,119,166,"‎رجوت خلاصك يا رب ووصاياك عملت‎"));
arasuperobject.biblemap.put("b19_119_167", new arasuperobject(19,119,167,"‎حفظت نفسي شهاداتك واحبها جدا‎"));
arasuperobject.biblemap.put("b19_119_168", new arasuperobject(19,119,168,"‎حفظت وصاياك وشهاداتك لان كل طرقي امامك"));
arasuperobject.biblemap.put("b19_119_169", new arasuperobject(19,119,169,"ت ـ ليبلغ صراخي اليك يا رب. حسب كلامك فهمني‎"));
arasuperobject.biblemap.put("b19_119_170", new arasuperobject(19,119,170,"‎لتدخل طلبتي الى حضرتك . ككلمتك نجني‎"));
arasuperobject.biblemap.put("b19_119_171", new arasuperobject(19,119,171,"‎تنبع شفتاي تسبيحا اذا علمتني فرائضك‎"));
arasuperobject.biblemap.put("b19_119_172", new arasuperobject(19,119,172,"‎يغني لساني باقوالك لان كل وصاياك عدل‎"));
arasuperobject.biblemap.put("b19_119_173", new arasuperobject(19,119,173,"‎لتكن يدك لمعونتي لانني اخترت وصاياك‎"));
arasuperobject.biblemap.put("b19_119_174", new arasuperobject(19,119,174,"‎اشتقت الى خلاصك يا رب وشريعتك هي لذّتي‎"));
arasuperobject.biblemap.put("b19_119_175", new arasuperobject(19,119,175,"‎لتحي نفسي وتسبحك واحكامك لتعنّي‎"));
arasuperobject.biblemap.put("b19_119_176", new arasuperobject(19,119,176,"‎ضللت كشاة ضالة. اطلب عبدك لاني لم انس وصاياك"));
arasuperobject.biblemap.put("b19_120_1", new arasuperobject(19,120,1,"ترنيمة المصاعد‎. ‎الى الرب في ضيقي صرخت فاستجاب لي‎"));
arasuperobject.biblemap.put("b19_120_2", new arasuperobject(19,120,2,"‎يا رب نج نفسي من شفاه الكذب من لسان غش‎"));
arasuperobject.biblemap.put("b19_120_3", new arasuperobject(19,120,3,"‎ماذا يعطيك وماذا يزيد لك لسان الغش‎"));
arasuperobject.biblemap.put("b19_120_4", new arasuperobject(19,120,4,"‎سهام جبار مسنونة مع جمر الرتم‎"));
arasuperobject.biblemap.put("b19_120_5", new arasuperobject(19,120,5,"‎ويلي لغربتي في ماشك لسكني في خيام قيدار‎"));
arasuperobject.biblemap.put("b19_120_6", new arasuperobject(19,120,6,"‎طال على نفسي سكنها مع مبغض السلام‎"));
arasuperobject.biblemap.put("b19_120_7", new arasuperobject(19,120,7,"‎انا سلام وحينما اتكلم فهم للحرب"));
arasuperobject.biblemap.put("b19_121_1", new arasuperobject(19,121,1,"ترنيمة المصاعد‎. ‎ارفع عينيّ الى الجبال من حيث ياتي عوني‎"));
arasuperobject.biblemap.put("b19_121_2", new arasuperobject(19,121,2,"‎معونتي من عند الرب صانع السموات والارض‎"));
arasuperobject.biblemap.put("b19_121_3", new arasuperobject(19,121,3,"‎لا يدع رجلك تزل. لا ينعس حافظك‎"));
arasuperobject.biblemap.put("b19_121_4", new arasuperobject(19,121,4,"‎انه لا ينعس ولا ينام حافظ اسرائيل‎"));
arasuperobject.biblemap.put("b19_121_5", new arasuperobject(19,121,5,"‎الرب حافظك. الرب ظل لك عن يدك اليمنى‎"));
arasuperobject.biblemap.put("b19_121_6", new arasuperobject(19,121,6,"‎لا تضربك الشمس في النهار ولا القمر في الليل‎"));
arasuperobject.biblemap.put("b19_121_7", new arasuperobject(19,121,7,"‎الرب يحفظك من كل شر يحفظ نفسك‎"));
arasuperobject.biblemap.put("b19_121_8", new arasuperobject(19,121,8,"‎الرب يحفظ خروجك ودخولك من الآن والى الدهر"));
arasuperobject.biblemap.put("b19_122_1", new arasuperobject(19,122,1,"ترنيمة المصاعد. لداود‎. ‎فرحت بالقائلين لي الى بيت الرب نذهب‎"));
arasuperobject.biblemap.put("b19_122_2", new arasuperobject(19,122,2,"‎تقف ارجلنا في ابوابك يا اورشليم‎"));
arasuperobject.biblemap.put("b19_122_3", new arasuperobject(19,122,3,"‎اورشليم المبنية كمدينة متصلة كلها"));
arasuperobject.biblemap.put("b19_122_4", new arasuperobject(19,122,4,"حيث صعدت الاسباط اسباط الرب شهادة لاسرائيل ليحمدوا اسم الرب"));
arasuperobject.biblemap.put("b19_122_5", new arasuperobject(19,122,5,"لانه هناك استوت الكراسي للقضاء كراسي بيت داود‎"));
arasuperobject.biblemap.put("b19_122_6", new arasuperobject(19,122,6,"‎اسالوا سلامة اورشليم. ليسترح محبوك‎"));
arasuperobject.biblemap.put("b19_122_7", new arasuperobject(19,122,7,"‎ليكن سلام في ابراجك راحة في قصورك‎"));
arasuperobject.biblemap.put("b19_122_8", new arasuperobject(19,122,8,"‎من اجل اخوتي واصحابي لاقولنّ سلام بك‎"));
arasuperobject.biblemap.put("b19_122_9", new arasuperobject(19,122,9,"‎من اجل بيت الرب الهنا التمس لك خيرا"));
arasuperobject.biblemap.put("b19_123_1", new arasuperobject(19,123,1,"ترنيمة المصاعد‎. ‎اليك رفعت عينيّ يا ساكنا في السموات‎"));
arasuperobject.biblemap.put("b19_123_2", new arasuperobject(19,123,2,"‎هوذا كما ان عيون العبيد نحو ايادي ساداتهم كما ان عيني الجارية نحو يد سيدتها هكذا عيوننا نحو الرب الهنا حتى يترأف علينا‎"));
arasuperobject.biblemap.put("b19_123_3", new arasuperobject(19,123,3,"‎ارحمنا يا رب ارحمنا لاننا كثيرا ما امتلأنا هوانا‎"));
arasuperobject.biblemap.put("b19_123_4", new arasuperobject(19,123,4,"‎كثيرا ما شبعت انفسنا من هزء المستريحين واهانة المستكبرين"));
arasuperobject.biblemap.put("b19_124_1", new arasuperobject(19,124,1,"ترنيمة المصاعد. لداود‎. ‎لولا الرب الذي كان لنا ليقل اسرائيل"));
arasuperobject.biblemap.put("b19_124_2", new arasuperobject(19,124,2,"لولا الرب الذي كان لنا عندما قام الناس علينا"));
arasuperobject.biblemap.put("b19_124_3", new arasuperobject(19,124,3,"اذا لابتلعونا احياء عند احتماء غضبهم علينا"));
arasuperobject.biblemap.put("b19_124_4", new arasuperobject(19,124,4,"اذا لجرفتنا المياه لعبر السيل على انفسنا"));
arasuperobject.biblemap.put("b19_124_5", new arasuperobject(19,124,5,"اذا لعبرت على انفسنا المياه الطامية‎"));
arasuperobject.biblemap.put("b19_124_6", new arasuperobject(19,124,6,"‎مبارك الرب الذي لم يسلمنا فريسة لاسنانهم‎"));
arasuperobject.biblemap.put("b19_124_7", new arasuperobject(19,124,7,"‎انفلتت انفسنا مثل العصفور من فخ الصيادين الفخ انكسر ونحن انفلتنا‎"));
arasuperobject.biblemap.put("b19_124_8", new arasuperobject(19,124,8,"‎عوننا باسم الرب الصانع السموات والارض"));
arasuperobject.biblemap.put("b19_125_1", new arasuperobject(19,125,1,"ترنيمة المصاعد‎. ‎المتوكلون على الرب مثل جبل صهيون الذي لا يتزعزع بل يسكن الى الدهر"));
arasuperobject.biblemap.put("b19_125_2", new arasuperobject(19,125,2,"اورشليم الجبال حولها والرب حول شعبه من الآن والى الدهر‎"));
arasuperobject.biblemap.put("b19_125_3", new arasuperobject(19,125,3,"‎لانه لا تستقر عصا الاشرار على نصيب الصديقين لكيلا يمد الصديقون ايديهم الى الاثم‎"));
arasuperobject.biblemap.put("b19_125_4", new arasuperobject(19,125,4,"‎احسن يا رب الى الصالحين والى المستقيمي القلوب‎"));
arasuperobject.biblemap.put("b19_125_5", new arasuperobject(19,125,5,"‎اما العادلون الى طرق معوجة فيذهبهم الرب مع فعلة الاثم‎. ‎سلام على اسرائيل"));
arasuperobject.biblemap.put("b19_126_1", new arasuperobject(19,126,1,"ترنيمة المصاعد‎. ‎عندما رد الرب سبي صهيون صرنا مثل الحالمين‎"));
arasuperobject.biblemap.put("b19_126_2", new arasuperobject(19,126,2,"‎حينئذ امتلأت افواهنا ضحكا وألسنتنا ترنما. حينئذ قالوا بين الامم ان الرب قد عظّم العمل مع هؤلاء‏‎"));
arasuperobject.biblemap.put("b19_126_3", new arasuperobject(19,126,3,"‎عظّم الرب العمل معنا وصرنا فرحين‎"));
arasuperobject.biblemap.put("b19_126_4", new arasuperobject(19,126,4,"‎اردد يا رب سبينا مثل السواقي في الجنوب‎"));
arasuperobject.biblemap.put("b19_126_5", new arasuperobject(19,126,5,"‎الذين يزرعون بالدموع يحصدون بالابتهاج‎"));
arasuperobject.biblemap.put("b19_126_6", new arasuperobject(19,126,6,"‎الذاهب ذهابا بالبكاء حاملا مبذر الزرع مجيئا يجيء بالترنم حاملا حزمه"));
arasuperobject.biblemap.put("b19_127_1", new arasuperobject(19,127,1,"ترنيمة المصاعد. لسليمان‎. ‎ان لم يبن الرب البيت فباطلا يتعب البناؤون. ان لم يحفظ الرب المدينة فباطلا يسهر الحارس‎"));
arasuperobject.biblemap.put("b19_127_2", new arasuperobject(19,127,2,"‎باطل هو لكم ان تبكروا الى القيام مؤخرين الجلوس آكلين خبز الاتعاب. لكنه يعطي حبيبه نوما‎"));
arasuperobject.biblemap.put("b19_127_3", new arasuperobject(19,127,3,"‎هوذا البنون ميراث من عند الرب ثمرة البطن اجرة‎"));
arasuperobject.biblemap.put("b19_127_4", new arasuperobject(19,127,4,"‎كسهام بيد جبار هكذا ابناء الشبيبة‎"));
arasuperobject.biblemap.put("b19_127_5", new arasuperobject(19,127,5,"‎طوبى للذي ملأ جعبته منهم. لا يخزون بل يكلمون الاعداء في الباب"));
arasuperobject.biblemap.put("b19_128_1", new arasuperobject(19,128,1,"ترنيمة المصاعد‎. ‎طوبى لكل من يتقي الرب ويسلك في طرقه‎"));
arasuperobject.biblemap.put("b19_128_2", new arasuperobject(19,128,2,"‎لانك تأكل تعب يديك. طوباك وخير لك‎"));
arasuperobject.biblemap.put("b19_128_3", new arasuperobject(19,128,3,"‎امرأتك مثل كرمة مثمرة في جوانب بيتك. بنوك مثل غروس الزيتون حول مائدتك‎"));
arasuperobject.biblemap.put("b19_128_4", new arasuperobject(19,128,4,"‎هكذا يبارك الرجل المتقي الرب‎"));
arasuperobject.biblemap.put("b19_128_5", new arasuperobject(19,128,5,"‎يباركك الرب من صهيون وتبصر خير اورشليم كل ايام حياتك‎"));
arasuperobject.biblemap.put("b19_128_6", new arasuperobject(19,128,6,"‎وترى بني بنيك. سلام على اسرائيل"));
arasuperobject.biblemap.put("b19_129_1", new arasuperobject(19,129,1,"ترنيمة المصاعد‎. ‎كثيرا ما ضايقوني منذ شبابي ليقل اسرائيل"));
arasuperobject.biblemap.put("b19_129_2", new arasuperobject(19,129,2,"كثيرا ما ضايقوني منذ شبابي. لكن لم يقدروا عليّ‎"));
arasuperobject.biblemap.put("b19_129_3", new arasuperobject(19,129,3,"‎على ظهري حرث الحرّاث. طوّلوا اتلامهم‎"));
arasuperobject.biblemap.put("b19_129_4", new arasuperobject(19,129,4,"‎الرب صديق. قطع ربط الاشرار‎"));
arasuperobject.biblemap.put("b19_129_5", new arasuperobject(19,129,5,"‎فليخز وليرتد الى الوراء كل مبغضي صهيون‎"));
arasuperobject.biblemap.put("b19_129_6", new arasuperobject(19,129,6,"‎ليكونوا كعشب السطوح الذي ييبس قبل ان يقلع‎"));
arasuperobject.biblemap.put("b19_129_7", new arasuperobject(19,129,7,"‎الذي لا يملأ الحاصد كفه منه ولا المحزم حضنه‎"));
arasuperobject.biblemap.put("b19_129_8", new arasuperobject(19,129,8,"‎ولا يقول العابرون بركة الرب عليكم. باركناكم باسم الرب"));
arasuperobject.biblemap.put("b19_130_1", new arasuperobject(19,130,1,"ترنيمة المصاعد‎. ‎من الاعماق صرخت اليك يا رب‎"));
arasuperobject.biblemap.put("b19_130_2", new arasuperobject(19,130,2,"‎يا رب اسمع صوتي لتكن اذناك مصغيتين الى صوت تضرعاتي‎"));
arasuperobject.biblemap.put("b19_130_3", new arasuperobject(19,130,3,"‎ان كنت تراقب الآثام يا رب يا سيد فمن يقف‏‎"));
arasuperobject.biblemap.put("b19_130_4", new arasuperobject(19,130,4,"‎لان عندك المغفرة لكي يخاف منك‎"));
arasuperobject.biblemap.put("b19_130_5", new arasuperobject(19,130,5,"‎انتظرتك يا رب انتظرت نفسي وبكلامه رجوت‎"));
arasuperobject.biblemap.put("b19_130_6", new arasuperobject(19,130,6,"‎نفسي تنتظر الرب اكثر من المراقبين الصبح اكثر من المراقبين الصبح‎"));
arasuperobject.biblemap.put("b19_130_7", new arasuperobject(19,130,7,"‎ليرج اسرائيل الرب لان عند الرب الرحمة وعنده فدى كثير‎"));
arasuperobject.biblemap.put("b19_130_8", new arasuperobject(19,130,8,"‎وهو يفدي اسرائيل من كل آثامه"));
arasuperobject.biblemap.put("b19_131_1", new arasuperobject(19,131,1,"ترنيمة المصاعد. لداود‎. ‎يا رب لم يرتفع قلبي ولم تستعل عيناي ولم اسلك في العظائم ولا في عجائب فوقي‎"));
arasuperobject.biblemap.put("b19_131_2", new arasuperobject(19,131,2,"‎بل هدأت وسكت نفسي كفطيم نحو امه نفسي نحوي كفطيم‎"));
arasuperobject.biblemap.put("b19_131_3", new arasuperobject(19,131,3,"‎ليرج اسرائيل الرب من الآن والى الدهر"));
arasuperobject.biblemap.put("b19_132_1", new arasuperobject(19,132,1,"ترنيمة المصاعد‎. ‎اذكر يا رب داود كل ذله‎"));
arasuperobject.biblemap.put("b19_132_2", new arasuperobject(19,132,2,"‎كيف حلف للرب نذر لعزيز يعقوب"));
arasuperobject.biblemap.put("b19_132_3", new arasuperobject(19,132,3,"لا ادخل خيمة بيتي لا اصعد على سرير فراشي"));
arasuperobject.biblemap.put("b19_132_4", new arasuperobject(19,132,4,"لا اعطي وسنا لعينيّ ولا نوما لاجفاني"));
arasuperobject.biblemap.put("b19_132_5", new arasuperobject(19,132,5,"او اجد مقاما للرب مسكنا لعزيز يعقوب‎"));
arasuperobject.biblemap.put("b19_132_6", new arasuperobject(19,132,6,"‎هوذا قد سمعنا به في افراتة. وجدناه في حقول الوعر‎"));
arasuperobject.biblemap.put("b19_132_7", new arasuperobject(19,132,7,"‎لندخل الى مساكنه. لنسجد عند موطئ قدميه"));
arasuperobject.biblemap.put("b19_132_8", new arasuperobject(19,132,8,"قم يا رب الى راحتك انت وتابوت عزك‎"));
arasuperobject.biblemap.put("b19_132_9", new arasuperobject(19,132,9,"‎كهنتك يلبسون البر واتقياؤك يهتفون‎"));
arasuperobject.biblemap.put("b19_132_10", new arasuperobject(19,132,10,"‎من اجل داود عبدك لا ترد وجه مسيحك‎"));
arasuperobject.biblemap.put("b19_132_11", new arasuperobject(19,132,11,"‎اقسم الرب لداود بالحق لا يرجع عنه. من ثمرة بطنك اجعل على كرسيك‎"));
arasuperobject.biblemap.put("b19_132_12", new arasuperobject(19,132,12,"‎ان حفظ بنوك عهدي وشهاداتي التي اعلمهم اياها فبنوهم ايضا الى الابد يجلسون على كرسيك‎"));
arasuperobject.biblemap.put("b19_132_13", new arasuperobject(19,132,13,"‎لان الرب قد اختار صهيون اشتهاها مسكنا له‎"));
arasuperobject.biblemap.put("b19_132_14", new arasuperobject(19,132,14,"‎هذه هي راحتي الى الابد ههنا اسكن لاني اشتهيتها‎"));
arasuperobject.biblemap.put("b19_132_15", new arasuperobject(19,132,15,"‎طعامها ابارك بركة مساكينها اشبع خبزا‎"));
arasuperobject.biblemap.put("b19_132_16", new arasuperobject(19,132,16,"‎كهنتها البس خلاصا واتقياؤها يهتفون هتافا‎"));
arasuperobject.biblemap.put("b19_132_17", new arasuperobject(19,132,17,"‎هناك انبت قرنا لداود. رتبت سراجا لمسيحي‎"));
arasuperobject.biblemap.put("b19_132_18", new arasuperobject(19,132,18,"‎اعداءه البس خزيا وعليه يزهر اكليله"));
arasuperobject.biblemap.put("b19_133_1", new arasuperobject(19,133,1,"ترنيمة المصاعد. لداود‎. ‎هوذا ما احسن وما اجمل ان يسكن الاخوة معا‎"));
arasuperobject.biblemap.put("b19_133_2", new arasuperobject(19,133,2,"‎مثل الدهن الطيب على الراس النازل على اللحية لحية هرون النازل الى طرف ثيابه‎"));
arasuperobject.biblemap.put("b19_133_3", new arasuperobject(19,133,3,"‎مثل ندى حرمون النازل على جبل صهيون. لانه هناك أمر الرب بالبركة حياة الى الابد"));
arasuperobject.biblemap.put("b19_134_1", new arasuperobject(19,134,1,"ترنيمة المصاعد‎. ‎هوذا باركوا الرب يا جميع عبيد الرب الواقفين في بيت الرب بالليالي‎"));
arasuperobject.biblemap.put("b19_134_2", new arasuperobject(19,134,2,"‎ارفعوا ايديكم نحو القدس وباركوا الرب‎"));
arasuperobject.biblemap.put("b19_134_3", new arasuperobject(19,134,3,"‎يباركك الرب من صهيون الصانع السموات والارض"));
arasuperobject.biblemap.put("b19_135_1", new arasuperobject(19,135,1,"هللويا. سبحوا اسم الرب. سبحوا يا عبيد الرب"));
arasuperobject.biblemap.put("b19_135_2", new arasuperobject(19,135,2,"الواقفين في بيت الرب في ديار بيت الهنا"));
arasuperobject.biblemap.put("b19_135_3", new arasuperobject(19,135,3,"سبحوا الرب لان الرب صالح. رنموا لاسمه لان ذاك حلو‎"));
arasuperobject.biblemap.put("b19_135_4", new arasuperobject(19,135,4,"‎لان الرب قد اختار يعقوب لذاته واسرائيل لخاصته‎"));
arasuperobject.biblemap.put("b19_135_5", new arasuperobject(19,135,5,"‎لاني انا قد عرفت ان الرب عظيم وربنا فوق جميع الآلهة‎"));
arasuperobject.biblemap.put("b19_135_6", new arasuperobject(19,135,6,"‎كل ما شاء الرب صنع في السموات وفي الارض في البحار وفي كل اللجج‎"));
arasuperobject.biblemap.put("b19_135_7", new arasuperobject(19,135,7,"‎المصعد السحاب من اقاصي الارض. الصانع بروقا للمطر. المخرج الريح من خزائنه‎"));
arasuperobject.biblemap.put("b19_135_8", new arasuperobject(19,135,8,"‎الذي ضرب ابكار مصر من الناس الى البهائم‎"));
arasuperobject.biblemap.put("b19_135_9", new arasuperobject(19,135,9,"‎ارسل آيات وعجائب في وسطك يا مصر على فرعون وعلى كل عبيده‎"));
arasuperobject.biblemap.put("b19_135_10", new arasuperobject(19,135,10,"‎الذي ضرب امما كثيرة وقتل ملوكا اعزاء"));
arasuperobject.biblemap.put("b19_135_11", new arasuperobject(19,135,11,"سيحون ملك الاموريين وعوج ملك باشان وكل ممالك كنعان‎"));
arasuperobject.biblemap.put("b19_135_12", new arasuperobject(19,135,12,"‎واعطى ارضهم ميراثا. ميراثا لاسرائيل شعبه"));
arasuperobject.biblemap.put("b19_135_13", new arasuperobject(19,135,13,"يا رب اسمك الى الدهر. يا رب ذكرك الى دور فدور‎"));
arasuperobject.biblemap.put("b19_135_14", new arasuperobject(19,135,14,"‎لان الرب يدين شعبه وعلى عبيده يشفق‎"));
arasuperobject.biblemap.put("b19_135_15", new arasuperobject(19,135,15,"‎اصنام الامم فضة وذهب عمل ايدي الناس‎"));
arasuperobject.biblemap.put("b19_135_16", new arasuperobject(19,135,16,"‎لها افواه ولا تتكلم. لها اعين ولا تبصر‎"));
arasuperobject.biblemap.put("b19_135_17", new arasuperobject(19,135,17,"‎لها آذان ولا تسمع. كذلك ليس في افواهها نفس‎"));
arasuperobject.biblemap.put("b19_135_18", new arasuperobject(19,135,18,"‎مثلها يكون صانعوها وكل من يتكل عليها‎"));
arasuperobject.biblemap.put("b19_135_19", new arasuperobject(19,135,19,"‎يا بيت اسرائيل باركوا الرب. يا بيت هرون باركوا الرب‎"));
arasuperobject.biblemap.put("b19_135_20", new arasuperobject(19,135,20,"‎يا بيت لاوي باركوا الرب. يا خائفي الرب باركوا الرب‎"));
arasuperobject.biblemap.put("b19_135_21", new arasuperobject(19,135,21,"‎مبارك الرب من صهيون الساكن في اورشليم. هللويا"));
arasuperobject.biblemap.put("b19_136_1", new arasuperobject(19,136,1,"احمدوا الرب لانه صالح لان الى الابد رحمته‏‎"));
arasuperobject.biblemap.put("b19_136_2", new arasuperobject(19,136,2,"‎احمدوا اله الآلهة لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_136_3", new arasuperobject(19,136,3,"‎احمدوا رب الارباب لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_136_4", new arasuperobject(19,136,4,"‎الصانع العجائب العظام وحده لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_136_5", new arasuperobject(19,136,5,"‎الصانع السموات بفهم لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_136_6", new arasuperobject(19,136,6,"‎الباسط الارض على المياه لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_136_7", new arasuperobject(19,136,7,"‎الصانع انوارا عظيمة لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_136_8", new arasuperobject(19,136,8,"‎الشمس لحكم النهار لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_136_9", new arasuperobject(19,136,9,"‎القمر والكواكب لحكم الليل لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_136_10", new arasuperobject(19,136,10,"‎الذي ضرب مصر مع ابكارها لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_136_11", new arasuperobject(19,136,11,"‎واخرج اسرائيل من وسطهم لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_136_12", new arasuperobject(19,136,12,"‎بيد شديدة وذراع ممدودة لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_136_13", new arasuperobject(19,136,13,"‎الذي شق بحر سوف الى شقق لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_136_14", new arasuperobject(19,136,14,"‎وعبر اسرائيل في وسطه لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_136_15", new arasuperobject(19,136,15,"‎ودفع فرعون وقوته في بحر سوف لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_136_16", new arasuperobject(19,136,16,"‎الذي سار بشعبه في البرية لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_136_17", new arasuperobject(19,136,17,"‎الذي ضرب ملوكا عظماء لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_136_18", new arasuperobject(19,136,18,"‎وقتل ملوكا اعزاء لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_136_19", new arasuperobject(19,136,19,"‎سيحون ملك الاموريين لان الى الابد رحمته"));
arasuperobject.biblemap.put("b19_136_20", new arasuperobject(19,136,20,"وعوج ملك باشان لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_136_21", new arasuperobject(19,136,21,"‎واعطى ارضهم ميراثا لان الى الابد رحمته‏"));
arasuperobject.biblemap.put("b19_136_22", new arasuperobject(19,136,22,"ميراثا لاسرائيل عبده لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_136_23", new arasuperobject(19,136,23,"‎الذي في مذلتنا ذكرنا لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_136_24", new arasuperobject(19,136,24,"‎ونجانا من اعدائنا لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_136_25", new arasuperobject(19,136,25,"‎الذي يعطي خبزا لكل بشر لان الى الابد رحمته‎"));
arasuperobject.biblemap.put("b19_136_26", new arasuperobject(19,136,26,"‎احمدوا اله السموات لان الى الابد رحمته"));
arasuperobject.biblemap.put("b19_137_1", new arasuperobject(19,137,1,"على انهار بابل هناك جلسنا. بكينا ايضا عندما تذكرنا صهيون‎"));
arasuperobject.biblemap.put("b19_137_2", new arasuperobject(19,137,2,"‎على الصفصاف في وسطها علقنا اعوادنا‎"));
arasuperobject.biblemap.put("b19_137_3", new arasuperobject(19,137,3,"‎لانه هناك سألنا الذين سبونا كلام ترنيمة ومعذبونا سألونا فرحا قائلين رنموا لنا من ترنيمات صهيون"));
arasuperobject.biblemap.put("b19_137_4", new arasuperobject(19,137,4,"كيف نرنم ترنيمة الرب في ارض غريبة‎"));
arasuperobject.biblemap.put("b19_137_5", new arasuperobject(19,137,5,"‎ان نسيتك يا اورشليم تنسى يميني‎****"));
arasuperobject.biblemap.put("b19_137_6", new arasuperobject(19,137,6,"‎ليلتصق لساني بحنكي ان لم اذكرك ان لم افضل اورشليم على اعظم فرحي"));
arasuperobject.biblemap.put("b19_137_7", new arasuperobject(19,137,7,"اذكر يا رب لبني ادوم يوم اورشليم القائلين هدوا هدوا حتى الى اساسها‎"));
arasuperobject.biblemap.put("b19_137_8", new arasuperobject(19,137,8,"‎يا بنت بابل المخربة طوبى لمن يجازيك جزاءك الذي جازيتنا‎"));
arasuperobject.biblemap.put("b19_137_9", new arasuperobject(19,137,9,"‎طوبى لمن يمسك اطفالك ويضرب بهم الصخرة"));
arasuperobject.biblemap.put("b19_138_1", new arasuperobject(19,138,1,"لداود‎. ‎احمدك من كل قلبي. قدام الآلهة ارنم لك‎"));
arasuperobject.biblemap.put("b19_138_2", new arasuperobject(19,138,2,"‎اسجد في هيكل قدسك واحمد اسمك على رحمتك وحقك لانك قد عظمت كلمتك على كل اسمك‎"));
arasuperobject.biblemap.put("b19_138_3", new arasuperobject(19,138,3,"‎في يوم دعوتك اجبتني. شجعتني قوة في نفسي"));
arasuperobject.biblemap.put("b19_138_4", new arasuperobject(19,138,4,"يحمدك يا رب كل ملوك الارض اذا سمعوا كلمات فمك‎"));
arasuperobject.biblemap.put("b19_138_5", new arasuperobject(19,138,5,"‎ويرنمون في طرق الرب لان مجد الرب عظيم‎"));
arasuperobject.biblemap.put("b19_138_6", new arasuperobject(19,138,6,"‎لان الرب عال ويرى المتواضع. اما المتكبر فيعرفه من بعيد‎"));
arasuperobject.biblemap.put("b19_138_7", new arasuperobject(19,138,7,"‎ان سلكت في وسط الضيق تحيني. على غضب اعدائي تمد يدك وتخلّصني يمينك‎"));
arasuperobject.biblemap.put("b19_138_8", new arasuperobject(19,138,8,"‎الرب يحامي عني. يا رب رحمتك الى الابد. عن اعمال يديك لا تتخل"));
arasuperobject.biblemap.put("b19_139_1", new arasuperobject(19,139,1,"لامام المغنين. لداود. مزمور‎. ‎يا رب قد اختبرتني وعرفتني‎"));
arasuperobject.biblemap.put("b19_139_2", new arasuperobject(19,139,2,"‎انت عرفت جلوسي وقيامي. فهمت فكري من بعيد"));
arasuperobject.biblemap.put("b19_139_3", new arasuperobject(19,139,3,"مسلكي ومربضي ذريت وكل طرقي عرفت‎"));
arasuperobject.biblemap.put("b19_139_4", new arasuperobject(19,139,4,"‎لانه ليس كلمة في لساني الا وانت يا رب عرفتها كلها‎"));
arasuperobject.biblemap.put("b19_139_5", new arasuperobject(19,139,5,"‎من خلف ومن قدام حاصرتني وجعلت عليّ يدك‎"));
arasuperobject.biblemap.put("b19_139_6", new arasuperobject(19,139,6,"‎عجيبة هذه المعرفة فوقي ارتفعت لا استطيعها‎"));
arasuperobject.biblemap.put("b19_139_7", new arasuperobject(19,139,7,"‎اين اذهب من روحك ومن وجهك اين اهرب‎"));
arasuperobject.biblemap.put("b19_139_8", new arasuperobject(19,139,8,"‎ان صعدت الى السموات فانت هناك. وان فرشت في الهاوية فها انت"));
arasuperobject.biblemap.put("b19_139_9", new arasuperobject(19,139,9,"ان اخذت جناحي الصبح وسكنت في اقاصي البحر"));
arasuperobject.biblemap.put("b19_139_10", new arasuperobject(19,139,10,"فهناك ايضا تهديني يدك وتمسكني يمينك‎"));
arasuperobject.biblemap.put("b19_139_11", new arasuperobject(19,139,11,"‎فقلت انما الظلمة تغشاني. فالليل يضيء حولي‎"));
arasuperobject.biblemap.put("b19_139_12", new arasuperobject(19,139,12,"‎الظلمة ايضا لا تظلم لديك والليل مثل النهار يضيء. كالظلمة هكذا النور"));
arasuperobject.biblemap.put("b19_139_13", new arasuperobject(19,139,13,"لانك انت اقتنيت كليتيّ. نسجتني في بطن امي‎"));
arasuperobject.biblemap.put("b19_139_14", new arasuperobject(19,139,14,"‎احمدك من اجل اني قد امتزت عجبا. عجيبة هي اعمالك ونفسي تعرف ذلك يقينا‎"));
arasuperobject.biblemap.put("b19_139_15", new arasuperobject(19,139,15,"‎لم تختف عنك عظامي حينما صنعت في الخفاء ورقمت في اعماق الارض"));
arasuperobject.biblemap.put("b19_139_16", new arasuperobject(19,139,16,"رأت عيناك اعضائي وفي سفرك كلها كتبت يوم تصورت اذ لم يكن واحد منها‎"));
arasuperobject.biblemap.put("b19_139_17", new arasuperobject(19,139,17,"‎ما اكرم افكارك يا الله عندي ما اكثر جملتها‎"));
arasuperobject.biblemap.put("b19_139_18", new arasuperobject(19,139,18,"‎ان احصها فهي اكثر من الرمل. استيقظت وانا بعد معك‎"));
arasuperobject.biblemap.put("b19_139_19", new arasuperobject(19,139,19,"‎ليتك تقتل الاشرار يا الله. فيا رجال الدماء ابعدوا عني‎"));
arasuperobject.biblemap.put("b19_139_20", new arasuperobject(19,139,20,"‎الذين يكلمونك بالمكر ناطقين بالكذب هم اعداؤك‎"));
arasuperobject.biblemap.put("b19_139_21", new arasuperobject(19,139,21,"‎ألا ابغض مبغضيك يا رب وامقت مقاوميك‎"));
arasuperobject.biblemap.put("b19_139_22", new arasuperobject(19,139,22,"‎بغضا تاما ابغضتهم. صاروا لي اعداء"));
arasuperobject.biblemap.put("b19_139_23", new arasuperobject(19,139,23,"اختبرني يا الله واعرف قلبي امتحني واعرف افكاري‎"));
arasuperobject.biblemap.put("b19_139_24", new arasuperobject(19,139,24,"‎وانظر ان كان فيّ طريق باطل واهدني طريقا ابديا"));
arasuperobject.biblemap.put("b19_140_1", new arasuperobject(19,140,1,"لامام المغنين. مزمور لداود‎. ‎انقذني يا رب من اهل الشر. من رجل الظلم احفظني‎"));
arasuperobject.biblemap.put("b19_140_2", new arasuperobject(19,140,2,"‎الذين يتفكرون بشرور في قلوبهم. اليوم كله يجتمعون للقتال‎"));
arasuperobject.biblemap.put("b19_140_3", new arasuperobject(19,140,3,"‎سنوا ألسنتهم كحية حمة الافعوان تحت شفاههم. سلاه‎"));
arasuperobject.biblemap.put("b19_140_4", new arasuperobject(19,140,4,"‎احفظني يا رب من يدي الشرير. من رجل الظلم انقذني. الذين تفكروا في تعثير خطواتي‎"));
arasuperobject.biblemap.put("b19_140_5", new arasuperobject(19,140,5,"‎اخفى لي المستكبرون فخا وحبالا. مدوا شبكة بجانب الطريق‎. ‎وضعوا لي اشراكا. سلاه"));
arasuperobject.biblemap.put("b19_140_6", new arasuperobject(19,140,6,"قلت للرب انت الهي. اصغ يا رب الى صوت تضرعاتي‎"));
arasuperobject.biblemap.put("b19_140_7", new arasuperobject(19,140,7,"‎يا رب السيد قوة خلاصي ظللت راسي في يوم القتال‎"));
arasuperobject.biblemap.put("b19_140_8", new arasuperobject(19,140,8,"‎لا تعط يا رب شهوات الشرير. لا تنجح مقاصده. يترفعون. سلاه"));
arasuperobject.biblemap.put("b19_140_9", new arasuperobject(19,140,9,"اما رؤوس المحيطين بي فشقاء شفاههم يغطيهم‎"));
arasuperobject.biblemap.put("b19_140_10", new arasuperobject(19,140,10,"‎ليسقط عليهم جمر. ليسقطوا في النار وفي غمرات فلا يقوموا‎"));
arasuperobject.biblemap.put("b19_140_11", new arasuperobject(19,140,11,"‎رجل لسان لا يثبت في الارض. رجل الظلم يصيده الشر الى هلاكه"));
arasuperobject.biblemap.put("b19_140_12", new arasuperobject(19,140,12,"قد علمت ان الرب يجري حكما للمساكين وحقا للبائسين‎"));
arasuperobject.biblemap.put("b19_140_13", new arasuperobject(19,140,13,"‎انما الصديقون يحمدون اسمك. المستقيمون يجلسون في حضرتك‏"));
arasuperobject.biblemap.put("b19_141_1", new arasuperobject(19,141,1,"مزمور لداود‎. ‎يا رب اليك صرخت. اسرع اليّ. اصغ الى صوتي عندما اصرخ اليك‎"));
arasuperobject.biblemap.put("b19_141_2", new arasuperobject(19,141,2,"‎لتستقم صلاتي كالبخور قدامك ليكن رفع يدي كذبيحة مسائية‎"));
arasuperobject.biblemap.put("b19_141_3", new arasuperobject(19,141,3,"‎اجعل يا رب حارسا لفمي. احفظ باب شفتيّ‎"));
arasuperobject.biblemap.put("b19_141_4", new arasuperobject(19,141,4,"‎لا تمل قلبي الى امر رديء لأتعلل بعلل الشر مع اناس فاعلي اثم ولا آكل من نفائسهم"));
arasuperobject.biblemap.put("b19_141_5", new arasuperobject(19,141,5,"ليضربني الصدّيق فرحمة وليوبخني فزيت للرأس. لا يأبى راسي. لان صلاتي بعد في مصائبهم‎"));
arasuperobject.biblemap.put("b19_141_6", new arasuperobject(19,141,6,"‎قد انطرح قضاتهم من على الصخرة. وسمعوا كلماتي لانها لذيذة‎"));
arasuperobject.biblemap.put("b19_141_7", new arasuperobject(19,141,7,"‎كمن يفلح ويشق الارض تبددت عظامنا عند فم الهاوية‎"));
arasuperobject.biblemap.put("b19_141_8", new arasuperobject(19,141,8,"‎لانه اليك يا سيد يا رب عيناي. بك احتميت. لا تفرغ نفسي‎"));
arasuperobject.biblemap.put("b19_141_9", new arasuperobject(19,141,9,"‎احفظني من الفخ الذي قد نصبوه لي ومن اشراك فاعلي الاثم"));
arasuperobject.biblemap.put("b19_141_10", new arasuperobject(19,141,10,"ليسقط الاشرار في شباكهم حتى انجو انا بالكلية"));
arasuperobject.biblemap.put("b19_142_1", new arasuperobject(19,142,1,"قصيدة لداود لما كان في المغارة. صلاة بصوتي الى الرب اصرخ بصوتي الى الرب اتضرع‎"));
arasuperobject.biblemap.put("b19_142_2", new arasuperobject(19,142,2,"‎اسكب امامه شكواي. بضيقي قدامه اخبر"));
arasuperobject.biblemap.put("b19_142_3", new arasuperobject(19,142,3,"عندما اعيت روحي فيّ وانت عرفت مسلكي. في الطريق التي اسلك اخفوا لي فخا‎"));
arasuperobject.biblemap.put("b19_142_4", new arasuperobject(19,142,4,"‎انظر الى اليمين وأبصر. فليس لي عارف. باد عني المناص. ليس من يسأل عن نفسي‎"));
arasuperobject.biblemap.put("b19_142_5", new arasuperobject(19,142,5,"‎صرخت اليك يا رب. قلت انت ملجإي نصيبي في ارض الاحياء‎"));
arasuperobject.biblemap.put("b19_142_6", new arasuperobject(19,142,6,"‎اصغ الى صراخي لاني قد تذللت جدا. نجني من مضطهديّ لانهم اشد مني‎"));
arasuperobject.biblemap.put("b19_142_7", new arasuperobject(19,142,7,"‎اخرج من الحبس نفسي لتحميد اسمك. الصديقون يكتنفونني لانك تحسن اليّ"));
arasuperobject.biblemap.put("b19_143_1", new arasuperobject(19,143,1,"مزمور لداود‎. ‎يا رب اسمع صلاتي واصغ الى تضرعاتي. بامانتك استجب لي بعدلك‎"));
arasuperobject.biblemap.put("b19_143_2", new arasuperobject(19,143,2,"‎ولا تدخل في المحاكمة مع عبدك فانه لن يتبرر قدامك حيّ‎"));
arasuperobject.biblemap.put("b19_143_3", new arasuperobject(19,143,3,"‎لان العدو قد اضطهد نفسي سحق الى الارض حياتي. اجلسني في الظلمات مثل الموتى منذ الدهر‎"));
arasuperobject.biblemap.put("b19_143_4", new arasuperobject(19,143,4,"‎اعيت فيّ روحي. تحيّر في داخلي قلبي‎"));
arasuperobject.biblemap.put("b19_143_5", new arasuperobject(19,143,5,"‎تذكرت ايام القدم لهجت بكل اعمالك بصنائع يديك اتأمل‎"));
arasuperobject.biblemap.put("b19_143_6", new arasuperobject(19,143,6,"‎بسطت اليك يدي نفسي نحوك كارض يابسة. سلاه"));
arasuperobject.biblemap.put("b19_143_7", new arasuperobject(19,143,7,"اسرع اجبني يا رب. فنيت روحي لا تحجب وجهك عني فاشبه الهابطين في الجب‎"));
arasuperobject.biblemap.put("b19_143_8", new arasuperobject(19,143,8,"‎اسمعني رحمتك في الغداة لاني عليك توكلت. عرفني الطريق التي اسلك فيها لاني اليك رفعت نفسي‎"));
arasuperobject.biblemap.put("b19_143_9", new arasuperobject(19,143,9,"‎انقذني من اعدائي يا رب اليك التجأت‎"));
arasuperobject.biblemap.put("b19_143_10", new arasuperobject(19,143,10,"‎علّمني ان اعمل رضاك لانك انت الهي. روحك الصالح يهديني في ارض مستوية‎"));
arasuperobject.biblemap.put("b19_143_11", new arasuperobject(19,143,11,"‎من اجل اسمك يا رب تحييني. بعدلك تخرج من الضيق نفسي‎"));
arasuperobject.biblemap.put("b19_143_12", new arasuperobject(19,143,12,"‎وبرحمتك تستأصل اعدائي وتبيد كل مضايقي نفسي لاني انا عبدك"));
arasuperobject.biblemap.put("b19_144_1", new arasuperobject(19,144,1,"لداود‎. ‎مبارك الرب صخرتي الذي يعلم يدي القتال واصابعي الحرب‎"));
arasuperobject.biblemap.put("b19_144_2", new arasuperobject(19,144,2,"‎رحمتي وملجإي صرحي ومنقذي مجني والذي عليه توكلت المخضع شعبي تحتي‎"));
arasuperobject.biblemap.put("b19_144_3", new arasuperobject(19,144,3,"‎يا رب اي شيء هو الانسان حتى تعرفه او ابن الانسان حتى تفتكر به"));
arasuperobject.biblemap.put("b19_144_4", new arasuperobject(19,144,4,"الانسان اشبه نفخة. ايامه مثل ظل عابر"));
arasuperobject.biblemap.put("b19_144_5", new arasuperobject(19,144,5,"يا رب طأطئ سمواتك وانزل المس الجبال فتدخن‎"));
arasuperobject.biblemap.put("b19_144_6", new arasuperobject(19,144,6,"‎ابرق بروقا وبددهم. ارسل سهامك وازعجهم‎"));
arasuperobject.biblemap.put("b19_144_7", new arasuperobject(19,144,7,"‎ارسل يدك من العلاء. انقذني ونجني من المياه الكثيرة من ايدي الغرباء"));
arasuperobject.biblemap.put("b19_144_8", new arasuperobject(19,144,8,"الذين تكلمت افواههم بالباطل ويمينهم يمين كذب‎"));
arasuperobject.biblemap.put("b19_144_9", new arasuperobject(19,144,9,"‎يا الله ارنم لك ترنيمة جديدة برباب ذات عشرة اوتار ارنم لك‎"));
arasuperobject.biblemap.put("b19_144_10", new arasuperobject(19,144,10,"‎المعطي خلاصا للملوك المنقذ داود عبده من السيف السوء"));
arasuperobject.biblemap.put("b19_144_11", new arasuperobject(19,144,11,"انقذني ونجني من ايدي الغرباء الذين تكلمت افواههم بالباطل ويمينهم يمين كذب"));
arasuperobject.biblemap.put("b19_144_12", new arasuperobject(19,144,12,"لكي يكون بنونا مثل الغروس النامية في شبيبتها. بناتنا كاعمدة الزوايا منحوتات حسب بناء هيكل‎"));
arasuperobject.biblemap.put("b19_144_13", new arasuperobject(19,144,13,"‎اهراؤنا ملآنة تفيض من صنف فصنف. اغنامنا تنتج الوفا وربوات في شوارعنا‎"));
arasuperobject.biblemap.put("b19_144_14", new arasuperobject(19,144,14,"‎بقرنا محملة. لا اقتحام ولا هجوم ولا شكوى في شوارعنا‎"));
arasuperobject.biblemap.put("b19_144_15", new arasuperobject(19,144,15,"‎طوبى للشعب الذي له كهذا. طوبى للشعب الذي الرب الهه"));
arasuperobject.biblemap.put("b19_145_1", new arasuperobject(19,145,1,"تسبيحة لداود‎. ‎ارفعك يا الهي الملك وابارك اسمك الى الدهر والابد‎"));
arasuperobject.biblemap.put("b19_145_2", new arasuperobject(19,145,2,"‎في كل يوم اباركك واسبح اسمك الى الدهر والابد‎"));
arasuperobject.biblemap.put("b19_145_3", new arasuperobject(19,145,3,"‎عظيم هو الرب وحميد جدا وليس لعظمته استقصاء‎"));
arasuperobject.biblemap.put("b19_145_4", new arasuperobject(19,145,4,"‎دور الى دور يسبح اعمالك وبجبروتك يخبرون‎"));
arasuperobject.biblemap.put("b19_145_5", new arasuperobject(19,145,5,"‎بجلال مجد حمدك وامور عجائبك الهج‎"));
arasuperobject.biblemap.put("b19_145_6", new arasuperobject(19,145,6,"‎بقوة مخاوفك ينطقون وبعظمتك احدث"));
arasuperobject.biblemap.put("b19_145_7", new arasuperobject(19,145,7,"ذكر كثرة صلاحك يبدون وبعدلك يرنمون"));
arasuperobject.biblemap.put("b19_145_8", new arasuperobject(19,145,8,"الرب حنّان ورحيم طويل الروح وكثير الرحمة‎"));
arasuperobject.biblemap.put("b19_145_9", new arasuperobject(19,145,9,"‎الرب صالح للكل ومراحمه على كل اعماله‎"));
arasuperobject.biblemap.put("b19_145_10", new arasuperobject(19,145,10,"‎يحمدك يا رب كل اعمالك ويباركك اتقياؤك‎"));
arasuperobject.biblemap.put("b19_145_11", new arasuperobject(19,145,11,"‎بمجد ملكك ينطقون وبجبروتك يتكلمون"));
arasuperobject.biblemap.put("b19_145_12", new arasuperobject(19,145,12,"ليعرفوا بني آدم قدرتك ومجد جلال ملكك‎"));
arasuperobject.biblemap.put("b19_145_13", new arasuperobject(19,145,13,"‎ملكك ملك كل الدهور وسلطانك في كل دور فدور"));
arasuperobject.biblemap.put("b19_145_14", new arasuperobject(19,145,14,"الرب عاضد كل الساقطين ومقوم كل المنحنين‎"));
arasuperobject.biblemap.put("b19_145_15", new arasuperobject(19,145,15,"‎اعين الكل اياك تترجى وانت تعطيهم طعامهم في حينه‎"));
arasuperobject.biblemap.put("b19_145_16", new arasuperobject(19,145,16,"‎تفتح يدك فتشبع كل حيّ رضى‎"));
arasuperobject.biblemap.put("b19_145_17", new arasuperobject(19,145,17,"‎الرب بار في كل طرقه ورحيم في كل اعماله‎"));
arasuperobject.biblemap.put("b19_145_18", new arasuperobject(19,145,18,"‎الرب قريب لكل الذين يدعونه الذين يدعونه بالحق‎"));
arasuperobject.biblemap.put("b19_145_19", new arasuperobject(19,145,19,"‎يعمل رضى خائفيه ويسمع تضرعهم فيخلصهم‎"));
arasuperobject.biblemap.put("b19_145_20", new arasuperobject(19,145,20,"‎يحفظ الرب كل محبيه ويهلك جميع الاشرار‎"));
arasuperobject.biblemap.put("b19_145_21", new arasuperobject(19,145,21,"‎بتسبيح الرب ينطق فمي. وليبارك كل بشر اسمه القدوس الى الدهر والابد"));
arasuperobject.biblemap.put("b19_146_1", new arasuperobject(19,146,1,"هللويا. سبحي يا نفسي الرب‎"));
arasuperobject.biblemap.put("b19_146_2", new arasuperobject(19,146,2,"‎اسبح الرب في حياتي. وارنم لالهي ما دمت موجودا"));
arasuperobject.biblemap.put("b19_146_3", new arasuperobject(19,146,3,"لا تتكلوا على الرؤساء ولا على ابن آدم حيث لا خلاص عنده‎"));
arasuperobject.biblemap.put("b19_146_4", new arasuperobject(19,146,4,"‎تخرج روحه فيعود الى ترابه. في ذلك اليوم نفسه تهلك افكاره"));
arasuperobject.biblemap.put("b19_146_5", new arasuperobject(19,146,5,"طوبى لمن اله يعقوب معينه ورجاؤه على الرب الهه"));
arasuperobject.biblemap.put("b19_146_6", new arasuperobject(19,146,6,"الصانع السموات والارض البحر وكل ما فيها. الحافظ الامانة الى الابد‎"));
arasuperobject.biblemap.put("b19_146_7", new arasuperobject(19,146,7,"‎المجري حكما للمظلومين المعطي خبزا للجياع. الرب يطلق الاسرى"));
arasuperobject.biblemap.put("b19_146_8", new arasuperobject(19,146,8,"الرب يفتح اعين العمي. الرب يقوم المنحنين. الرب يحب الصديقين"));
arasuperobject.biblemap.put("b19_146_9", new arasuperobject(19,146,9,"الرب يحفظ الغرباء. يعضد اليتيم والارملة. اما طريق الاشرار‏ فيعوجه‎"));
arasuperobject.biblemap.put("b19_146_10", new arasuperobject(19,146,10,"‎يملك الرب الى الابد الهك يا صهيون الى دور فدور. هللويا"));
arasuperobject.biblemap.put("b19_147_1", new arasuperobject(19,147,1,"سبحوا الرب لان الترنم لالهنا صالح لانه ملذ. التسبيح لائق‎"));
arasuperobject.biblemap.put("b19_147_2", new arasuperobject(19,147,2,"‎الرب يبني اورشليم. يجمع منفيي اسرائيل‎"));
arasuperobject.biblemap.put("b19_147_3", new arasuperobject(19,147,3,"‎يشفي المنكسري القلوب ويجبر كسرهم‎"));
arasuperobject.biblemap.put("b19_147_4", new arasuperobject(19,147,4,"‎يحصي عدد الكواكب. يدعو كلها باسماء‎"));
arasuperobject.biblemap.put("b19_147_5", new arasuperobject(19,147,5,"‎عظيم هو ربنا وعظيم القوة. لفهمه لا احصاء‎"));
arasuperobject.biblemap.put("b19_147_6", new arasuperobject(19,147,6,"‎الرب يرفع الودعاء ويضع الاشرار الى الارض"));
arasuperobject.biblemap.put("b19_147_7", new arasuperobject(19,147,7,"اجيبوا الرب بحمد. رنموا لالهنا بعود‎"));
arasuperobject.biblemap.put("b19_147_8", new arasuperobject(19,147,8,"‎الكاسي السموات سحابا المهيئ للارض مطرا المنبت الجبال عشبا"));
arasuperobject.biblemap.put("b19_147_9", new arasuperobject(19,147,9,"المعطي للبهائم طعامها لفراخ الغربان التي تصرخ‎"));
arasuperobject.biblemap.put("b19_147_10", new arasuperobject(19,147,10,"‎لا يسر بقوة الخيل. لا يرضى بساقي الرجل‎"));
arasuperobject.biblemap.put("b19_147_11", new arasuperobject(19,147,11,"‎يرضى الرب باتقيائه بالراجين رحمته"));
arasuperobject.biblemap.put("b19_147_12", new arasuperobject(19,147,12,"سبحي يا اورشليم الرب سبحي الهك يا صهيون‎"));
arasuperobject.biblemap.put("b19_147_13", new arasuperobject(19,147,13,"‎لانه قد شدد عوارض ابوابك. بارك ابناءك داخلك‎"));
arasuperobject.biblemap.put("b19_147_14", new arasuperobject(19,147,14,"‎الذي يجعل تخومك سلاما ويشبعك من شحم الحنطة‎"));
arasuperobject.biblemap.put("b19_147_15", new arasuperobject(19,147,15,"‎يرسل كلمته في الارض سريعا جدا يجري قوله‎"));
arasuperobject.biblemap.put("b19_147_16", new arasuperobject(19,147,16,"‎الذي يعطي الثلج كالصوف ويذري الصقيع كالرماد"));
arasuperobject.biblemap.put("b19_147_17", new arasuperobject(19,147,17,"يلقي جمده كفتات. قدام برده من يقف‎"));
arasuperobject.biblemap.put("b19_147_18", new arasuperobject(19,147,18,"‎يرسل كلمته فيذيبها. يهب بريحه فتسيل المياه‎"));
arasuperobject.biblemap.put("b19_147_19", new arasuperobject(19,147,19,"‎يخبر يعقوب بكلمته واسرائيل بفرائضه واحكامه‎"));
arasuperobject.biblemap.put("b19_147_20", new arasuperobject(19,147,20,"‎لم يصنع هكذا باحدى الامم. واحكامه لم يعرفوها. هللويا"));
arasuperobject.biblemap.put("b19_148_1", new arasuperobject(19,148,1,"هللويا. سبحوا الرب من السموات سبحوه في الاعالي‎"));
arasuperobject.biblemap.put("b19_148_2", new arasuperobject(19,148,2,"‎سبحوه يا جميع ملائكته سبحوه يا كل جنوده‎"));
arasuperobject.biblemap.put("b19_148_3", new arasuperobject(19,148,3,"‎سبحيه يا ايتها الشمس والقمر سبحيه يا جميع كواكب النور‎"));
arasuperobject.biblemap.put("b19_148_4", new arasuperobject(19,148,4,"‎سبحيه يا سماء السموات ويا ايتها المياه التي فوق السموات‎"));
arasuperobject.biblemap.put("b19_148_5", new arasuperobject(19,148,5,"‎لتسبح اسم الرب لانه امر فخلقت‎"));
arasuperobject.biblemap.put("b19_148_6", new arasuperobject(19,148,6,"‎وثبتها الى الدهر والابد. وضع لها حدا فلن تتعداه"));
arasuperobject.biblemap.put("b19_148_7", new arasuperobject(19,148,7,"سبحي الرب من الارض يا ايتها التنانين وكل اللجج‎"));
arasuperobject.biblemap.put("b19_148_8", new arasuperobject(19,148,8,"‎النار والبرد الثلج والضباب الريح العاصفة الصانعة كلمته"));
arasuperobject.biblemap.put("b19_148_9", new arasuperobject(19,148,9,"الجبال وكل الآكام الشجر المثمر وكل الارز"));
arasuperobject.biblemap.put("b19_148_10", new arasuperobject(19,148,10,"الوحوش وكل البهائم الدبابات والطيور ذوات الاجنحة"));
arasuperobject.biblemap.put("b19_148_11", new arasuperobject(19,148,11,"ملوك الارض وكل الشعوب الرؤساء وكل قضاة الارض"));
arasuperobject.biblemap.put("b19_148_12", new arasuperobject(19,148,12,"الاحداث والعذارى ايضا الشيوخ مع الفتيان"));
arasuperobject.biblemap.put("b19_148_13", new arasuperobject(19,148,13,"ليسبحوا اسم الرب لانه قد تعالى اسمه وحده. مجده فوق الارض والسموات‎"));
arasuperobject.biblemap.put("b19_148_14", new arasuperobject(19,148,14,"‎وينصب قرنا لشعبه فخرا لجميع اتقيائه لبني اسرائيل الشعب القريب اليه. هللويا"));
arasuperobject.biblemap.put("b19_149_1", new arasuperobject(19,149,1,"هللويا. غنوا للرب ترنيمة جديدة تسبيحته في جماعة الاتقياء‎"));
arasuperobject.biblemap.put("b19_149_2", new arasuperobject(19,149,2,"‎ليفرح اسرائيل بخالقه. ليبتهج بنو صهيون بملكهم"));
arasuperobject.biblemap.put("b19_149_3", new arasuperobject(19,149,3,"ليسبحوا اسمه برقص. بدف وعود ليرنموا له‎"));
arasuperobject.biblemap.put("b19_149_4", new arasuperobject(19,149,4,"‎لان الرب راض عن شعبه. يجمل الودعاء بالخلاص‎"));
arasuperobject.biblemap.put("b19_149_5", new arasuperobject(19,149,5,"‎ليبتهج الاتقياء بمجد ليرنموا على مضاجعهم‎"));
arasuperobject.biblemap.put("b19_149_6", new arasuperobject(19,149,6,"‎تنويهات الله في افواههم وسيف ذو حدين في يدهم‎"));
arasuperobject.biblemap.put("b19_149_7", new arasuperobject(19,149,7,"‎ليصنعوا نقمة في الامم وتأديبات في الشعوب‎"));
arasuperobject.biblemap.put("b19_149_8", new arasuperobject(19,149,8,"‎لأسر ملوكهم بقيود وشرفائهم بكبول من حديد‎"));
arasuperobject.biblemap.put("b19_149_9", new arasuperobject(19,149,9,"‎ليجروا بهم الحكم المكتوب. كرامة هذا لجميع اتقيائه. هللويا"));
arasuperobject.biblemap.put("b19_150_1", new arasuperobject(19,150,1,"هللويا. سبحوا الله في قدسه. سبحوه في فلك قوته‎"));
arasuperobject.biblemap.put("b19_150_2", new arasuperobject(19,150,2,"‎سبحوه على قواته سبحوه حسب كثرة عظمته‎"));
arasuperobject.biblemap.put("b19_150_3", new arasuperobject(19,150,3,"‎سبحوه بصوت الصور سبحوه برباب وعود‎"));
arasuperobject.biblemap.put("b19_150_4", new arasuperobject(19,150,4,"‎سبحوه بدف ورقص. سبحوه باوتار ومزمار‎"));
arasuperobject.biblemap.put("b19_150_5", new arasuperobject(19,150,5,"‎سبحوه بصنوج التصويت سبحوه بصنوج الهتاف‎"));
arasuperobject.biblemap.put("b19_150_6", new arasuperobject(19,150,6,"‎كل نسمة فلتسبح الرب. هللويا"));

